INSERT INTO `tpt_products` VALUES ('45', 'Diamond Corner Bevel Edge Acrylic Award', null, '<ul>\n    <li><font size=\"3\">Beveled edges </font></li>\n    <li><font size=\"3\">Premium 1&quot; thick acrylic </font></li>\n    <li><font size=\"3\">Engraved text is white </font></li>\n    <li><font size=\"3\">Gold foiled wreath; $4&nbsp;(optional) </font></li>\n    <li><font size=\"3\">Sizes: </font>\n    <ul>\n        <li><font size=\"3\">4-1/2&quot; x 6-1/4&quot;&nbsp; tall </font></li>\n        <li><font size=\"3\">5-1/2&quot; x 7-1/4&quot;&nbsp; tall </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Presentation packaging is a black velveteen pouch </font></li>\n    <li><font size=\"3\">Weight:&nbsp; 2 lbs </font></li>\n    <li><font size=\"3\">Text setup is included </font></li>\n    <li><font size=\"3\">Optional logo preparation $14.75</font></li>\n    <li><font size=\"3\">Production time is 4 to 6&nbsp;days after proof approval </font></li>\n</ul>\n<p><font size=\"3\">This acrylic award is faceted, beveled and 33% thicker than most acrylic awards making it far from an ordinary rectagular acrylic with pedestal.</font></p>\n<p class=\"MsoNormal\" style=\"TEXT-ALIGN: left; MARGIN: 0in 0in 0pt\" align=\"left\"><span style=\"FONT-SIZE: 9pt; FONT-FAMILY: &quot;Arial&quot;, &quot;sans-serif&quot;\"><font size=\"3\">Each award is professionally engraved using letter styles selected to compliment the awards&rsquo; purpose.<o:p></o:p></font></span></p>\n<p class=\"MsoNormal\" style=\"TEXT-ALIGN: left; MARGIN: 0in 0in 0pt\" align=\"left\"><span style=\"FONT-SIZE: 9pt; FONT-FAMILY: &quot;Arial&quot;, &quot;sans-serif&quot;\"><o:p><font size=\"3\">&nbsp;</font></o:p></span></p>\n<p class=\"MsoNormal\" style=\"TEXT-ALIGN: left; MARGIN: 0in 0in 0pt\" align=\"left\"><span style=\"FONT-SIZE: 9pt; FONT-FAMILY: &quot;Arial&quot;, &quot;sans-serif&quot;\"><font size=\"2\"><font size=\"3\">Logos of organizations, companies, associations, government entities and others can be specified for use within the engraved text area.</font><span style=\"mso-spacerun: yes\">&nbsp;&nbsp;</span></font></span></p>\n<p class=\"MsoNormal\" style=\"TEXT-ALIGN: left; MARGIN: 0in 0in 0pt\" align=\"left\"><span style=\"FONT-SIZE: 9pt; FONT-FAMILY: &quot;Arial&quot;, &quot;sans-serif&quot;\"><span style=\"mso-spacerun: yes\"><font size=\"2\"></font></span></span></p>\n<p class=\"MsoNormal\" style=\"TEXT-ALIGN: left; MARGIN: 0in 0in 0pt\" align=\"left\"><font size=\"2\"><span style=\"FONT-SIZE: 9pt; FONT-FAMILY: &quot;Arial&quot;, &quot;sans-serif&quot;\"><span style=\"mso-spacerun: yes\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span></font><font size=\"2\">&nbsp;</font></p>', null, null, null, 'AM20100', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'abs-65_Z.jpg', 'abs-65_D.jpg', 'abs-65_A.jpg', 'N');
INSERT INTO `tpt_products` VALUES ('46', 'Gold Rising Star', null, '<ul>\n    <li><font size=\"3\">Marbleized color,&nbsp;black acrylic&nbsp;text area separated by a&nbsp;gold rising star </font></li>\n    <li><font size=\"3\">Colors available: </font>\n    <ul>\n        <li><font size=\"3\">Marbleized blue and black </font></li>\n        <li><font size=\"3\">Marbleized green and black </font></li>\n        <li><font size=\"3\">Marbleized maroon and black </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Engraved text is white </font></li>\n    <li><font size=\"3\">Polished black marble pedestal </font></li>\n    <li><font size=\"3\">Presentation packaging is a black velveteen pouch </font></li>\n    <li><font size=\"3\">Sizes: </font>\n    <ul>\n        <li><font size=\"3\">5&quot; x 7 1/2&quot; tall </font></li>\n        <li><font size=\"3\">5&quot; x 8 1/2&quot; tall </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Weight:&nbsp;&nbsp;3 lbs </font></li>\n    <li><font size=\"3\">Text set up is included </font></li>\n    <li><font size=\"3\">Add an optional logo of your own design; $14.75 set up</font> </li>\n    <li><font size=\"3\">Production time is 4 to 6&nbsp;days after proof approval</font><span style=\"FONT-SIZE: 9pt; FONT-FAMILY: &quot;Arial&quot;, &quot;sans-serif&quot;\"><font size=\"2\"><span style=\"mso-spacerun: yes\">&nbsp;</span></font></span> </li>\n</ul>', null, null, null, 'AM22105', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'PAC-09_Z.jpg', 'PAC-09_D.jpg', 'PAC-09_A.jpg', 'N');
INSERT INTO `tpt_products` VALUES ('47', 'Acrylic Oval', null, '<ul>\n    <li><font size=\"3\">Vivid marbleized color and black acrylic with two gold accent lines </font></li>\n    <li><font size=\"3\">Oval is supported by a polished black acrylic pedestal stand </font></li>\n    <li><font size=\"3\">Colors available: </font>\n    <ul>\n        <li><font size=\"3\">Marbleized blue and black </font></li>\n        <li><font size=\"3\">Marbleized&nbsp;harvest gold&nbsp;and black </font></li>\n        <li><font size=\"3\">Marbleized maroon and black </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">A black velveteen presentation pouch is&nbsp;included </font></li>\n    <li><font size=\"3\">Size: </font>\n    <ul>\n        <li><font size=\"3\">6 3/4&quot;wide&nbsp;x 5&quot; tall </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Weight:&nbsp;&nbsp;1.5 lbs </font></li>\n    <li><font size=\"3\">Text setup is included </font></li>\n    <li><font size=\"3\">Optional logo preparation $14.75</font></li>\n    <li><font size=\"3\">Production time is 4 to 7 days</font> </li>\n</ul>', null, null, null, 'AM10108', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'DT53-GD_Z.jpg', 'DT53-GD_D.jpg', 'DT53-GD_A.jpg', 'N');
