INSERT INTO `tpt_products` VALUES ('58', 'Glass and Brass', null, '<ul>\n    <li><font size=\"3\">Diamond shaped beveled edge glass </font></li>\n    <li><font size=\"3\">Gold finish metal base </font></li>\n    <li><font size=\"3\">Text is engraved directly into glass </font></li>\n    <li><font size=\"3\">Engraved text is white </font></li>\n    <li><font size=\"3\">Presentation box included </font></li>\n    <li><font size=\"3\">Sizes:&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </font>\n    <ul>\n        <li><font size=\"3\">8&quot; tall x 5 1/4&quot; wide&nbsp; </font></li>\n        <li><font size=\"3\">9&quot; tall x 5 1/2&quot; wide </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Optional&nbsp;logo set up $14.75 </font></li>\n    <li><font size=\"3\">Production time is&nbsp;3 to 5 days </font></li>\n</ul>', null, null, null, 'AM22107', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'Glassandbrass01_500.jpg', 'Glassandbrass01_250.jpg', 'Glassandbrass01_175.JPG', 'N');
INSERT INTO `tpt_products` VALUES ('59', 'Black Marble Desk Clock', null, '<ul>\n    <li><font size=\"3\">1&quot; thick highly polished black marble&nbsp;with white graining </font></li>\n    <li><font size=\"3\">A gold bezel clock is fashioned&nbsp;into marble&nbsp; </font></li>\n    <li><font size=\"3\">The black text plate is 5 1/2&quot; wide x 6 3/4&quot; tall </font></li>\n    <li><font size=\"3\">A protective felt bottom is included&nbsp;&nbsp; </font></li>\n    <li><font size=\"3\">Engraved gold text </font></li>\n    <li><font size=\"3\">Battery is included </font></li>\n    <li><font size=\"3\">Overall size:&nbsp; 8&quot; tall x 12&quot; wide &nbsp;x 1&quot; deep </font></li>\n    <li><font size=\"3\">Presentation box is included </font></li>\n    <li><font size=\"3\">Weight:&nbsp;8 lbs </font></li>\n    <li><font size=\"3\">Text set up / logo set up $14.75 </font></li>\n    <li><font size=\"3\">Production time is&nbsp;5 to 8&nbsp;days</font> </li>\n</ul>', null, null, null, 'AM10100', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'black marble desk z.JPG', 'black marble desk b.JPG', 'black marble desk thum.JPG', 'N');
