INSERT INTO `tpt_products` VALUES ('61', 'Horizon Acrylic Plaque', null, '<ul>\n    <li><font size=\"3\">Satin finished genuine walnut plaque board </font></li>\n    <li><font size=\"3\">Gold arcs separate the engravable marbleized areas from the black text area </font></li>\n    <li><font size=\"3\">Colors available: </font>\n    <ul>\n        <li><font size=\"3\">Marbleized Blue, gold dividers, and black center </font></li>\n        <li><font size=\"3\">Marbleized Green, gold dividers,&nbsp;and black center </font></li>\n        <li><font size=\"3\">Marbleized Maroon, gold dividers, and black center </font></li>\n        <li><font size=\"3\">Marbleized Harvest Gold, gold dividers, and black center </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">The plate is laser engraved resulting in beautiful white text and/or graphics </font></li>\n    <li><font size=\"3\">Sizes: </font>\n    <ul>\n        <li><font size=\"3\">10&quot; x 12&quot; </font></li>\n        <li><font size=\"3\">11&quot; x 14&quot; </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Presentation box included </font></li>\n    <li><font size=\"3\">Weight 3 lbs </font></li>\n    <li><font size=\"3\">Text set up is included </font></li>\n    <li><font size=\"3\">Text and logo engraving is included </font></li>\n    <li><font size=\"3\">Optional art logo preparation is $14.75 </font></li>\n    <li><font size=\"3\">Production time is&nbsp;6 to 12&nbsp;days</font> </li>\n</ul>', null, null, null, 'AH40104', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'DTP9-BU_Z.jpg', 'DTP9-BU_250.jpg', 'DTP9-BU_A.jpg', 'N');
