INSERT INTO `tpt_products` VALUES ('66', 'Rosewood And Acrylic', null, '<ul>\n    <li><font size=\"3\">Rosewood piano finish plaque </font></li>\n    <li><font size=\"3\">Raised bevel edge acrylic engraving plate </font></li>\n    <li><font size=\"3\">Acrylic is engraved either front or back sides </font></li>\n    <li><font size=\"3\">The acrylic is suspended from the plaque by four gold finished metal corner risers&nbsp; </font></li>\n    <li><font size=\"3\">Plaque sizes: </font>\n    <ul>\n        <li><font size=\"3\">8&quot; x 10&quot; </font></li>\n        <li><font size=\"3\">9&quot; x 12&quot; </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Presentation box included </font></li>\n    <li><font size=\"3\">Weight 2 lbs </font></li>\n    <li><font size=\"3\">Text&nbsp;set up is included </font></li>\n    <li><font size=\"3\">Optional logo set up $14.75</font></li>\n    <li><font size=\"3\">Production time is 3 to 5 days</font> </li>\n</ul>\n<p><font size=\"3\">WOW!&nbsp; This is a beautiful award plaque.&nbsp; Imported highly polished &quot;piano finished&quot; rosewood plaque with a thick bevel edge acrylic engraving area joined by gold finished risers suspend the acrylic from the rosewood plaque.</font></p>\n<p><font size=\"3\">The award recipient presented this award will know the value placed upon him or her is great indeed.&nbsp; This award is one that will be proudly displayed for others to see and appreciate.</font></p>\n<p><span style=\"FONT-SIZE: 9pt; FONT-FAMILY: &quot;Arial&quot;, &quot;sans-serif&quot;\"><font size=\"3\">Each award is professionally engraved using letter styles selected to compliment the awards&rsquo; purpose.</font></span></p>\n<p class=\"MsoNormal\" style=\"TEXT-ALIGN: left; MARGIN: 0in 0in 0pt\" align=\"left\"><span style=\"FONT-SIZE: 9pt; FONT-FAMILY: &quot;Arial&quot;, &quot;sans-serif&quot;\"><o:p><font size=\"2\">&nbsp;</font></o:p></span></p>\n<p class=\"MsoNormal\" style=\"TEXT-ALIGN: left; MARGIN: 0in 0in 0pt\" align=\"left\"><span style=\"FONT-SIZE: 9pt; FONT-FAMILY: &quot;Arial&quot;, &quot;sans-serif&quot;\"><o:p>&nbsp;</o:p></span></p>\n<p>&nbsp;</p>', null, null, null, 'AM10169', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', '7TEWb_Z.JPG', '7TEWb_D.jpg', '7TEWb_A.jpg', 'N');
INSERT INTO `tpt_products` VALUES ('68', 'Walnut Gavel and Display Pedestal', null, '<ul>\n    <li><font size=\"3\">10 1/2&quot; Walnut Gavel (removable) </font></li>\n    <li><font size=\"3\">&nbsp;Walnut stand </font></li>\n    <li><font size=\"3\">Gold&nbsp;text plate and gavel band </font></li>\n    <li><font size=\"3\">Text is black on gavel band and text plate </font></li>\n    <li><font size=\"3\">Presentation box included </font></li>\n    <li><font size=\"3\">Size of stand:&nbsp; 11 1/2&quot; long x 3 3/4&quot; deep x 1 1/4&quot; tall </font></li>\n    <li><font size=\"3\">Normal production time is 5 days following text copy approval </font></li>\n    <li><font size=\"3\">Engraving of your award text is included&nbsp; </font></li>\n    <li><font size=\"3\">Set up for logo $14.75 </font></li>\n</ul>\n<p class=\"MsoNormal\" style=\"MARGIN: 0in 0in 10pt\"><span style=\"FONT-SIZE: 9pt; FONT-FAMILY: &quot;Arial&quot;,&quot;sans-serif&quot;; LINE-HEIGHT: 115%\"><font size=\"3\">Award&nbsp; text is professionally engraved using letter styles selected to compliment the awards&rsquo; purpose.<o:p></o:p></font></span></p>\n<p class=\"MsoNormal\" style=\"MARGIN: 0in 0in 10pt\"><span style=\"FONT-SIZE: 9pt; FONT-FAMILY: &quot;Arial&quot;,&quot;sans-serif&quot;; LINE-HEIGHT: 115%\"><font size=\"3\">Logos of organizations, companies, associations, government entities and others can be specified for use within the&nbsp;text area.</font></span></p>', null, null, null, 'R1075', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'gavel1075 z.jpg', 'gavelr1075 det.jpg', 'gavel r1075.jpg', 'N');
