INSERT INTO `tpt_products` VALUES ('117', 'New Orleans', null, '<ul>\n    <li id=\"rptFeatureList__ctl1_li\"><font size=\"3\">A distinctively shaped, solid brass table clock with&nbsp;palladium accents </font></li>\n    <li id=\"rptFeatureList__ctl2_li\"><font size=\"3\">White dial clock with a glass crystal and Roman numeral hour markings </font></li>\n    <li id=\"rptFeatureList__ctl5_li\"><font size=\"3\">Quartz movement includes the AA battery. </font></li>\n    <li><font size=\"3\">Crystal clear glass suspends the clock </font></li>\n    <li><font size=\"3\">Size:&nbsp; 5 1/2&quot;&nbsp; high&nbsp;x 5 1/2&quot;&nbsp; wide x 2&quot; deep </font></li>\n    <li><font size=\"3\">Engraving of text&nbsp;is on&nbsp; a 1&quot; x 2 3/4&quot; brass plate </font></li>\n    <li><font size=\"3\">Protective felt bottom for furniture protection </font></li>\n    <li><font size=\"3\">A deluxe double hinged and padded presentation box is included&nbsp; </font></li>\n    <li><font size=\"3\">Text set up included </font></li>\n    <li><font size=\"3\">Logo set up $14.75 </font></li>\n    <li><font size=\"3\">Production time is&nbsp;5 to 8&nbsp;days </font></li>\n</ul>\n<p><font size=\"3\">This is an exceptional clock from Howard Miller.&nbsp; We have sold many of these clocks, no one has ever been disappointed with the quality or value.&nbsp; </font></p>\n<p class=\"MsoNormal\" style=\"TEXT-ALIGN: left; MARGIN: 0in 0in 0pt\" align=\"left\"><span style=\"FONT-SIZE: 9pt; FONT-FAMILY: &quot;Arial&quot;, &quot;sans-serif&quot;\"><font size=\"3\">Each award is professionally engraved using letter styles selected to compliment the awards&rsquo; purpose.<o:p></o:p></font></span></p>\n<p class=\"MsoNormal\" style=\"TEXT-ALIGN: left; MARGIN: 0in 0in 0pt\" align=\"left\"><span style=\"FONT-SIZE: 9pt; FONT-FAMILY: &quot;Arial&quot;, &quot;sans-serif&quot;\"><o:p><font size=\"3\">&nbsp;</font></o:p></span></p>\n<p class=\"MsoNormal\" style=\"TEXT-ALIGN: left; MARGIN: 0in 0in 0pt\" align=\"left\"><span style=\"FONT-SIZE: 9pt; FONT-FAMILY: &quot;Arial&quot;, &quot;sans-serif&quot;\"><font size=\"3\">Logos of organizations, companies, associations, government entities and others can be specified for use within the engraved text area.</font><span style=\"mso-spacerun: yes\">&nbsp; </span></span></p>\n<p class=\"MsoNormal\" style=\"TEXT-ALIGN: left; MARGIN: 0in 0in 0pt\" align=\"left\"><span style=\"FONT-SIZE: 9pt; FONT-FAMILY: &quot;Arial&quot;, &quot;sans-serif&quot;\"><span style=\"mso-spacerun: yes\"></span></span></p>\n<p class=\"MsoNormal\" style=\"TEXT-ALIGN: left; MARGIN: 0in 0in 0pt\" align=\"left\"><span style=\"FONT-SIZE: 9pt; FONT-FAMILY: &quot;Arial&quot;, &quot;sans-serif&quot;\"><span style=\"mso-spacerun: yes\"></span></span></p>\n<p class=\"MsoNormal\" style=\"TEXT-ALIGN: left; MARGIN: 0in 0in 0pt\" align=\"left\"><span style=\"FONT-SIZE: 9pt; FONT-FAMILY: &quot;Arial&quot;, &quot;sans-serif&quot;\"><span style=\"mso-spacerun: yes\"></span></span></p>\n<p class=\"MsoNormal\" style=\"TEXT-ALIGN: left; MARGIN: 0in 0in 0pt\" align=\"left\"><span style=\"FONT-SIZE: 9pt; FONT-FAMILY: &quot;Arial&quot;, &quot;sans-serif&quot;\"><span style=\"mso-spacerun: yes\"></span></span></p>\n<p class=\"MsoNormal\" style=\"TEXT-ALIGN: left; MARGIN: 0in 0in 0pt\" align=\"left\"><span style=\"FONT-SIZE: 9pt; FONT-FAMILY: &quot;Arial&quot;, &quot;sans-serif&quot;\"><span style=\"mso-spacerun: yes\"></span></span></p>', null, null, null, 'AM31102', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'hmiller 645217z.jpg', 'HM clock 645-217.jpg', 'hmiller 645217a.jpg', 'N');
INSERT INTO `tpt_products` VALUES ('118', 'Oceana', null, '<ul>\n    <li id=\"rptFeatureList__ctl1_li\"><font size=\"3\">A polished brass gimbaled captain&rsquo;s clock is housed in a felt lined octagonal chest </font></li>\n    <li id=\"rptFeatureList__ctl2_li\"><font size=\"3\">A push button catch will open the lid to reveal the white dial with black Roman numerals and hands with a brass second hand </font></li>\n    <li id=\"rptFeatureList__ctl3_li\"><font size=\"3\">A felt bottom protects your desk or tabletop </font></li>\n    <li id=\"rptFeatureList__ctl4_li\"><font size=\"3\">An octagon plate ( 3 &frac12;&quot;) for engraving is included (unattached) </font></li>\n    <li id=\"rptFeatureList__ctl5_li\"><font size=\"3\">Quartz movement includes the battery </font></li>\n    <li id=\"rptFeatureList__ctl6_li\"><font size=\"3\">Finished in Windsor Cherry on select hardwoods and veneers </font></li>\n    <li><font size=\"3\">Size:&nbsp; 3 1/2&quot; x 6 1/2&quot; x 5&quot;&nbsp;</font></li>\n    <li><span style=\"FONT-SIZE: 9pt; FONT-FAMILY: &quot;Arial&quot;,&quot;sans-serif&quot;\"><font size=\"3\">Text engraving is included</font></span></li>\n    <li><span style=\"FONT-SIZE: 9pt; FONT-FAMILY: &quot;Arial&quot;,&quot;sans-serif&quot;\"><font size=\"3\">Logo of your design; $13 set up<span style=\"mso-spacerun: yes\">&nbsp; </span></font></span></li>\n    <li><span style=\"FONT-SIZE: 9pt; FONT-FAMILY: &quot;Arial&quot;,&quot;sans-serif&quot;\"><font size=\"3\"><span style=\"mso-spacerun: yes\"></span>The award price is adjusted $2.00 when adding a logo</font></span></li>\n</ul>\n<p>&nbsp;</p>', null, null, null, 'AM31103', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'HM clock 645-575.jpg', 'HM clock 645-575.jpg', 'HM clock 645-575.jpg', 'N');
INSERT INTO `tpt_products` VALUES ('119', 'Graham Bracket III Clock', null, '<ul>\n    <li id=\"rptFeatureList__ctl1_li\"><font size=\"3\">Brass finished dial offers a silver chapter ring and decorative corner spandrels. </font></li>\n    <li id=\"rptFeatureList__ctl2_li\"><font size=\"3\">Durable bronze bushings. </font></li>\n    <li id=\"rptFeatureList__ctl3_li\"><font size=\"3\"><strong>Quartz,</strong> dual chime movement plays Westminster or Ave Maria chimes, and features volume control and automatic nighttime chime shut-off option. </font></li>\n    <li id=\"rptFeatureList__ctl4_li\"><font size=\"3\">Finished in Windsor Cherry on select hardwoods and veneers. </font></li>\n    <li id=\"rptFeatureList__ctl5_li\"><font size=\"3\">Automatic nighttime chime shut-off option. </font></li>\n    <li><font size=\"3\">A 1&quot; x 3 1/4&quot; brass engraving plate and up to 3 lines of engraved text are included </font></li>\n    <li><font size=\"3\">Size:&nbsp; 14 1/4&quot; x 10 1/2&quot; x 6 1/2&quot;</font></li>\n    <li><font size=\"3\">Production time is 8 to 10 days&nbsp;</font></li>\n</ul>\n<p class=\"MsoNormal\" style=\"TEXT-ALIGN: left; MARGIN: 0in 0in 0pt\" align=\"left\"><span style=\"FONT-SIZE: 9pt; FONT-FAMILY: &quot;Arial&quot;,&quot;sans-serif&quot;\"><font size=\"3\">Each award is professionally engraved using letter styles selected to compliment the awards&rsquo; purpose.<o:p></o:p></font></span></p>\n<p class=\"MsoNormal\" style=\"TEXT-ALIGN: left; MARGIN: 0in 0in 0pt\" align=\"left\"><span style=\"FONT-SIZE: 9pt; FONT-FAMILY: &quot;Arial&quot;,&quot;sans-serif&quot;\"><o:p><font size=\"3\">&nbsp;</font></o:p></span></p>\n<p class=\"MsoNormal\" style=\"TEXT-ALIGN: left; MARGIN: 0in 0in 0pt\" align=\"left\"><span style=\"FONT-SIZE: 9pt; FONT-FAMILY: &quot;Arial&quot;,&quot;sans-serif&quot;\"><font size=\"3\">Logos of organizations, companies, associations, government entities and others can be specified for use within the engraved text area.<span style=\"mso-spacerun: yes\">&nbsp;&nbsp;</span></font></span></p>\n<p class=\"MsoNormal\" style=\"TEXT-ALIGN: left; MARGIN: 0in 0in 0pt\" align=\"left\"><span style=\"FONT-SIZE: 9pt; FONT-FAMILY: &quot;Arial&quot;,&quot;sans-serif&quot;\"><span style=\"mso-spacerun: yes\"></span></span><font size=\"3\">&nbsp;</font></p>\n<p class=\"MsoNormal\" style=\"TEXT-ALIGN: left; MARGIN: 0in 0in 0pt\" align=\"left\"><font size=\"2\"><font size=\"3\">For quantities of 5 or more, please contact us for special pricing.</font> </font></p>', null, null, null, 'AM31100', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'HM clock 612-588.jpg', 'HM clock 612-588.jpg', 'HM clock 612-588 a.jpg', 'N');
INSERT INTO `tpt_products` VALUES ('120', 'Linton Mantle Clock', null, '<ul>\n    <li id=\"rptFeatureList__ctl1_li\"><font size=\"3\">Polished brass finished handle. </font></li>\n    <li id=\"rptFeatureList__ctl2_li\"><font size=\"3\">Brass finished dial offers a silver chapter ring and decorative corner spandrels. </font></li>\n    <li id=\"rptFeatureList__ctl3_li\"><font size=\"3\">Durable bronze bushings. </font></li>\n    <li id=\"rptFeatureList__ctl4_li\"><font size=\"3\">Key-wound, Westminster chime movement with chime silence option and durable bronze bushings. </font></li>\n    <li id=\"rptFeatureList__ctl5_li\"><font size=\"3\">Finished in Windsor Cherry on select hardwoods and veneers. </font></li>\n    <li><font size=\"3\">A 1&quot; x 3 1/4&quot; brass engraving plate and up to 3 lines of engraved text are included </font></li>\n    <li><font size=\"2\"><font size=\"3\">Size:&nbsp; 14 3/4&quot; tall x 11&quot; wide x 7 1/4 &quot; deep</font></font></li>\n    <li><font size=\"2\"><font size=\"3\">Production time is 6 to 12 days</font>&nbsp; </font></li>\n</ul>', null, null, null, 'AM31101', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'HM clock 613-182_Z.jpg', 'HM clock 613-182_D.jpg', 'HM clock 613-182_A.jpg', 'N');
INSERT INTO `tpt_products` VALUES ('121', 'Princeton', null, '<ul>\n    <li id=\"rptFeatureList__ctl1_li\"><font size=\"3\">Hampton Cherry finish on select hardwoods and veneers, with a decorative olive ash burl patterned back and bottom panel. </font></li>\n    <li id=\"rptFeatureList__ctl2_li\"><font size=\"3\">The swan neck pediment features a turned urn finial with a decorative shell overlay, while the base includes a decorative cutout. </font></li>\n    <li id=\"rptFeatureList__ctl3_li\"><font size=\"3\">The polished brass dial features elaborate corner spandrels and center disk with a silver chapter ring and black Arabic numerals. A stationary midnight blue moon phase provides additional accent. </font></li>\n    <li id=\"rptFeatureList__ctl4_li\"><font size=\"3\">The hinged door, framed by simple but elegant columns, allows easy access to the movement and to install the batteries. </font></li>\n    <li id=\"rptFeatureList__ctl5_li\"><font size=\"3\">Polished brass pendulum and decorative weights are visible behind the full length glass panels. </font></li>\n    <li id=\"rptFeatureList__ctl6_li\"><font size=\"3\">Requires two C-sized batteries for movement and two D-sized for the pendulum (not included). </font></li>\n    <li id=\"rptFeatureList__ctl7_li\"><font size=\"3\">Quartz, triple chime Harmonic movement plays your choice of Westminster, Ave Maria, or Bim Bam chimes, with volume control and automatic nighttime chime shut-off option. </font></li>\n    <li id=\"rptFeatureList__ctl8_li\"><font size=\"3\">Finished in Hampton Cherry on select hardwoods and veneers. </font></li>\n    <li id=\"rptFeatureList__ctl9_li\"><font size=\"3\">Adjustable levelers under each corner provide stability on uneven and carpeted floors. </font></li>\n    <li id=\"rptFeatureList__ctl10_li\"><font size=\"3\">Automatic nighttime chime shut-off option. </font></li>\n    <li id=\"rptFeatureList__ctl11_li\"><font size=\"3\">Locking door for added security. </font></li>\n    <li><font size=\"3\">Size:&nbsp;77 1/4&quot; tall x 19 1/4&quot; wide x 11&quot; deep </font></li>\n    <li><font size=\"3\">Price includes shipping to most addresses within the continental U.S. </font></li>\n    <li><font size=\"3\">A 1&quot; x 3 1/4&quot; brass award plate is included with up to 3 text lines engraved.&nbsp; Plate ships separately.</font> </li>\n</ul>', null, null, null, 'R3100', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'hm floor clock 611138.jpg', 'hm floor clock 611138.jpg', 'FLOOR CLOCK.jpg', 'N');
INSERT INTO `tpt_products` VALUES ('122', 'Everett', null, '<ul>\n    <li id=\"rptFeatureList__ctl1_li\"><font size=\"3\">This wall clock offers a classic look with its swan neck pediment, turned finial, and reeded columns with turned column caps. </font></li>\n    <li id=\"rptFeatureList__ctl2_li\"><font size=\"3\">The off-white dial showcases black Roman numerals and a raised polished brass-finished outer edge. </font></li>\n    <li id=\"rptFeatureList__ctl3_li\"><font size=\"3\">Polished brass continues within the case with a polished brass-finished pendulum and lyre. </font></li>\n    <li id=\"rptFeatureList__ctl4_li\"><font size=\"3\">Quartz, dual chime movement plays Westminster or Whittington chimes with an hour strike, volume control and automatic nighttime chime shutoff. </font></li>\n    <li id=\"rptFeatureList__ctl5_li\"><font size=\"3\">Finished in Windsor Cherry on select hardwoods and veneers. </font></li>\n    <li><font size=\"3\">Quartz clock and pendulum movements </font></li>\n    <li><font size=\"3\">Batteries are included </font></li>\n    <li><font size=\"3\">1&quot; x 3 1/2&quot; gold brass engraving plate </font></li>\n    <li><font size=\"3\">Award text engraving is included, up to 3 lines of text </font></li>\n    <li><font size=\"3\">Size:&nbsp; 26 1/4&quot; x 12 1/2&quot; x 5&quot; </font></li>\n    <li><font size=\"3\">Text set up included </font></li>\n    <li><font size=\"3\">Logo set up $14.75</font></li>\n    <li><font size=\"3\">Logos of organizations, companies, associations, government entities and others can be engraved on the pendulum fob.&nbsp; Contact us for additional information and cost</font> </li>\n    <li><font size=\"3\">Production time is 8 to 10 days</font> </li>\n</ul>', null, null, null, 'R3101', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'R3101z.jpg', 'R3101b.jpg', 'R3101a.jpg', 'N');
INSERT INTO `tpt_products` VALUES ('123', 'Christopher Mantle Clock', null, '<ul>\n    <li id=\"rptFeatureList__ctl1_li\"><font size=\"3\">The off-white dial is protected by a&nbsp;convex glass lens and&nbsp;polished brass finished bezel. </font></li>\n    <li><font size=\"3\">Black Roman numerals and a black brass second hand. </font></li>\n    <li id=\"rptFeatureList__ctl2_li\"><font size=\"3\">Quartz, battery operated movement will play Westminster chimes on the hour and also count the hour. </font></li>\n    <li id=\"rptFeatureList__ctl3_li\"><font size=\"3\">Automatic nighttime chime shut-off option </font></li>\n    <li><font size=\"3\">A 1&quot; x 3 1/4&quot; brass engraving plate and up to 3 lines of engraved text are included </font></li>\n    <li><font size=\"3\">Finished in Windsor Cherry on select hardwoods and veneeers </font></li>\n    <li><font size=\"3\">Size:&nbsp; 8 1/2&quot; tall x 17 3/4&quot; wide x 4 3/4&quot; deep </font></li>\n    <li><font size=\"3\">Text set up included </font></li>\n    <li><font size=\"3\">Production time is 5 to&nbsp;7&nbsp;days </font></li>\n</ul>\n<p><font size=\"3\">This clock is very wide making it visible when the presentation is in a large room setting.&nbsp; It is a quality Howard Miller award clock, available at moderate cost.</font></p>', null, null, null, 'AM31121', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'hm christopher mantel 635-101.jpg', 'hm christopher mantel 635-101.jpg', 'hm christopher mantel 635-101.jpg', 'N');
INSERT INTO `tpt_products` VALUES ('124', 'Rosewood Encore', null, null, null, null, null, 'R3104', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'R3104z.jpg', 'R3104b.jpg', 'R3104thum.jpg', 'N');
INSERT INTO `tpt_products` VALUES ('125', 'Townsend Display Case by Howard Miller', null, '<ul>\n    <li id=\"rptFeatureList__ctl1_li\"><font size=\"3\">Acanthus leaf molding accents the pediment along with reeded columns at the sides. </font></li>\n    <li id=\"rptFeatureList__ctl2_li\"><font size=\"3\">An adjustable power receptacle cord runs down an interior corner for lighted collectibles at every shelf level. Patent Pending. </font></li>\n    <li id=\"rptFeatureList__ctl3_li\"><font size=\"3\">The sliding glass door in the front features beveled glass and offers an unobstructed view and easy access. </font></li>\n    <li id=\"rptFeatureList__ctl4_li\"><font size=\"3\">Two incandescent lights provide an ideal illumination level for village collectibles. </font></li>\n    <li id=\"rptFeatureList__ctl5_li\"><font size=\"3\">Extra thick glass shelves offer plate grooves and can be adjusted to any level within your cabinet. </font></li>\n    <li id=\"rptFeatureList__ctl6_li\"><font size=\"3\">Finished in Windsor Cherry on select hardwoods and veneers. </font></li>\n    <li id=\"rptFeatureList__ctl7_li\"><font size=\"3\">Adjustable levelers under each corner provide stability on uneven and carpeted floors. </font></li>\n    <li id=\"rptFeatureList__ctl8_li\"><font size=\"3\">Cabinet is illuminated by an interior light. </font></li>\n    <li id=\"rptFeatureList__ctl9_li\"><font size=\"3\">Locking door for added security. </font></li>\n    <li id=\"rptFeatureList__ctl10_li\"><font size=\"3\">No-Reach&trade; light switch is conveniently located on the back of the cabinet. </font></li>\n    <li id=\"rptFeatureList__ctl11_li\"><font size=\"3\">Pad-Lock&trade; cushioned metal shelf clips increase stability and safety. </font></li>\n    <li><font size=\"2\"><font size=\"3\">Size:&nbsp; 80&quot; x 50&quot; x 21 1/2&quot;</font> </font></li>\n</ul>\n<p><font size=\"2\"><em>A beautiful case suitable for home or office!</em></font></p>', null, null, null, 'R3102', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'R3102b.JPG', 'R3102a.JPG', 'R3102.JPG', 'N');
INSERT INTO `tpt_products` VALUES ('128', 'State Identification Plaque', null, '<ul>\n    <li><font size=\"3\">Cherry finished wood plaque </font></li>\n    <li><font size=\"3\">Roman Cove plaque edge </font></li>\n    <li><font size=\"3\">Gold metalized state cut-out </font></li>\n    <li><font size=\"3\">Choice of engraving plate color</font></li>\n    <ul>\n        <li><font size=\"3\">Black </font></li>\n        <li><font size=\"3\">Red</font></li>\n        <li><font size=\"3\">Blue </font></li>\n    </ul>\n    <li><font size=\"3\">Engraving plate is accented with gold border </font></li>\n    <li><font size=\"3\">Sizes:&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </font>\n    <ul>\n        <li><font size=\"3\">7&quot; x 9&quot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </font></li>\n        <li><font size=\"3\">8&quot; x 10&quot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </font></li>\n        <li><font size=\"3\">9&quot; x 12&quot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </font></li>\n        <li><font size=\"3\">10 1/2&quot; x 13&quot;&nbsp;&nbsp;</font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Text engraving is gold on&nbsp;plate; black on state cut-out </font></li>\n    <li><font size=\"3\">Text engraving is included</font></li>\n    <li><font size=\"3\">Logo of your own design;&nbsp;$13 set up</font></li>\n    <li><font size=\"3\">Production time is 4 to 6 days</font></li>\n</ul>\n<p class=\"MsoNormal\" style=\"TEXT-ALIGN: left; MARGIN: 0in 0in 0pt\" align=\"left\"><span style=\"FONT-SIZE: 9pt; FONT-FAMILY: &quot;Arial&quot;,&quot;sans-serif&quot;\"><o:p>&nbsp;</o:p></span></p>\n<p>&nbsp;</p>', null, null, null, 'AM10116', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'psw6zoom.JPG', 'psw6detail.JPG', 'psw6thum.JPG', 'N');
