INSERT INTO `tpt_products` VALUES ('136', 'Red Alder Plaque', null, '<ul>\n    <li><font size=\"3\">Genuine Red Alder wood </font></li>\n    <li><font size=\"3\">Text is engraved directly into wood </font></li>\n    <li><font size=\"3\">Engraved text is incised, darkened wood </font></li>\n    <li><font size=\"3\">Engraving is included </font></li>\n    <li><font size=\"3\">Sizes: </font>\n    <ul>\n        <li><font size=\"3\">6&quot; x 8&quot; </font></li>\n        <li><font size=\"3\">7&quot; x 9&quot; </font></li>\n        <li><font size=\"3\">8&quot; x 10&quot; </font></li>\n        <li><font size=\"3\">9&quot; x 12&quot; </font></li>\n        <li><font size=\"3\">10 1/2&quot; x 13&quot; </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Set up:&nbsp; Text copy and layout service - included </font>\n    <ul>\n        <li><font size=\"3\">Optional Logo - $14.75 </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Production time is 6 to 8 days&nbsp;</font> </li>\n</ul>\n<p class=\"MsoNormal\" style=\"TEXT-ALIGN: left; MARGIN: 0in 0in 0pt\" align=\"left\"><span style=\"FONT-SIZE: 9pt; FONT-FAMILY: &quot;Arial&quot;,&quot;sans-serif&quot;\"><o:p><font size=\"3\">Genuine alder is a light wood of distinct character. Each plaque is uniquely grained with a smooth face texture provided by an applied clear satin finish.&nbsp; Text or text and logo for each plaque is individually laser engraved into the alder wood.&nbsp; Text characters are naturally dark after being lasered thus providing an excellent contrast between the text and&nbsp;plaque board surface.&nbsp; AwardsMart customers are always&nbsp;pleased with their red alder wood plaque awards.&nbsp; </font></o:p></span></p>\n<p class=\"MsoNormal\" style=\"TEXT-ALIGN: left; MARGIN: 0in 0in 0pt\" align=\"left\"><span style=\"FONT-SIZE: 9pt; FONT-FAMILY: &quot;Arial&quot;,&quot;sans-serif&quot;\"><o:p><font size=\"3\">&nbsp;</font></o:p></span></p>\n<p class=\"MsoNormal\" style=\"TEXT-ALIGN: left; MAR