INSERT INTO `tpt_products` VALUES ('157', 'Concave Top Perpetual', null, '<ul>\n    <li><font size=\"3\">Genuine walnut wood plaque board </font></li>\n    <li><font size=\"3\">Traditional bevel plaque edge </font></li>\n    <li><font size=\"3\">Black metal text plate </font></li>\n    <li><font size=\"3\">Engraved text is gold </font></li>\n    <li><font size=\"3\">Header plate text engraving is included </font></li>\n    <li><font size=\"3\">Text plate set up is included </font></li>\n    <li><font size=\"3\">Logo preparation $14.75 </font></li>\n    <li><font size=\"3\">Sizes available: </font>\n    <ul>\n        <li><font size=\"3\">14&quot; x 25&quot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 60 Plates </font></li>\n        <li><font size=\"3\">20&quot; x&nbsp;25&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 72&nbsp;Plates </font></li>\n        <li><font size=\"3\">20&quot; x 30&quot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 96 Plates </font></li>\n        <li><font size=\"3\">20&quot; x 30&quot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;120 Plates </font></li>\n        <li><font size=\"3\">20&quot; x 30&quot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 150 Plates </font></li>\n        <li><font size=\"3\">Other sizes, up to 270 plates, are&nbsp;available&nbsp; </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Engraving of individual name plates: </font>\n    <ul>\n        <li><font size=\"3\">1-9 at one time ; $9.25 each </font></li>\n        <li><font size=\"3\">10-49 at one time; $6.25 each </font></li>\n        <li><font size=\"3\">50 or more at one time; $5.75 each</font> </li>\n    </ul>\n    </li>\n</ul>\n<p class=\"MsoNormal\" style=\"TEXT-ALIGN: left; MARGIN: 0in 0in 0pt\" align=\"left\"><span style=\"FONT-SIZE: 9pt; FONT-FAMILY: &quot;Arial&quot;,&quot;sans-serif&quot;\"><span style=\"mso-spacerun: yes\"></span></span></p>\n<p class=\"MsoNormal\" style=\"TEXT-ALIGN: left; MARGIN: 0in 0in 0pt\" align=\"left\"><span style=\"FONT-SIZE: 9pt; FONT-FAMILY: &quot;Arial&quot;,&quot;sans-serif&quot;\"></span></p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>', null, null, null, 'AH5211', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'ppt7.jpg', 'I_Details_PPT-07.jpg', 'concave thum.jpg', 'N');
INSERT INTO `tpt_products` VALUES ('158', 'Bronze Finished Eagle Perpetual', null, '<ul>\n    <li><font size=\"3\">This massive award was originally crafted for display in a museum.&nbsp; It is big.&nbsp; It is bold.&nbsp; It is impressive! </font></li>\n    <li><font size=\"3\">The eagle is finely detailed.&nbsp; </font></li>\n    <li><font size=\"3\">Each feather and other minute details are brought to life by the artistry of the original sculpture. </font></li>\n    <li><font size=\"3\">This eagle is resin cast, coated in brass then hand oxidized which brings forth every detail of the sculpture </font></li>\n    <li><font size=\"3\">The eagle rests on a genuine walnut pedestal </font></li>\n    <li><font size=\"3\">Affixed to the pedestal on the face side is a brass plate engraved with your unique award message and four brass plates for engraving of individual award winner names </font></li>\n    <li><font size=\"3\">The remaining three sides of the pedestal can be dressed with 6 brass plates on each side.&nbsp; The cost of 6 added plates is $16.75. </font></li>\n    <li><font size=\"3\">The brass eagle is 21&quot; wide x 18&quot; tall </font></li>\n    <li><font size=\"3\">The walnut pedestal is 9&quot; wide x 6&quot; tall </font></li>\n    <li><font size=\"3\">Professional laser engraving of your text copy and logo on the heading/title plate is included </font></li>\n    <li><font size=\"3\">The engraved text / logo color is gold </font></li>\n    <li><font size=\"3\">Set up and layout of the text is included </font></li>\n    <li><font size=\"3\">Set up and preparation of logo $14.75 </font></li>\n    <li><font size=\"3\">Production time is 14 to 21 days for this award </font></li>\n    <li><font size=\"3\">Name and informational engraving on the individual award plates $9.25 each</font> </li>\n</ul>', null, null, null, 'AH40115', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'ppt9.jpg', 'I_Details_PPT-09.jpg', 'bronze finished eagle thum.jpg', 'N');
