INSERT INTO `tpt_products` VALUES ('245', 'Mahogany Color Plaque', null, '<ul>\n    <li><font size=\"3\">Mahogany finish colored wooden plaque board </font></li>\n    <li><font size=\"3\">Black and gold engraving plate accentuated with arched sides </font></li>\n    <li><font size=\"3\">Text or text and logo engrave gold </font></li>\n    <li><font size=\"3\">Engraving of text included </font></li>\n    <li><font size=\"3\">Sizes available: </font>\n    <ul>\n        <li><font size=\"3\">7&quot; x 9&quot; </font></li>\n        <li><font size=\"3\">8&quot; x 10&quot; </font></li>\n        <li><font size=\"3\">9&quot; x 12&quot; </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Set up </font>\n    <ul>\n        <li><font size=\"3\">Text engraving&nbsp;is included&nbsp; </font></li>\n        <li><font size=\"3\">Optional&nbsp;logo $14.75 </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Production time is 3 to 4 days </font></li>\n</ul>\n<p><font size=\"3\">For quantities of 6 or more, call for special pricing</font> </p>', null, null, null, 'R2220', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'R2220z.jpg', 'R2220det.jpg', 'R2220 _SML.jpg', 'N');
INSERT INTO `tpt_products` VALUES ('246', 'Blue on Blue', null, '<ul>\n    <li><font size=\"3\">Blue finish colored wooden plaque </font></li>\n    <li><font size=\"3\">Blue and gold engraving plate accentuated with gold arched sides </font></li>\n    <li><font size=\"3\">Complimentary gold text or text and logo </font></li>\n    <li><font size=\"3\">Engraving of text included </font></li>\n    <li><font size=\"3\">Sizes available: </font>\n    <ul>\n        <li><font size=\"3\">7&quot; x 9&quot; </font></li>\n        <li><font size=\"3\">8&quot; x 10&quot; </font></li>\n        <li><font size=\"3\">9&quot; x 12&quot; </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Set up </font>\n    <ul>\n        <li><font size=\"3\">Text engraving is included </font></li>\n        <li><font size=\"3\">Set up Logo $14.75 </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Production 3 to 4 days </font></li>\n</ul>\n<p><font size=\"3\">For quantities of 6 or more, call for special pricing</font> </p>', null, null, null, 'R2221', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'R2221z.jpg', 'R2221_MED blue.jpg', 'R2221 _SML.jpg', 'N');
INSERT INTO `tpt_products` VALUES ('247', 'Green On Green', null, '<ul>\n    <li><font size=\"3\">Green finish colored wooden plaque board </font></li>\n    <li><font size=\"3\">Green and gold metal engraving plate accentuated with gold arched sides </font></li>\n    <li><font size=\"3\">Text or text and logo is engraved in complimentary gold </font></li>\n    <li><font size=\"3\">Engraving of text included </font></li>\n    <li><font size=\"3\">Sizes available: </font>\n    <ul>\n        <li><font size=\"3\">7&quot; x 9&quot; </font></li>\n        <li><font size=\"3\">8&quot; x 10&quot; </font></li>\n        <li><font size=\"3\">9&quot; x 12&quot; </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Set up </font>\n    <ul>\n        <li><font size=\"3\">Text engraving is included </font></li>\n        <li><font size=\"3\">Set up logo engraving $14.75 </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Production time is 3 </font><font size=\"3\">to 4 days </font></li>\n</ul>\n<p><font size=\"3\">For quantities of 6 or more, call for special pricing</font></p>', null, null, null, 'R2222', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'R2222z.jpg', 'R2222_MED green.jpg', 'R2222  thum.JPG', 'N');
INSERT INTO `tpt_products` VALUES ('248', 'Maroon on Maroon', null, '<ul>\n    <li><font size=\"3\">Maroon finish colored wooden plaque board </font></li>\n    <li><font size=\"3\">Maroon and gold engraving plate accentuated with gold arched sides </font></li>\n    <li><font size=\"3\">Text or text and logo is gold complimenting the maroon and gold plate </font></li>\n    <li><font size=\"3\">Engraving of text included </font></li>\n    <li><font size=\"3\">Sizes available: </font>\n    <ul>\n        <li><font size=\"3\">7&quot; x 9&quot; </font></li>\n        <li><font size=\"3\">8&quot; x 10&quot; </font></li>\n        <li><font size=\"3\">9&quot; x 12&quot; </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Set up </font>\n    <ul>\n        <li><font size=\"3\">Text engraving is included </font></li>\n        <li><font size=\"3\">Optional&nbsp;logo $14.75 </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Production 3 to 4 days </font></li>\n</ul>', null, null, null, 'R2223', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'R2223z.jpg', 'R2223 detail.jpg', 'R2223 _SML.jpg', 'N');
INSERT INTO `tpt_products` VALUES ('249', 'Cherry Wood Cap On Marble', null, '<ul>\n    <li><font size=\"3\">Genuine green marble is engraved&nbsp;to recognize your recipient </font></li>\n    <li><font size=\"3\">Cherry wood finish cap the top and bottom of this natural stone award </font></li>\n    <li><font size=\"3\">Engraved text or text and logo are color filled to compliment gold trim in the cherry wood caps </font></li>\n    <li><font size=\"3\">Sizes available:&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Weight: </font>\n    <ul>\n        <li><font size=\"3\">6&quot; x 8&quot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 1.5&nbsp; lbs </font></li>\n        <li><font size=\"3\">7&quot; x 9&quot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;2.0&nbsp; lbs </font></li>\n        <li><font size=\"3\">8&quot; x 10&quot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 3.0&nbsp; lbs </font></li>\n        <li><font size=\"3\">9&quot; x 12&quot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 4.0&nbsp; lbs </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Includes an easel back for desk display and ring hanger for wall mounting </font></li>\n    <li><font size=\"3\">Presentation box is included </font></li>\n    <li><font size=\"3\">Text set up / logo set up $14.75 </font></li>\n    <li><font size=\"3\">Production time is 7 to&nbsp;10 days&nbsp;days following text proof approval</font> </li>\n</ul>', null, null, null, 'AR0410', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'R0410_MED .jpg', 'r0410 med2.jpg', 'r0410 med 1.jpg', 'N');
INSERT INTO `tpt_products` VALUES ('251', 'Cherry Wood Capped Black Marble', null, '<ul>\n    <li><font size=\"3\">Jet black genuine marble plaque </font></li>\n    <li><font size=\"3\">Cherry wood finish and brass accents </font></li>\n    <li><font size=\"3\">Engraved text or text and logo is white </font></li>\n    <li><font size=\"3\">Sizes available:&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Weight: </font>\n    <ul>\n        <li><font size=\"3\">6&quot; x 8&quot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 1.5&nbsp;&nbsp;&nbsp; lbs </font></li>\n        <li><font size=\"3\">7&quot; x 9&quot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;2.25&nbsp; lbs </font></li>\n        <li><font size=\"3\">8&quot; x 10&quot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 3.0&nbsp;&nbsp;&nbsp;&nbsp;lbs </font></li>\n        <li><font size=\"3\">9&quot; x 12&quot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 4.0&nbsp;&nbsp;&nbsp; lbs </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Includes an easel back for desk display and ring hanger for wall mounting </font></li>\n    <li><font size=\"3\">Presentation box is included </font></li>\n    <li><font size=\"3\">Text set up is included</font> </li>\n    <li><font size=\"3\">Logo of your own design; $14.75 set-up</font> </li>\n    <li><font size=\"3\">Production time is 6 to 10&nbsp;days&nbsp;</font><font size=\"3\"> </font></li>\n</ul>', null, null, null, 'AR0412', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'R0412_MED .jpg', 'r0412 med 2.jpg', 'r0412 med 1.jpg', 'N');
INSERT INTO `tpt_products` VALUES ('253', 'Gray slate plaque', null, '<ul>\n    <li><font size=\"3\">Natural gray slate plaque </font></li>\n    <li><font size=\"3\">Text or text and logo lased directly on stone </font></li>\n    <li><font size=\"3\">Text or text and logo paint filled </font></li>\n    <li><font size=\"3\">Sizes available:&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Weight: </font>\n    <ul>\n        <li><font size=\"3\">5&quot; x 7&quot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 1.75 lbs </font></li>\n        <li><font size=\"3\">6&quot; x 8&quot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;2.0&nbsp;&nbsp;&nbsp;lbs </font></li>\n        <li><font size=\"3\">7&quot; x 9&quot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;2.25 lbs </font></li>\n        <li><font size=\"3\">8&quot; x 10&quot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;2.75 lbs </font></li>\n        <li><font size=\"3\">9&quot; x 12&quot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 3.75 lbs </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Includes an easel back for desk display and a ring hanger for wall mounting. </font></li>\n    <li><font size=\"3\">Presentation box is included </font></li>\n    <li><font size=\"3\">Text set up / Logo set up $14.75</font></li>\n</ul>\n<p><font size=\"3\">Multi-colored slate corners the market in displaying the unique patterns and colors as only found in nature.&nbsp; To further accentuate its splendor, golden highlights abound on the Slate Plaque framing your own unique statement.&nbsp; </font></p>\n<p><font size=\"3\">Production time is 6 days follwoing text proof approval.</font></p>\n<p><font size=\"3\">For quantities of 3 or more, call for special pricing. </font></p>\n<p>&nbsp;</p>', null, null, null, 'R0414', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'R0414_MED .jpg', 'r0414 med  2.jpg', 'r0414 med  1.jpg', 'N');
INSERT INTO `tpt_products` VALUES ('254', 'Gray slate with cherry wood frame', null, '<ul>\n    <li><font size=\"3\">Gray slate stone plaque </font></li>\n    <li><font size=\"3\">Cherry wood finish caps with gold trim&nbsp;accentuate glass and marble </font></li>\n    <li><font size=\"3\">Glass is engraved white front or back </font></li>\n    <li><font size=\"3\">Sizes available:&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Weight: </font>\n    <ul>\n        <li><font size=\"3\">6&quot; x 8&quot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 2.5&nbsp;&nbsp;&nbsp; lbs </font></li>\n        <li><font size=\"3\">7&quot; x 9&quot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 3.5&nbsp;&nbsp;&nbsp; lbs </font></li>\n        <li><font size=\"3\">8&quot; x 10&quot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 4.75&nbsp; lbs </font></li>\n        <li><font size=\"3\">9&quot; x 12&quot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 5.0&nbsp;&nbsp;&nbsp; lbs </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Includes an easel back for desk display and a ring hanger for wall mounting. </font></li>\n    <li><font size=\"3\">Presentation box is included </font></li>\n    <li><font size=\"3\">Text set up is included </font></li>\n    <li><font size=\"3\">Logo set up $14.75 </font></li>\n    <li><font size=\"3\">Production time is 6 days following text proof approval </font></li>\n</ul>\n<p><font size=\"3\">The thrill of winning an award is heightened when the awards are exquisite ageless designs.&nbsp; Elevating a glass panel above the radiant natural slate background allows your etched message to stand out and cast an intriguing shadow.&nbsp; For a touch of rich tradition, gold-trimmed, cherry-finished wood blends harmoniously with the warm tones of slate.</font></p>\n<p><font size=\"3\">Call for special pricing when ordering quantities of 3 or more.</font> </p>', null, null, null, 'AR0415', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'R0415_MED .jpg', 'r0415 med 2.jpg', 'r0415 med 1.jpg', 'N');
INSERT INTO `tpt_products` VALUES ('255', 'Black and Gold Piano Finish Plaque', null, '<ul>\n    <li><font size=\"3\">Black piano finish plaque </font></li>\n    <li><font size=\"3\">Black and gold engraving plate </font></li>\n    <li><font size=\"3\">Sizes: </font>\n    <ul>\n        <li><font size=\"3\">7&quot; x 9&quot; </font></li>\n        <li><font size=\"3\">8&quot; x 10&quot; </font></li>\n        <li><font size=\"3\">9&quot; x 12&quot; </font></li>\n        <li><font size=\"3\">10.5&quot; x 13&quot; </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Set up:&nbsp; </font>\n    <ul>\n        <li><font size=\"3\">Text copy and layout service is included </font></li>\n        <li><font size=\"3\">A logo of your own design can be added for a first time set up fee of $14.75 </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Production time is 2 to 4 days </font></li>\n</ul>\n<p><font size=\"3\">This is an exceptionally beautiful piano finish plaque that is perfect for formal recognition opportunities. This plaque is built using a highly polished premium ebony black plaque panel and a gilt trimmed brass engraving plate.&nbsp; The plaque makes a stunning presentation of your award message with golden brass lettering.</font></p>\n<p><font size=\"3\">For quantities of 12 or more, please call for special pricing.</font> </p>', null, null, null, 'R2224', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'R2224_500.jpg', 'R2224_250.jpg', 'R2224_175.jpg', 'N');
INSERT INTO `tpt_products` VALUES ('256', 'Rosewood Piano Finish', null, '<ul>\n    <li><font size=\"3\">High gloss piano finished rosewood plaque </font></li>\n    <li><font size=\"3\">Corner embellishments on engraving plate </font></li>\n    <li><font size=\"3\">Text or text and logo are engraved gold on black metallic plate </font></li>\n    <li><font size=\"3\">Sizes available: </font>\n    <ul>\n        <li><font size=\"3\">7&quot; x 9&quot; </font></li>\n        <li><font size=\"3\">8&quot; x 10&quot; </font></li>\n        <li><font size=\"3\">9&quot; x 12&quot; </font></li>\n        <li><font size=\"3\">10.5&quot; x 13&quot; </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Set up:&nbsp; </font>\n    <ul>\n        <li><font size=\"3\">Text copy and layout service&nbsp;is included </font></li>\n        <li><font size=\"3\">Optional&nbsp;Logo:&nbsp; $14.75 </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Normal production time is 1- 3 days </font></li>\n</ul>\n<p><font size=\"3\">This is an exceptionally beautiful piano finish plaque that is perfect for formal recognition opportunities.&nbsp; This highly polished &quot;piano finished&quot; imported rosewood plaque panel and gilt trimmed brass engraving plate are crated together to form a perfect presentation award.&nbsp; The laser engraved gold brass text lettering is enhanced by the gilt corner and border accents of the brass engraving plate.&nbsp; This award photographs well and looks great when displayed in a home or office.&nbsp; </font></p>\n<p><font size=\"3\">For quantities of 6 or more, please contact AwardsMart for special pricing.</font>&nbsp; </p>', null, null, null, 'R2225', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'R2225a_MED.jpg', 'R2225a_MED 2.jpg', 'R2225a_thum.JPG', 'N');
INSERT INTO `tpt_products` VALUES ('257', 'Black Piano Wood And Glass', null, '<ul>\n    <li><font size=\"3\">Ebony black plaque </font></li>\n    <li><font size=\"3\">Chrome risers elevate engraved glass </font></li>\n    <li><font size=\"3\">Sizes: </font>\n    <ul>\n        <li><font size=\"3\">8&quot; x 10&quot; </font></li>\n        <li><font size=\"3\">9&quot; x 12&quot; </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Set up:&nbsp; </font>\n    <ul>\n        <li><font size=\"3\">Text copy and layout service is included </font></li>\n        <li><font size=\"3\">Optional logo:&nbsp; $14.75 </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Production time is 3 to 5 days </font></li>\n</ul>\n<p><font size=\"3\">This is a very substantial award.&nbsp; The thick beveled edge glass is offset from the highly polished premium ebony black plaque panel by chromed risers.&nbsp; Your award text is engraved by a high powered laser to achieve an opaque white lettering.&nbsp; The lettering contrast is further enhanced by the ebony black plaque.&nbsp; This award plaque bespeaks the quality and value of the recipient. </font></p>\n<p><font size=\"3\">For quantities of 6 or more, please call for special pricing.</font>&nbsp; </p>', null, null, null, 'R2226', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'R2226 zoom.jpg', 'R2226_250.jpg', 'R2226 thum.jpg', 'N');
INSERT INTO `tpt_products` VALUES ('258', 'Rosewood Piano Wood And Glass', null, '<ul>\n    <li><font size=\"3\">Rosewood piano finish plaque </font></li>\n    <li><font size=\"3\">Bevel edge glass plate&nbsp;is engraved on either front or back side </font></li>\n    <li><font size=\"3\">Glass is&nbsp;suspended from plaque by four gold metal&nbsp;risers </font></li>\n    <li><font size=\"3\">Presentation box included </font></li>\n    <li><font size=\"3\">Plaque sizes: </font>\n    <ul>\n        <li><font size=\"3\">8&quot; x 10&quot; </font></li>\n        <li><font size=\"3\">9&quot; x 12&quot; </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Text copy and layout service is included </font></li>\n    <li><font size=\"3\">A logo of your own design can be added for a first time set up fee of $14.75 </font></li>\n    <li><font size=\"3\">Production time is 3 to 6 days </font></li>\n</ul>\n<p><font size=\"3\">WOW!&nbsp; This is a beautiful award plaque.&nbsp; Imported highly polished &quot;piano finished&quot; rosewood plaque with a thick bevel edge glass engraving area.&nbsp; The rosewood and glass are joined by gold metal pegs which suspend the glass above the rosewood plaque panel.&nbsp; </font></p>\n<p><font size=\"3\">The award recipient presented this award will know the value placed upon him or her is very great indeed.&nbsp; This award is one that will be proudly displayed for others to see and appreciate.</font></p>\n<p class=\"MsoNormal\" style=\"TEXT-ALIGN: left; MARGIN: 0in 0in 0pt\" align=\"left\"><span style=\"FONT-SIZE: 9pt; FONT-FAMILY: &quot;Arial&quot;,&quot;sans-serif&quot;\"><font size=\"3\">Each award is professionally engraved using letter styles selected to compliment the awards&rsquo; purpose.<o:p></o:p></font></span></p>\n<p class=\"MsoNormal\" style=\"TEXT-ALIGN: left; MARGIN: 0in 0in 0pt\" align=\"left\"><span style=\"FONT-SIZE: 9pt; FONT-FAMILY: &quot;Arial&quot;,&quot;sans-serif&quot;\"><o:p><font size=\"3\">&nbsp;</font></o:p></span></p>\n<p class=\"MsoNormal\" style=\"TEXT-ALIGN: left; MARGIN: 0in 0in 0pt\" align=\"left\"><span style=\"FONT-SIZE: 9pt; FONT-FAMILY: &quot;Arial&quot;,&quot;sans-serif&quot;\"><font size=\"3\">For quantities of&nbsp;12 or more, call AwardsMart for special pricing.<o:p></o:p></font></span></p>\n<p class=\"MsoNormal\" style=\"TEXT-ALIGN: left; MARGIN: 0in 0in 0pt\" align=\"left\"><span style=\"FONT-SIZE: 9pt; FONT-FAMILY: &quot;Arial&quot;,&quot;sans-serif&quot;\"><o:p>&nbsp;</o:p></span></p>\n<p>&nbsp;</p>', null, null, null, 'R2227', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'R2227 zoom.jpg', 'R2227a_MED_250.jpg', 'R2227thum.jpg', 'N');
