INSERT INTO `tpt_products` VALUES ('309', 'Shadow Box Frames', null, '<ul>\n    <li><font size=\"3\">Traditional solid cherry with an elegant Queen Anne cherry finish </font></li>\n    <li><font size=\"3\">Distinctive gold accent moulding </font></li>\n    <li><font size=\"3\">Durable masonite backing </font></li>\n    <li><font size=\"3\">1/8&quot; glass front </font></li>\n    <li><font size=\"3\">Velcro compatible material available in colors listed: </font>\n    <ul>\n        <li><font size=\"3\">Red </font></li>\n        <li><font size=\"3\">Royal blue </font></li>\n        <li><font size=\"3\">Black </font></li>\n        <li><font size=\"3\">Burgundy </font></li>\n        <li><font size=\"3\">Green </font></li>\n        <li><font size=\"3\">Gray </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Sizes available: </font>\n    <ul>\n        <li><font size=\"3\">12 1/2&quot; width x 15 1/2&quot; height x 1 9/16&quot; deep </font></li>\n        <li><font size=\"3\">14&quot; width x 20&quot; height x 1 9/16&quot; deep </font></li>\n    </ul>\n    </li>\n</ul>\n<p><font size=\"3\">These display shadow box frames&nbsp;proudly display medals of service and valor, patches, tags, and flag of the honored, loved one.&nbsp; The shadow box frame is USA made, crafted from select Appalachian hardwood and the glass face protects the contents from inquiring fingers, moisure and dirt.</font></p>\n<p><font size=\"3\">This memorial shadow box is exceptionaly in quality and the box and the contents can be handed down from generation to generation.</font>&nbsp; </p>', null, null, null, 'AH6101', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'large sq flag.JPG', 'pfc6-6_250.jpg', 'pfc6-6fdc med small sq flag.JPG', 'N');
INSERT INTO `tpt_products` VALUES ('310', 'Framed Silver Trays', null, '<ul>\n    <li><font size=\"3\">Natural rosewood finish wood frame </font></li>\n    <li><font size=\"3\">Burgundy velvetex frame matte </font></li>\n    <li><font size=\"3\">Glass face enclosure </font></li>\n    <li><font size=\"3\">Silver plate tray </font></li>\n    <li><font size=\"3\">2 sizes available: </font>\n    <ul>\n        <li><font size=\"3\">8&quot; tray with 11 1/2&quot; square frame </font></li>\n        <li><font size=\"3\">10&quot; tray with 13 1/2&quot; square frame </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Silver tray will be professionally engraved including up to 5 lines of text with fancy, fine-line diamond engraving </font></li>\n    <li><font size=\"3\">Engraving service is included </font></li>\n    <li><font size=\"3\">Production time is 7-10 days </font></li>\n</ul>\n<p><font size=\"3\">for quantities of 6 or more, call for special pricing.</font> </p>\n<p>&nbsp;</p>', null, null, null, 'AM10171', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'framed silver zoom.JPG', 'framed silver med.JPG', 'framed silver small.JPG', 'N');
