INSERT INTO `tpt_products` VALUES ('327', 'Summit Crystal', null, '<ul>\n    <li><font size=\"3\">Perfection in optic crystal </font></li>\n    <li><font size=\"3\">Beautifully beveled for maximum light reflection </font></li>\n    <li><font size=\"3\">Deeply engraved by precise lasers - included one position </font></li>\n    <li><font size=\"3\">Packaged in a hinged top, satin-lined, presentation case </font></li>\n    <li><font size=\"3\">Text set up / logo set up $14.75 </font></li>\n    <li><font size=\"3\">Production time is 6 to10&nbsp;days following text proof approval </font></li>\n</ul>\n<p><font size=\"3\">The quality of optic crystal awards is always appreciated.&nbsp; The unique shape of this award adds interest and value to your recipient.</font></p>\n<p><font size=\"3\">Call for special pricing for quantities of 6 or more</font></p>', null, null, null, 'R0201', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'R0201b.JPG', 'R0201a.JPG', 'r0201thum.jpg', 'N');
