INSERT INTO `tpt_products` VALUES ('330', 'Sunflower', null, '<ul>\n    <li><font size=\"3\">Perfection in optic crystal </font></li>\n    <li><font size=\"3\">Beautifully beveled for maximum light refraction </font></li>\n    <li><font size=\"3\">Deeply engraved by precise lasers - included one position </font></li>\n    <li><font size=\"3\">Packaged in a hinged top, satin lined, presentation case </font></li>\n    <li><font size=\"3\">Text set up / logo set up $14.75 </font></li>\n    <li><font size=\"3\">Production time is 6 days following text proof approval </font></li>\n</ul>\n<p><font size=\"3\">The quality of optic crystal awards is always admired and appreciated.&nbsp;The traditional round shape of this award and the many facets reflecting light adds interest, beauty, and value to your recipient.</font></p>\n<p><font size=\"3\">For quantities of 6 or more, call for special pricing</font></p>', null, null, null, 'R0203', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'R0203b.JPG', 'R0203a.JPG', 'R0203thum.jpg', 'N');
INSERT INTO `tpt_products` VALUES ('331', 'Paramount Optic Crystal Award', null, '<ul>\n    <li><font size=\"3\">Optic crystal perfection </font></li>\n    <li><font size=\"3\">Maximum light refraction through beautifully beveled edges </font></li>\n    <li><font size=\"3\">Deeply engraved by precise lasers - included one position </font></li>\n    <li><font size=\"3\">Packaged in a hinged top, satin lined, presentation case </font></li>\n    <li><font size=\"3\">3&quot; thick </font></li>\n    <li><font size=\"3\">Text setup is included </font></li>\n    <li><font size=\"3\">A logo of your own design can be added for a first time set-up fee of $14.75 </font></li>\n    <li><font size=\"3\">Production time is 6 to 8&nbsp;days</font> </li>\n</ul>\n<p><font size=\"2\"><font size=\"3\">The quality of optic crystal awards is always admired and appreciated. The unique crystal globe at the peak of this award adds interest and value to your recipient.</font>&nbsp; </font></p>', null, null, null, 'R0204', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'R0204b.JPG', 'R0204a.JPG', 'R0204thum.jpg', 'N');
INSERT INTO `tpt_products` VALUES ('332', 'Peacock Optic Crystal Award', null, '<ul>\n    <li><font size=\"3\">Maximum light refraction enhanced by the beautifully beveled edges </font></li>\n    <li><font size=\"3\">Precise lasering deeply engraves the award </font></li>\n    <li><font size=\"3\">Packaged in a hinged top, satin lined, presentation case </font></li>\n    <li><font size=\"3\">The genuine black marble pedestal is unattached and ships in a separate box </font></li>\n    <li><font size=\"3\">Logo set up $14.75</font> </li>\n    <li><font size=\"3\">Production time is 6 to 12&nbsp;days following text proof approval </font></li>\n</ul>\n<p><font size=\"3\">The quality and perfection of optic crystal awards is always admired and appreciated.&nbsp; The unique crystal shape and hand cuts of this award add interest and value for your recipient.&nbsp; This award is 2 3/8&quot; thick.</font></p>', null, null, null, 'R0205', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'R0205b.JPG', 'R0205a.JPG', 'R0205thum.jpg', 'N');
INSERT INTO `tpt_products` VALUES ('333', 'Emporer Crystal Trophy', null, '<ul>\n    <li><font size=\"3\">The optic crystal tower is beautiflly beveled for maximum light refraction </font></li>\n    <li><font size=\"3\">The tower is deeply engraved by precise lasers - included one position </font></li>\n    <li><font size=\"3\">Packaged in a hinged top, satin lined, presentation case </font></li>\n    <li><font size=\"3\">The genuine black marble pedestal is unattached and ships in a separate box </font></li>\n    <li><font size=\"3\">Sizes: </font>\n    <ul>\n        <li><font size=\"3\">10 1/2&quot; tall - 2 3/4&quot; thick </font></li>\n        <li><font size=\"3\">12 1/2&quot; tall - 2 3/4&quot; thick </font></li>\n        <li><font size=\"3\">14 1/2&quot; tall - 2 3/4&quot; thick </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Logo set up $14.75</font> </li>\n    <li><font size=\"3\">Production time is 6 to 8 days </font></li>\n</ul>\n<p><font size=\"2\"></font></p>', null, null, null, 'R0206', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'R0206b.JPG', 'R0206a.JPG', 'R0206thum.jpg', 'N');
INSERT INTO `tpt_products` VALUES ('334', 'Baldwin', null, '<ul>\n    <li><font size=\"3\">This optic crystal award is slightly beveled to maximize the award copy readability </font></li>\n    <li><font size=\"3\">Deeply engraved by precise lasers is included on one side </font></li>\n    <li><font size=\"3\">Packaged in a satin lined, hinged top, presentation case </font></li>\n    <li><font size=\"3\">The uncommon wedge shape of this award allows for self standing while adding value and esteem to the recipient </font></li>\n    <li><font size=\"3\">Sizes: </font>\n    <ul>\n        <li><font size=\"3\">5&quot; tall </font></li>\n        <li><font size=\"3\">6&quot; tall </font></li>\n        <li><font size=\"3\">7&quot; tall </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Logo set up $14.75</font></li>\n    <li><font size=\"3\">Production time is 6 to 10 days&nbsp;</font> </li>\n</ul>\n<p><font size=\"3\">For quantities of 6 or more, call for special pricing</font></p>', null, null, null, 'R0207', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'R0207b.JPG', 'R0207a.JPG', 'R0207thum.jpg', 'N');
INSERT INTO `tpt_products` VALUES ('335', 'Octagon Tower', null, '<ul>\n    <li><font size=\"3\">The combination of rounded bottom and angled flat engraving area add interest and value </font></li>\n    <li><font size=\"3\">Optic crystal is beautifully beveled to perfection for maximum light refraction </font></li>\n    <li><font size=\"3\">Precise lasers deeply engrave the recognition accoldates of the recipient into the crystal </font></li>\n    <li><font size=\"3\">Packaged in a hinged top, satin lined, presentation case </font></li>\n    <li><font size=\"3\">This award is available in three sizes: </font>\n    <ul>\n        <li><font size=\"3\">6&quot; tall - 2 1/4&quot; thick </font></li>\n        <li><font size=\"3\">7&quot; tall&nbsp;- 2 1/4&quot; thick </font></li>\n        <li><font size=\"3\">8&quot; tall - 2 1/4&quot; thick </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Logo set up $14.75 </font></li>\n    <li><font size=\"3\">Production time is 6 to 10 days</font> </li>\n</ul>\n<p><font size=\"3\">For quantities of 6 or more, please call for special pricing</font></p>', null, null, null, 'R0208', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'R0208b.JPG', 'R0208a.JPG', 'R0208thum.jpg', 'N');
INSERT INTO `tpt_products` VALUES ('336', 'Crystal Grooved Obelisk', null, '<ul>\n    <li><font size=\"3\">Beautiful perfection in beveled optic crystal for maximum light refraction </font></li>\n    <li><font size=\"3\">Deeply engraved by precise lasers </font></li>\n    <li><font size=\"3\">Packaged in a hinged top, satin lined, presentation case </font></li>\n    <li><font size=\"3\">Satin finished rosewood pedestal is unattached and ships in a separate box accompanying the obelisk </font></li>\n    <li><font size=\"3\">Sizes available: </font>\n    <ul>\n        <li><font size=\"3\">8&quot; tall obelisk + 2&quot; pedestal = 10&quot; overall height </font></li>\n        <li><font size=\"3\">10&quot; tall obelisk + 2&quot; pedestal = 12&quot; overall height </font></li>\n        <li><font size=\"3\">12&quot; tall obelisk + 2&quot; pedestal = 14&quot; overall height </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Logo set up $14.75</font></li>\n    <li><font size=\"3\">Production time is&nbsp;5 to 7 days </font></li>\n</ul>\n<p><font size=\"3\">The quality of optic crystal awards is always appreciated.&nbsp; The obelisk shape was first used for awards in ancient Rome.&nbsp; The hand cut groove within this award adds interest and value for your recipient.</font></p>\n<p><font size=\"3\">For quantities of 6 or more, call for special pricing.</font>&nbsp; </p>', null, null, null, 'R0209', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'R0209b.JPG', 'R0209a.JPG', 'R0209thum.jpg', 'N');
INSERT INTO `tpt_products` VALUES ('337', 'Globe And Base', null, '<ul>\n    <li><font size=\"3\">Perfection in optic crystal </font></li>\n    <li><font size=\"3\">Beautifully beveled for maximum light refraction </font></li>\n    <li><font size=\"3\">Deeply engraved by precise lasers </font></li>\n    <li><font size=\"3\">Packaged in a hinged top, satin lined, presentation case </font></li>\n    <li><font size=\"3\">Sizes: </font>\n    <ul>\n        <li><font size=\"3\">3 3/8&quot; tall (2&quot; globe) </font></li>\n        <li><font size=\"3\">4 1/2&quot; tall (3&quot; globe) </font></li>\n        <li><font size=\"3\">6&quot; tall (4&quot; globe) </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Logo set up $14.75 </font></li>\n    <li><font size=\"3\">Production is 6 to 10&nbsp;days following proof approval</font> </li>\n</ul>', null, null, null, 'R0210', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'R0210b.JPG', 'R0210a.JPG', 'R0210thum.jpg', 'N');
INSERT INTO `tpt_products` VALUES ('338', 'Round Crystal Paperweight', null, '<ul>\n    <li><font size=\"3\">Multi-faceted beveled cuts in optic crystal maximize light refraction </font></li>\n    <li><font size=\"3\">Deeply engraved by precise lasers </font></li>\n    <li><font size=\"3\">Packaged in a hinged top, satin lined, presentation case </font></li>\n    <li><font size=\"3\">Sizes:&nbsp; </font>\n    <ul>\n        <li><font size=\"3\">3&quot; diameter; 3/4&quot; thick&nbsp; </font></li>\n        <li><font size=\"3\">4&quot; diameter; 3/4&quot; thick </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Logo set up $14.75 </font></li>\n    <li><font size=\"3\">Production time is 6 to 10&nbsp;days </font></li>\n</ul>\n<p><font size=\"3\">The quality of optic crystal awards is always appreciated.&nbsp; The unique round multi-faceted paperweight will reflect the quality of your organization to each recipient.&nbsp; </font></p>\n<p><font size=\"2\"><font size=\"3\">For quantities of 12 or more, call for special pricing.</font> </font></p>', null, null, null, 'R0211', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'R0211b.JPG', 'R0211a.JPG', 'R0211thum.jpg', 'N');
INSERT INTO `tpt_products` VALUES ('339', 'Oval Crystal Paperweight', null, '<ul>\n    <li><font size=\"3\">Unique multi-faceted oval paperweight </font></li>\n    <li><font size=\"3\">Beautifully faceted for maximum light refraction </font></li>\n    <li><font size=\"3\">Deeply engraved by precise lasers on one side </font></li>\n    <li><font size=\"3\">Packaged in a hinged top, satin lined, presentation case </font></li>\n    <li><font size=\"3\">Size:&nbsp; 4 1/2&quot; x 3&quot; x 3/4&quot; thick </font></li>\n    <li><font size=\"3\">Logo set up is $14.75 </font></li>\n    <li><font size=\"3\">Production is 4 to 6 days following text copy approval </font></li>\n</ul>\n<p><font size=\"3\">This timeless crystal paperweight is always appreciated and will reflect quality , value, and appreciation of your organization to each recipient.</font></p>\n<p><font size=\"3\">For quantities of 12 or more, call for special pricing</font></p>', null, null, null, 'R0212', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'R0212b.JPG', 'R0212a.JPG', 'R0212thum.jpg', 'N');
