INSERT INTO `tpt_products` VALUES ('344', 'Square Diamond', null, '<ul>\n    <li><font size=\"3\">This unique square optic crystal with angeled bevels is simple yet elegant </font></li>\n    <li><font size=\"3\">Beautifully beveled and angled for maximum light refraction </font></li>\n    <li><font size=\"3\">Deeply engraved by precise lasers; one side included in price </font></li>\n    <li><font size=\"3\">Packaged in a hinged top, satin lined, presentation case </font></li>\n    <li><font size=\"3\">Sizes: </font>\n    <ul>\n        <li><font size=\"3\">6 1/2&quot; tall &amp; 3/4&quot; thick </font></li>\n        <li><font size=\"3\">7&quot; tall &amp; 3/4&quot; thick </font></li>\n        <li><font size=\"3\">8&quot; tall &amp; 3/4&quot; thick </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Logo set up is $14.75 </font></li>\n    <li><font size=\"3\">Production time is 6&nbsp;to 10 days&nbsp;&nbsp; </font></li>\n</ul>\n<p><font size=\"2\"><font size=\"3\">For quantities of 6 or more, please call for special pricing</font>.</font></p>', null, null, null, 'R1015', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'R1015b.JPG', 'R1015a.JPG', 'R1015thum.jpg', 'N');
INSERT INTO `tpt_products` VALUES ('345', 'Star', null, '<ul>\n    <li><font size=\"3\">Perfection in optic crystal </font></li>\n    <li><font size=\"3\">The crystal star is cut to maximize the engraving area </font></li>\n    <li><font size=\"3\">Deeply engraved by precise lasers </font></li>\n    <li><font size=\"3\">Packaged in a hinged top, satin lined, presentation case </font></li>\n    <li><font size=\"3\">Size:&nbsp;5 3/4&quot; wide x 6 3/4&quot; tall x 3/4&quot; thick </font></li>\n    <li><font size=\"3\">Text set up and engraving is included</font> </li>\n    <li><font size=\"3\">The pedestal base can be engraved for a nominal fee</font> </li>\n    <li><font size=\"3\">A logo requires a $14.75 set up fee. </font></li>\n    <li><font size=\"3\">Production time is 4 to 6 days </font></li>\n</ul>\n<p><font size=\"3\">The timeless quality of optic crystal awards is always appreciated.&nbsp; The combination of clear and black opaque optic crystal is a stunning combination.</font></p>\n<p><font size=\"3\">For quantities of 6 or more, please call for special pricing.</font></p>', null, null, null, 'R1014', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'R1014b.JPG', 'R1014a.JPG', 'R1014thum.jpg', 'N');
INSERT INTO `tpt_products` VALUES ('346', 'Inverted Diamond', null, '<ul>\n    <li><font size=\"3\">This prestigious, timeless inverted diamond shaped optic crystal award is beautifully beveled and angled for maximum light refraction </font></li>\n    <li><font size=\"3\">Deeply engraved by precise lasers is complimented by the light and bevel edges </font></li>\n    <li><font size=\"3\">Packaged in a hinged top, satin lined, presentation case </font></li>\n    <li><font size=\"3\">The pedestal is opaque black optic crystal </font></li>\n    <li><font size=\"3\">Sizes: </font>\n    <ul>\n        <li><font size=\"3\">8&quot; tall &amp; 3/4&quot; thick </font></li>\n        <li><font size=\"3\">10&quot; tall &amp; 3/4&quot; thick </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Logo set up $14.75 </font></li>\n    <li><font size=\"3\">Production time is 4 to&nbsp;6 days&nbsp; </font></li>\n</ul>\n<p><font size=\"3\">For quantities of 4 or more, please call for special pricing.</font></p>\n<p>&nbsp;</p>', null, null, null, 'R2201', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'R2201b.JPG', 'R2201a.JPG', 'R2201thum.jpg', 'N');
INSERT INTO `tpt_products` VALUES ('347', 'Crystal Star Tower', null, '<ul>\n    <li><font size=\"3\">A show stopper with unique shape and angeled bevels </font></li>\n    <li><font size=\"3\">Beveled and angled star captures light refraction in maximum </font></li>\n    <li><font size=\"3\">Deeply engraved by precise lasers -&nbsp;one position included in cost </font></li>\n    <li><font size=\"3\">Engraving on star additional </font></li>\n    <li><font size=\"3\">Packaged in a hinged top, satin lined, presentation case </font></li>\n    <li><font size=\"3\">Pedestal is opque black optic crystal </font></li>\n    <li><font size=\"3\">Sizes: </font>\n    <ul>\n        <li><font size=\"3\">9 1/4&quot; tall x 2 3/8&quot; thick x 4 1/4&quot; wide </font></li>\n        <li><font size=\"3\">10 1/8&quot; tall x 2 3/8&quot; thick x 4 1/4&quot; wide </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Logo set up fee is&nbsp;$14.75 </font></li>\n    <li><font size=\"2\"><font size=\"3\">Production time is 5 to 8 days following text proof approval</font> </font></li>\n</ul>', null, null, null, 'R2202', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'R2202b.JPG', 'R2202a.JPG', 'R2202.jpg', 'N');
INSERT INTO `tpt_products` VALUES ('348', 'Round Faceted', null, '<ul>\n    <li><font size=\"3\">This traditional round shape, embellished with many hand cut sparkling facets, accentuates the individual being honored </font></li>\n    <li><font size=\"3\">The pedestal&nbsp;is opaque black optic crystal </font></li>\n    <li><font size=\"3\">Beautifully beveled and angled for maximum light refraction </font></li>\n    <li><font size=\"3\">Deeply engraved by precise lasers - one position included in price </font></li>\n    <li><font size=\"3\">Packaged in a hinged top, satin lined, presentation case </font></li>\n    <li><font size=\"3\">Sizes: </font>\n    <ul>\n        <li><font size=\"3\">5&quot; tall &amp; 3/4&quot; thick </font></li>\n        <li><font size=\"3\">6&quot; tall &amp; 3/4&quot; thick </font></li>\n        <li><font size=\"3\">7&quot; tall &amp; 3/4&quot; thick </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Logo setup&nbsp; $14.75 </font></li>\n    <li><font size=\"3\">Production time is 4 to 6 days </font></li>\n</ul>\n<p><font size=\"3\">Special pricing for quantities of 8 or more, please call</font></p>\n<p>&nbsp;</p>', null, null, null, 'R2203', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'R2203b.JPG', 'R2203a.JPG', 'R2203thum.jpg', 'N');
