INSERT INTO `tpt_products` VALUES ('350', 'Majestic Eagle  Gold-Metallic', null, '<ul>\n    <li><font size=\"3\">This is a beautifully sculpted eagle </font></li>\n    <li><font size=\"3\">The metalized finish is polished brass </font></li>\n    <li><font size=\"3\">The feather details are enhanced by oxidation </font></li>\n    <li><font size=\"3\">A cast resin award that appears to be be solid metal </font></li>\n    <li><font size=\"3\">The pedestal is rosewood, matte finished </font></li>\n    <li><font size=\"3\">A 1&quot; deep x 3 1/2&quot; wide brass engraving plate is included </font>\n    <ul>\n        <li><font size=\"3\">The plate is engraved up to 4 lines included </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Sizes available: </font>\n    <ul>\n        <li><font size=\"3\">21&quot; wide x 18&quot; tall </font></li>\n        <li><font size=\"3\">26&quot; wide x 23&quot; tall </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Production time is 5 to 7 days </font></li>\n</ul>\n<font size=\"2\"><span style=\"FONT-SIZE: 10pt; FONT-FAMILY: &quot;Arial&quot;,&quot;sans-serif&quot;\"></span><span style=\"FONT-SIZE: 7pt; FONT-FAMILY: &quot;Arial&quot;,&quot;sans-serif&quot;\"><o:p><font size=\"2\">\n<p style=\"MARGIN: 0in 0in 0pt\"><span style=\"FONT-SIZE: 10pt; FONT-FAMILY: &quot;Arial&quot;,&quot;sans-serif&quot;\"><font size=\"3\">Optional display pedestal is beautifully finished to match the eagle. Pedestal is shown in zoom. <o:p></o:p></font></span></p>\n<p style=\"MARGIN: 0in 0in 0pt\"><span style=\"FONT-SIZE: 10pt; FONT-FAMILY: &quot;Arial&quot;,&quot;sans-serif&quot;\"><font size=\"3\">Available in two heights: <o:p></o:p></font></span></p>\n<p style=\"MARGIN: 0in 0in 0pt\"><span style=\"FONT-SIZE: 10pt; FONT-FAMILY: &quot;Arial&quot;,&quot;sans-serif&quot;\"><font size=\"3\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; - 14&quot; tall&nbsp;&nbsp;&nbsp; $170.00&nbsp; <o:p></o:p></font></span></p>\n<p style=\"MARGIN: 0in 0in 0pt\"><span style=\"FONT-SIZE: 10pt; FONT-FAMILY: &quot;Arial&quot;,&quot;sans-serif&quot;\"><font size=\"3\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; - 30&quot; tall&nbsp; &nbsp; $225.00</font> </span><span style=\"FONT-SIZE: 7pt; FONT-FAMILY: &quot;Arial&quot;,&quot;sans-serif&quot;\"><o:p></o:p></span></p>\n<p style=\"MARGIN: 0in 0in 0pt\">&nbsp;</p>\n<p>&nbsp;</p>\n</font></o:p></span></font>', null, null, null, 'R2601BB', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'R2601_GZ.jpg', 'R2601_G_Det_250.jpg', 'R2601_G_Det_A.jpg', 'N');
