INSERT INTO `tpt_products` VALUES ('352', 'Silver Guardian Eagle', null, '<ul>\n    <li><font size=\"3\">This beautifully sculpted cast resin eagle gives the appearance of solid metal </font></li>\n    <li><font size=\"3\">The metalized finish is polished nickel silver </font></li>\n    <li><font size=\"3\">The feather details are enhanced by oxidation </font></li>\n    <li><font size=\"3\">The pedestal is rosewood, matte finished </font></li>\n    <li><font size=\"3\">A 1&quot; deep x 3 1/2&quot; wide silver brass engraving plate is included </font>\n    <ul>\n        <li><font size=\"3\">4 lines of text included </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Sizes available: </font>\n    <ul>\n        <li><font size=\"3\">21&quot; wide&nbsp;wing span x 18&quot; tall </font></li>\n        <li><font size=\"3\">26&quot; wide&nbsp;wing span x 23 tall </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Normal production time is 5 to 7 days after text copy approval. </font></li>\n    <li><font size=\"3\">The&nbsp;30&quot; silver pedestal shown is beautifully finished to match the eagle and is available for $225 </font></li>\n    <li><font size=\"2\"><font size=\"3\">A silver pedestal measuring 14&quot; is beautifully finished to match the eagle&nbsp;and is available for $170.00</font> </font></li>\n</ul>', null, null, null, 'R2601BS', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'R2601_S_Z.jpg', 'R2601_S_Det.jpg', 'R2601_S_A.jpg', 'N');
INSERT INTO `tpt_products` VALUES ('353', 'Colorful Eagle Award', null, '<ul>\n    <li><font size=\"3\">This beautifully sculpted cast resin eagle is hand painted by skilled artisans </font></li>\n    <li><font size=\"3\">The fine detail of the feathers are further enhanced by the hand painting </font></li>\n    <li><font size=\"3\">Complimenting the eagle is a rosewood with matte finish pedestal </font></li>\n    <li><font size=\"3\">A 1&quot; deep x 3 1/2&quot; wide brass engraving plate is included </font></li>\n    <li><font size=\"3\">The plate is engraved up to 4 lines of text at no charge </font></li>\n    <li><font size=\"3\">This majestic eagle is large and gradiose in size: </font>\n    <ul>\n        <li><font size=\"3\">21&quot; wide wing span x 18&quot; tall </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">A beautifully finished pedestal is available to display this stately eagle in 2 sizes: </font>\n    <ul>\n        <li><font size=\"3\">14&quot;&nbsp;&nbsp; $170.00 </font></li>\n        <li><font size=\"3\">30&quot;&nbsp;&nbsp; $225.00 </font></li>\n    </ul>\n    </li>\n    <li><font size=\"2\"><font size=\"3\">Normal production time for this award is 5 to 7 days following text proof approval.</font> </font></li>\n</ul>', null, null, null, 'R2601P', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'R2601_CL_Z.jpg', 'R2601_CL_Det.jpg', 'R2601_CL_A.jpg', 'N');
INSERT INTO `tpt_products` VALUES ('354', 'Watchful Eye Eagle Trophy', null, '<ul>\n    <li><font size=\"3\">This is an intricately detailed eagle </font></li>\n    <li><font size=\"3\">The metalized finish is antique copper </font></li>\n    <li><font size=\"3\">Details of the eagle are enhanced by oxidation </font></li>\n    <li><font size=\"3\">This cast resin award appears to be solid metal </font></li>\n    <li><font size=\"3\">The pedestal is dark matte finished rosewood </font></li>\n    <li><font size=\"3\">A 1&quot; deep x 3 1/2&quot; wide copper engraving plate with up to 4 lines of text is included </font></li>\n    <li><font size=\"3\">Sizes available: </font>\n    <ul>\n        <li><font size=\"3\">6&quot; wide x 14&quot; tall </font></li>\n        <li><font size=\"3\">12 1/2&quot; wide x 18&quot; tall </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Production time is 5-7 days&nbsp; </font></li>\n</ul>\n<p><font size=\"3\">This eagle is gallant and impressive.&nbsp; It will stand apart from any other eagle award your recipient may have been presented.</font></p>\n<p>&nbsp;</p>', null, null, null, 'R2603', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'R2603_Z.jpg', 'R2603_D.jpg', 'R2603_A.jpg', 'N');
