INSERT INTO `tpt_products` VALUES ('359', 'Eagle With Colors', null, '<ul>\n    <li><font size=\"3\">An intricately detailed Bald Eagle with a painted finish in rich colors </font></li>\n    <li><font size=\"3\">The pedestal stone appears as rough granite but is fabricated from cast resin </font></li>\n    <li><font size=\"3\">A 1 1/2&quot; deep x 3 1/2&quot; gold aluminum personalization plate is included and will feature up to 4 lines of text at no charge </font></li>\n    <li><font size=\"3\">Available size: </font></li>\n    <ul>\n        <li><font size=\"3\">5 1/2&quot; wide x 7 1/2&quot; tall </font></li>\n    </ul>\n    <li><font size=\"3\">Production time for this award is 4 to 6 days</font>&nbsp;</li>\n</ul>', null, null, null, 'AH51103', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'Eagleflagb.JPG', 'Eagleflaga.JPG', 'Eagleflag thum.JPG', 'N');
