INSERT INTO `tpt_products` VALUES ('363', 'Outstanding Star Award', null, '<ul>\n    <li><font size=\"3\">Gold plated metal star </font>\n    <ul>\n        <li><font size=\"3\">Silver star is available </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Clear optic crystal pedestal </font></li>\n    <li><font size=\"3\">Engraving into crystal pedestal is included </font></li>\n    <li><font size=\"3\">The star can be engraved for an additional cost </font></li>\n    <li><font size=\"3\">Award size: </font>\n    <ul>\n        <li><font size=\"3\">Large:&nbsp; 3 7/8&quot; wide x 3 7/8&quot; deep x 8&quot; tall </font></li>\n        <li><font size=\"3\">Medium:&nbsp; 3 1/2&quot; wide x 3 1/8&quot; deep x 7 1/2&quot; tall </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Presentation box packaging is included </font></li>\n    <li><font size=\"3\">Set up fee for&nbsp;text / logo is&nbsp;$14.75 </font></li>\n    <li><font size=\"2\"><font size=\"3\">Production time is 3 to 4 days </font></font></li>\n</ul>', null, null, null, 'R2502', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'R2502b.JPG', 'R2502a.JPG', 'R2502.jpg', 'N');
INSERT INTO `tpt_products` VALUES ('364', 'Stellar Star Award', null, '<ul>\n    <li><font size=\"3\">Gold plated metal star </font>\n    <ul>\n        <li><font size=\"3\">Silver Star is also available ** </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">High polish rosewood pedestal </font></li>\n    <li><font size=\"3\">Gold engraving plate </font></li>\n    <li><font size=\"3\">Engraving on the gold plate is included </font></li>\n    <li><font size=\"3\">The star can be engraved for an additional cost </font></li>\n    <li><font size=\"3\">Award size:&nbsp; 4 1/2&quot; wide x 4 1/4&quot; deep x 7 3/8&quot; tall </font></li>\n    <li><font size=\"3\">Presentation box packaging is included </font></li>\n    <li><font size=\"3\">Set up text - included </font></li>\n    <li><font size=\"3\">The fee to set up a&nbsp;logo is&nbsp;$14.75</font> </li>\n    <li><font size=\"3\">Production time is 7 to 10 days</font> </li>\n</ul>\n<p><font size=\"3\">Silver star and engraving plate available; $5 extra</font></p>', null, null, null, 'R2503', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'R2503b.JPG', 'R2503a.JPG', 'R2503.jpg', 'N');
INSERT INTO `tpt_products` VALUES ('365', 'Silver Star Pedestal', null, '<ul>\n    <li><font size=\"3\">Silver plate metal star and pedestal </font></li>\n    <li><font size=\"3\">High polish rosewood standing plaque </font></li>\n    <li><font size=\"3\">This award is engraved by laser, directly into the rosewood, then a silver metallic fill is applied into the lased text area </font></li>\n    <li><font size=\"3\">Engraving is included </font></li>\n    <li><font size=\"3\">Award sizes: </font>\n    <ul>\n        <li><font size=\"3\">Large 3 6/7&quot; wide x 1 7/8&quot; deep x 7 7/8&quot; tall </font></li>\n        <li><font size=\"3\">Medium 4 7/8&quot; wide x 1 3/8&quot; deep x 5 7/8&quot; tall </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Presentation box packaging is included </font></li>\n    <li><font size=\"3\">Text&nbsp;is included </font></li>\n    <li><font size=\"3\">Set up fee for a&nbsp;logo is&nbsp;$14.75 </font></li>\n    <li><font size=\"3\">Production time is 4 to 8&nbsp;days </font></li>\n</ul>\n<p><font size=\"3\">Call for special pricing for quantities of 24 or more</font></p>', null, null, null, 'R2504', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'R2504b.JPG', 'R2504a.JPG', 'R2504.jpg', 'N');
INSERT INTO `tpt_products` VALUES ('366', 'Starshine', null, '<ul>\n    <li><font size=\"3\">Silver plated metal star </font>\n    <ul>\n        <li><font size=\"3\">Gold star is available&nbsp; ** </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Engraving on the star is included </font></li>\n    <li><font size=\"3\">Star size 4 1/8&quot; wide and deep x 3/4&quot; tall </font></li>\n    <li><font size=\"3\">Presentation box packaging is included </font></li>\n    <li><font size=\"3\">Set up for text included </font></li>\n    <li><font size=\"3\">The set up fee for a&nbsp;logo is $14.75 </font></li>\n    <li><font size=\"3\">Normal production time is 4 days following text approval </font></li>\n</ul>\n<p><font size=\"3\">Call for special pricing for quantities of 24 or more</font></p>\n<p><font size=\"3\">&nbsp;** Gold star $26.75</font></p>', null, null, null, 'R2505', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'R2505b.JPG', 'R2505a.JPG', 'starshine thum.jpg', 'N');
INSERT INTO `tpt_products` VALUES ('367', 'Star Achiever Award', null, '<ul>\n    <li><font size=\"3\">Gold plated metal star </font></li>\n    <li><font size=\"3\">High polish rosewood pedestal </font></li>\n    <li><font size=\"3\">The star can be engraved for an additional cost </font></li>\n    <li><font size=\"3\">Award size:&nbsp; 4 3/4&quot; wide x 3 1/8&quot; deep x 8 3/8&quot; tall </font></li>\n    <li><font size=\"3\">Presentation box packaging is included</font> </li>\n    <li><font size=\"3\"><font size=\"3\">Gold engraving plate</font></font> </li>\n    <li><font size=\"3\"><font size=\"3\">Text engraving is included&nbsp;</font></font> </li>\n    <li><font size=\"3\">Set up fee&nbsp;for optional&nbsp;logo/artwork of your&nbsp;own design is&nbsp;$14.75 </font></li>\n    <li><font size=\"3\">Production time is 3 to 5 days</font> </li>\n</ul>', null, null, null, 'R2506', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'R2506b.JPG', 'R2506a.JPG', 'R2506.jpg', 'N');
INSERT INTO `tpt_products` VALUES ('368', 'The Vector', null, '<ul>\n    <li><font size=\"3\">This award is silver with gold accents </font></li>\n    <li><font size=\"3\">It is crafted from structured resin composites </font></li>\n    <li><font size=\"3\">The engraving plate is silver, text is black </font></li>\n    <li><font size=\"3\">Text engraving set up and the engraving is included </font></li>\n    <li><font size=\"3\">Logo set up is $14.75;&nbsp; engraving is included </font></li>\n    <li><font size=\"3\">The award is available in three sizes: </font>\n    <ul>\n        <li><font size=\"3\">4 1/2&quot; wide x 9 1/4&quot; tall x 3&quot; deep </font></li>\n        <li><font size=\"3\">5 3/4&quot; wide x 12 1/2&quot; tall x 4&quot; deep </font></li>\n        <li><font size=\"3\">7 3/4&quot; wide x 16&quot; tall x 6 1/2&quot; deep </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">This award is shipped in a foam padded box</font> </li>\n    <li><font size=\"3\">Production time is 7 to 10 days&nbsp;</font> </li>\n</ul>\n<p><font size=\"3\">This award is about people coming together.&nbsp; It symbolizes divergent people or ideas when synergisterically combined make someone or something great.</font></p>', null, null, null, 'R0421', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'R0421b.JPG', 'R0421a.JPG', 'R0421thum.jpg', 'N');
INSERT INTO `tpt_products` VALUES ('369', 'Working Together', null, '<ul>\n    <li><font size=\"3\">This award is crafted from stainless steel and marble; two very substantial and strong materials.&nbsp; One man made; the other from Mother Nature </font></li>\n    <li><font size=\"3\">The engraving plate is silver, text is black </font></li>\n    <li><font size=\"3\">Text engraving set up and the engraving is included </font></li>\n    <li><font size=\"3\">A logo of your own design can be added for a first time set up fee of $14.75 </font></li>\n    <li><font size=\"3\">The award is available in two sizes: </font>\n    <ul>\n        <li><font size=\"3\">4&quot; wide x 9 1/2&quot; tall </font></li>\n        <li><font size=\"3\">4 1/2&quot; wide x 11&quot; tall </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">This award is shipped in a foam padded box</font> </li>\n    <li><font size=\"3\">Production time is 7 to 10 days&nbsp;</font> </li>\n</ul>\n<p><font size=\"2\"><font size=\"3\">This award symboizes the best of teamwork.&nbsp; A group, perhaps your group, coming together and growing together to reach new heights.</font>&nbsp; </font></p>', null, null, null, 'R0422', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'R0422b.JPG', 'R0422a.JPG', 'R0422thum01.jpg', 'N');
