INSERT INTO `tpt_products` VALUES ('372', 'C-Jade', null, '<ul>\n    <li><font size=\"3\">This award symbolizes a new or renewed outlook </font></li>\n    <li><font size=\"3\">Combination of stainless steel and glass - two very substantial and strong materials </font></li>\n    <li><font size=\"3\">The award text is engraved into 3/8&quot; thich 45 &deg; wide beveled edge jade green glass </font></li>\n    <li><font size=\"3\">The laser engraved text or text and logo are white </font></li>\n    <li><font size=\"3\">Sizes available: </font>\n    <ul>\n        <li><font size=\"3\">6&quot; wide x 7&quot; tall x 3 1/4&quot; deep </font></li>\n        <li><font size=\"3\">7 1/2&quot; wide x 8 1/4&quot; tall x 3 1/4&quot; deep </font></li>\n        <li><font size=\"3\">9 3/4&quot; wide x 10 1/2&quot; tall x 3 1/4&quot; deep </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Shipped in a foam padded box </font></li>\n    <li><font size=\"3\">Set up:&nbsp; Logo $14.75 </font></li>\n</ul>\n<p><font size=\"3\">For quantities of 5 or more, call for special pricing.</font></p>', null, null, null, 'R0402', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'R0402b.JPG', 'R0402a.JPG', 'R0402thum.jpg', 'N');
INSERT INTO `tpt_products` VALUES ('375', 'Chiseled Arch', null, '<ul>\n    <li><font size=\"3\">Rich and thick beveled jade glass held upright by a silver mirrored stainless steel spire then further enhanced by a beveled edge black granite pedestal </font></li>\n    <li><font size=\"3\">Deep laser engraving on the back side of the beveled jade glass adds dimension to this substantial award </font></li>\n    <li><font size=\"3\">Sizes: </font>\n    <ul>\n        <li><font size=\"3\">5 5/8&quot; wide x 6 1/4&quot; tall x 3 1/2&quot; deep </font></li>\n        <li><font size=\"3\">7 1/2&quot; wide x 8 1/4&quot; tall x 4&quot; deep </font></li>\n        <li><font size=\"3\">9 1/4&quot; wide x 10&quot; tall x 4 1/4&quot; deep </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Set up of engraved logo $14.75 </font></li>\n    <li><font size=\"3\">Normal production time for this award is 8 to 10 days following text approval</font> </li>\n</ul>', null, null, null, 'R0405', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'R0405b.JPG', 'R0405details.JPG', 'R0405thum.jpg', 'N');
