INSERT INTO `tpt_products` VALUES ('382', 'Gold Star Pinnacle Award', null, '<ul>\n    <li><font size=\"3\">A metallic gold star atop the peak of the optic crystal spire is stunning </font></li>\n    <li><font size=\"3\">Beautifully beveled and angled for maximum light refraction </font></li>\n    <li><font size=\"3\">Deeply engraved by precise lasers - one position included in price </font></li>\n    <li><font size=\"3\">Packaged in a hinged top, satin lined, presentation case </font></li>\n    <li><font size=\"3\">Sizes: </font>\n    <ul>\n        <li><font size=\"3\">8 1/2&quot; tall x 3 1/2&quot; thick </font></li>\n        <li><font size=\"3\">9 1/2&quot; tall x 3 1/2&quot; thick </font></li>\n        <li><font size=\"3\">10 1/2&quot; tall x 3 1/2&quot; thick </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Text set up is included </font></li>\n    <li><font size=\"3\">Optional&nbsp;logo set up fee is&nbsp;$14.75</font></li>\n    <li><font size=\"3\">Production time is 3 to 7 days </font></li>\n</ul>\n<p><font size=\"3\">Extraordinary achievement by the recipient is obvious when this award is presented.</font></p>', null, null, null, 'AM10156', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'CRY712z.JPG', 'CRY711a.JPG', 'CRY711.jpg', 'N');
