INSERT INTO `tpt_products` VALUES ('392', 'Round Crystal', null, '<ul>\n    <li><font size=\"3\">The 3/4&quot; thick clear optic crystal stands on a translucent sapphire blue optic crystal pedestal </font></li>\n    <li><font size=\"3\">A traditional and timeless round shape is embellished with many hand cut sparkling facets that help accentuate the engraved name of the honored individual </font></li>\n    <li><font size=\"3\">Beautifully beveled and angled for maximum light refraction </font></li>\n    <li><font size=\"3\">Deeply engraved by precise lasers - one position is included in price </font></li>\n    <li><font size=\"3\">Sizes: </font>\n    <ul>\n        <li><font size=\"3\">5&quot; tall </font></li>\n        <li><font size=\"3\">6&quot; tall </font></li>\n        <li><font size=\"3\">7&quot; tall </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Logo set up $14.75 </font></li>\n    <li><font size=\"3\">Production time is 4 to 8&nbsp;days </font></li>\n</ul>\n<p><font size=\"3\">For quantities of 8 or more, call for special pricing</font></p>', null, null, null, 'AM22113', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'lrg round crystalb.bmp', 'lrg round crystala.bmp', 'lrg round crystal sml.bmp', 'N');
INSERT INTO `tpt_products` VALUES ('393', 'Crystal Cups', null, '<ul>\n    <li><font size=\"3\">Trophy optic crystal cup is beautifully beveled and faceted for maximum light refraction </font></li>\n    <li><font size=\"3\">Handles are bright&nbsp;gold plated metal </font></li>\n    <li><font size=\"3\">The metallic handles and stem enhance the optic crystal cup </font></li>\n    <li><font size=\"3\">The base is genuine black marble </font></li>\n    <li><font size=\"3\">Personalization is engraved onto a black metal plate that engraves to gold and is attached to the marble pedestal </font></li>\n    <li><font size=\"3\">Engraving is included </font></li>\n    <li><font size=\"3\">Packaged in a hinged top, satin lined, presentation case </font></li>\n    <li><font size=\"3\">Sizes: </font>\n    <ul>\n        <li><font size=\"3\">7 1/2&quot; tall </font></li>\n        <li><font size=\"3\">8 1/2&quot; tall </font></li>\n        <li><font size=\"3\">10&quot;&nbsp;tall </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Production time is 4 to 5 days following text proof approval </font></li>\n</ul>', null, null, null, 'AM22271', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'CRY039XL_Z.jpg', 'CRY039M_D.jpg', 'CRY039M_D.jpg', 'N');
INSERT INTO `tpt_products` VALUES ('394', 'Simple Elegance Trophy Cup Award', null, '<ul>\n    <li><font size=\"3\">Beautiful Italian award cup and rosewoodpedestal </font></li>\n    <li><font size=\"3\">The cup, lid and handles are silver plated metal </font></li>\n    <li><font size=\"3\">The cup trimming and finial are gold </font></li>\n    <li><font size=\"3\">The rosewood pedestal is medium glass finished </font></li>\n    <li><font size=\"3\">The engraving plate is silver </font></li>\n    <li><font size=\"3\">Engraving on the silver plate is included </font></li>\n    <li><font size=\"3\">The cup <u>cannot</u> be engraved </font></li>\n    <li><font size=\"3\">Each cup is packaged in a cardboard box </font></li>\n    <li><font size=\"3\">The engraved text and setup is included on these cups </font></li>\n    <li><font size=\"3\">This cup style is available in 7 sizes: </font></li>\n    <ul>\n        <li><font size=\"3\">17&quot; tall with 3 3/4&quot; x 2&quot; engraving plate </font></li>\n        <li><font size=\"3\">18 1/2&quot; tall with 4 1/4&quot; x 2 1/4&quot; engraving plate </font></li>\n        <li><font size=\"3\">19 1/2&quot; tall with 4 3/4&quot; 2 1/4&quot; engraving plate </font></li>\n        <li><font size=\"3\">21&quot; tall with 5&quot; x 2 1/4&quot; engraving plate </font></li>\n        <li><font size=\"3\">22 1/2&quot; tall with 5 1/2&quot; x 2 1/4&quot; engraving plate </font></li>\n        <li><font size=\"3\">24&quot; tall with 6 1/4&quot; x 2 1/4&quot; engraving plate </font></li>\n        <li><font size=\"2\"><font size=\"3\">25 1/2&quot; tall with 6 3/4&quot; x 2 1/4&quot; engraving plate</font></font></li>\n    </ul>\n    <li><font size=\"2\"><font size=\"3\">Production time is 6 to 10 days</font>&nbsp;</font></li>\n</ul>\n<p><font size=\"2\"></font></p>', null, null, null, 'R1040', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'R1040b.JPG', 'R1040a.JPG', 'R1040.JPG', 'N');
INSERT INTO `tpt_products` VALUES ('395', 'Champion', null, '<ul>\n    <li><font size=\"3\">This is a very nice, budget-friendly award cup </font></li>\n    <li><font size=\"3\">The cup, handles and lid are gold plated metal </font></li>\n    <li><font size=\"3\">The finial and cup riser are gold plated </font></li>\n    <li><font size=\"3\">The pedestal is genuine black marble </font></li>\n    <li><font size=\"3\">The engraving plate is black and engraved gold </font></li>\n    <li><font size=\"3\">Engraving on the plate is included </font></li>\n    <li><font size=\"3\">The cup <u>cannot </u>be engraved </font></li>\n    <li><font size=\"3\">Each cup is packaged in a cardboard box </font></li>\n    <li><font size=\"3\">The engraved text and setup is included on these cups </font></li>\n    <li><font size=\"3\">The cup style is available in five sizes: </font></li>\n    <ul>\n        <li><font size=\"3\">12 1/2&quot; tall with 3 3/8&quot; x 1 5/8&quot; engraving plate </font></li>\n        <li><font size=\"3\">15&quot; tall with&nbsp; 4 1/8&quot; x 1 5/8&quot; engraving plate </font></li>\n        <li><font size=\"3\">16 1/2&quot; tall with 4 3/8&quot; x 1 7/8&quot; engraving plate </font></li>\n        <li><font size=\"3\">18&quot; tall with 5 1/8&quot; x 2 3/8&quot; engraving plate </font></li>\n        <li><font size=\"3\">20&quot; tall with&nbsp; 5 3/8&quot; x 2 3/8&quot; engraving plate </font></li>\n    </ul>\n    <li><font size=\"3\">Production time is 5 to 10 days</font></li>\n</ul>', null, null, null, 'R1041', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'R1041b.JPG', 'R1041a.JPG', 'R1041.JPG', 'N');
INSERT INTO `tpt_products` VALUES ('396', 'Nobility Silver Trophy Cup', null, '<ul>\n    <li><font size=\"3\">Beautiful Italian award cup and rosewood pedestal </font></li>\n    <li><font size=\"3\">The cup, lid and handles are silver plated metal </font></li>\n    <li><font size=\"3\">The rosewood pedestal is medium gloss finished </font></li>\n    <li><font size=\"3\">The engraving plate is silver </font></li>\n    <li><font size=\"3\">Engraving on the silver plate is included </font></li>\n    <li><font size=\"3\">The cup can be engraved for an additional cost </font></li>\n    <li><font size=\"3\">Each cup is packaged in a cardboard box </font></li>\n    <li><font size=\"3\">The engraved text and set up is included on these cups. </font></li>\n    <li><font size=\"3\">The cup style is available in 3 sizes including the rosewood pedestal: </font></li>\n    <ul>\n        <li><font size=\"3\">10 3/4&quot; tall with 3 1/2&quot; x 2&quot; engraving plate </font></li>\n        <li><font size=\"3\">11 3/4&quot; tall with&nbsp; 4&quot; x 2&quot; engraving plate </font></li>\n        <li><font size=\"2\"><font size=\"3\">13&quot; tall with 4 1/4&quot; x 2 1/2&quot; engraving plate</font></font></li>\n    </ul>\n    <li><font size=\"2\"><font size=\"3\">Production time is 5 to 10 days</font>&nbsp;</font></li>\n</ul>', null, null, null, 'R1042', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'R1042b.JPG', 'R1042a.JPG', 'R1042.JPG', 'N');
INSERT INTO `tpt_products` VALUES ('397', 'Challis Silver Georgian Cup', null, '<ul>\n    <li><font size=\"3\">Beautiful Italian made silver award cup and pedestal </font></li>\n    <li><font size=\"3\">The cup, lid and handles and pedestal wrap are nickel plated metal </font></li>\n    <li><font size=\"3\">The ebony wood pedestal is medium gloss finished </font></li>\n    <li><font size=\"3\">The engraving plate is silver mylar affixed to the pedestal </font></li>\n    <li><font size=\"3\">Engraving on the silver plate is included </font></li>\n    <li><font size=\"3\">The cup <u>cannot</u> be engraved </font></li>\n    <li><font size=\"3\">Each cup is packaged in a cardboard box </font></li>\n    <li><font size=\"3\">The engraved text and setup is included on thse cups </font></li>\n    <li><font size=\"3\">The cup style is availabe in 3 sizes including the&nbsp;pedestal&nbsp; </font></li>\n    <ul>\n        <li><font size=\"3\">10&quot; tall with 4 1/4&quot; x 1 7/8&quot; engraving plate </font></li>\n        <li><font size=\"3\">12 1/2&quot; tall with&nbsp; 4 1/2&quot; x 2 1/4&quot; engraving plate </font></li>\n        <li><font size=\"2\"><font size=\"3\">14 1/2&quot; tall with&nbsp; 4 3/4&quot; x 2 3/8&quot; engraving plate</font></font></li>\n    </ul>\n    <li><font size=\"2\"><font size=\"3\">Production time is 5 to 10 days</font>&nbsp;</font></li>\n</ul>', null, null, null, 'R1043', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'R1043b.JPG', 'R1043a.JPG', 'R1043.JPG', 'N');
INSERT INTO `tpt_products` VALUES ('399', 'Gold Accolades Trophy Cup', null, '<ul>\n    <li><font size=\"3\">This is a thick walled premium metal cup </font></li>\n    <li><font size=\"3\">The pedestal is stain finished walnut veneer on hardwood </font></li>\n    <li><font size=\"3\">The engraving plate is gold metal </font></li>\n    <li><font size=\"3\">Engraving on the gold plate is included </font></li>\n    <li><font size=\"3\">The cup <u>cannot </u>be engraved </font></li>\n    <li><font size=\"3\">Each cup is packaged in a velvet drawstring pouch </font></li>\n    <li><font size=\"3\">The engraved text and set up is included&nbsp; </font></li>\n    <li><font size=\"3\">This cup style is available in 3 sizes including the hardwood pedestal </font>\n    <ul>\n        <li><font size=\"3\">8&quot; tall with&nbsp;3&quot; x 1 1/4&quot; engraving plate </font></li>\n        <li><font size=\"3\">10 3/4&quot; tall with 3 1/2&quot; x 1 3/4&quot; engraving plate </font></li>\n        <li><font size=\"3\">12&quot; tall with 4&quot; x 2 1/4&quot; engraving plate </font></li>\n    </ul>\n    </li>\n    <li><font size=\"2\"><font size=\"3\">This premium cup is also available in tarnish resistant nickel silver</font></font></li>\n    <li><font size=\"2\"><font size=\"3\">Production time is&nbsp;5 to 8 days</font>&nbsp;</font></li>\n</ul>', null, null, null, 'R2002', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'R2002b.JPG', 'R2002a.JPG', 'R2002.JPG', 'N');
INSERT INTO `tpt_products` VALUES ('400', 'Magnifier And Wood case', null, '<ul>\n    <li><font size=\"3\">Brass and oak magnifier </font></li>\n    <li><font size=\"3\">Oak case - mahogany finish </font></li>\n    <li><font size=\"3\">Gold hinges between case and lid </font></li>\n    <li><font size=\"3\">Green felt lining inside case </font></li>\n    <li><font size=\"3\">Oak case:&nbsp; 6 1/2&quot; wide x 3 3/4&quot; deep x 1 3/4&quot; tall </font></li>\n    <li><font size=\"3\">Magnifier:&nbsp; 2 3/8&quot; diameter; 5 1/4&quot; long </font></li>\n    <li><font size=\"3\">A gold finished metal engraving plate is mounted onto the outside center of the case lid </font></li>\n    <li><font size=\"3\">Professional laser engraving, up to 4 text lines onto the plate, is included </font></li>\n    <li><font size=\"3\">Engraving set up - included </font></li>\n    <li><font size=\"3\">Production time is 5 to 7 days following text proof approval </font></li>\n</ul>\n<p><font size=\"3\">Minimum order:&nbsp; 3</font></p>', null, null, null, 'R0440', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'R0440b.JPG', 'R0440a.JPG', 'R0440.JPG', 'N');
