INSERT INTO `tpt_products` VALUES ('402', 'Sandtimer', null, '<ul>\n    <li><font size=\"3\">Gold plated brass sandtimer </font></li>\n    <li><font size=\"3\">Glass timer - 5 minutes </font></li>\n    <li><font size=\"3\">Overall size:&nbsp; 2 3/4&quot; diameter x 4&quot; tall </font></li>\n    <li><font size=\"3\">The timer brass, on the top, is professionally engraved with up to 3 lines of copy or a logo and 1 copy line. </font></li>\n    <li><font size=\"3\">Engraving is included </font></li>\n    <li><font size=\"3\">Setup for engraving - included </font></li>\n    <li><font size=\"3\">Set up for logo and engraving $38.50 </font></li>\n    <li><font size=\"3\">Production time is 5 to 7 days following text copy approval </font></li>\n</ul>\n<p><font size=\"3\">Minimum order quantity:&nbsp; 6</font></p>', null, null, null, 'R0442', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'R0442b.JPG', 'R0442a.JPG', 'R0442.JPG', 'N');
