INSERT INTO `tpt_products` VALUES ('413', 'Wall Sign', null, '<ul>\n    <li><font size=\"3\">Display your name with company logo or artwork </font></li>\n    <li><font size=\"3\">Size&nbsp; 2&quot; x 8&quot; </font></li>\n    <li><font size=\"3\">Slides into door sign frame </font></li>\n    <li><font size=\"3\">Artwork and logo set up $38.50 </font></li>\n</ul>\n<p><font size=\"3\">Minimum order quantity:&nbsp; 6</font></p>\n<p><font size=\"3\">** other items available for matching set (desk name block, card holder, post-it-note holder)</font></p>\n<p><font size=\"3\">For quantities of 12 or more, ask for special pricing</font></p>', null, null, null, 'R2322', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'R2322b.JPG', 'R2322a.JPG', 'R2322thum.JPG', 'N');
INSERT INTO `tpt_products` VALUES ('414', 'Post-It Note Holder', null, '<ul>\n    <li><font size=\"3\">Mahogany finished wood </font></li>\n    <li><font size=\"3\">Overall size:&nbsp; 4 1/4&quot;wide &nbsp;x 6 1/4&quot; deep x 3/4&quot; tall </font></li>\n    <li><font size=\"3\">Inlay area for </font>\n    <ul>\n        <li><font size=\"3\">3&quot; x 3&quot; post-it note pad </font></li>\n        <li><font size=\"3\">3 1/2&quot; wide x 2&quot; tall personalization area </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Personalization area is color printed </font>\n    <ul>\n        <li><font size=\"3\">choose your name, or logo, or marking slogan or all three to be printed </font></li>\n        <li><font size=\"3\">Select your colors for text, logo, and background </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Art and text set up $38.50 </font></li>\n    <li><font size=\"3\">Production time is 4 to 6 days following proof text/artwork approval </font></li>\n</ul>\n<p><font size=\"3\">Minimum order quantity:&nbsp; 6</font></p>\n<p><font size=\"3\">** also available, see other items (desk name block, door sign, and card holder)</font></p>\n<p><font size=\"3\">For quantities of 12 or more, ask for special pricing</font> </p>', null, null, null, 'R2323', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'R2323b.JPG', 'R2323a.JPG', 'R2323.jpg', 'N');
INSERT INTO `tpt_products` VALUES ('415', 'Custom Pen And Paperweight Gift', null, '<ul>\n    <li><font size=\"3\">Customize your paperweight with a logo or message </font></li>\n    <li><font size=\"3\">Gold pen accompanies the paperweight </font></li>\n    <li><font size=\"3\">Size:&nbsp;5&quot; long x&nbsp;2 1/2&quot; deep x 3/4&quot; tall </font></li>\n    <li><font size=\"3\">Felted bottom </font></li>\n    <li><font size=\"3\">Engraving is black on gold plate </font></li>\n    <li><font size=\"3\">Set up for logo $14.75</font></li>\n    <li><font size=\"3\">Production time is 3 to 5 days&nbsp;</font></li>\n</ul>\n<p><font size=\"3\">&nbsp;For quantities of 6 or more, ask for special pricing.</font>&nbsp; </p>', null, null, null, 'R2324', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'R2324b.JPG', 'R2324a.JPG', 'R2324thum.JPG', 'N');
INSERT INTO `tpt_products` VALUES ('416', 'Customized paperweight', null, '<ul>\n    <li><font size=\"3\">Black marble makes a substantial paperweight - a great gift for teachers </font></li>\n    <li><font size=\"3\">Size:&nbsp; 2 1/2&quot; wide x 3 1/2&quot; long x 3/4&quot; tall </font></li>\n    <li><font size=\"3\">Customize a paperweight to display a message, logo, team mascot or achievement </font></li>\n    <li><font size=\"3\">Metal plate on top&nbsp;can be color printed or engraved with your specific message </font></li>\n    <li><font size=\"3\">Metal plate color options are gold,&nbsp; silver, or white </font></li>\n    <li><font size=\"3\">Add a front plate to bear the name of the recipient </font></li>\n    <li><font size=\"3\">Set up for text and layout $14.75 </font></li>\n    <li><font size=\"3\">Set up for artwork or logo preparation $14.75 </font></li>\n    <li><font size=\"3\">Production time is 4 to 6 days</font> </li>\n</ul>\n<p>&nbsp;</p>', null, null, null, 'R2325', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'R2325b.JPG', 'R2325a.JPG', 'R2325 thum.jpg', 'N');
