INSERT INTO `tpt_products` VALUES ('418', 'Travel Tags ~ Super Strong', null, '<ul>\n    <li><font size=\"3\">Makes your item(s) easily identifiable and recoverable </font></li>\n    <li><font size=\"3\">Super strong bonded plastic material </font></li>\n    <li><font size=\"3\">Genuine leather strap </font></li>\n    <li><font size=\"3\">Engraved on both sides </font></li>\n    <li><font size=\"3\">Sold in sets of 3 tags </font></li>\n    <li><font size=\"3\">Size options: </font>\n    <ul>\n        <li><font size=\"3\">Small - 3 5/8&quot; x 2 1/4&quot; </font></li>\n        <li><font size=\"3\">Medium - 3 7/8&quot; x 2 1/2&quot; </font></li>\n        <li><font size=\"3\">Large - 4 1/8&quot; x 2 5/8&quot; </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Information to be engraved on your bag tag: </font>\n    <ul>\n        <li><font size=\"3\">Name </font></li>\n        <li><font size=\"3\">Address </font></li>\n        <li><font size=\"3\">City/State/zip </font></li>\n        <li><font size=\"3\">Phone or Fax </font></li>\n        <li><font size=\"3\">Email </font></li>\n        <li><font size=\"3\">Logo (optional) </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Production time is 2-3 days following&nbsp;proof approval </font></li>\n    <li><font size=\"3\">Text set up - included </font></li>\n    <li><font size=\"3\">Logo set up $12.50 </font></li>\n    <li><font size=\"3\">Shipped by U.S. Mail @ $4.95 / set of 3 </font>\n    <ul>\n        <li><font size=\"3\">Additional sets&nbsp;free to&nbsp;same address</font> </li>\n    </ul>\n    </li>\n</ul>', null, null, null, 'R2327', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'R2327_New Zoom3.jpg', 'R2327a.JPG', 'R2327.jpg', 'N');
