INSERT INTO `tpt_products` VALUES ('459', 'Rock Sculpture Plaque', null, '<ul>\n    <li><font size=\"3\">This is an outstanding plaque for award recipients. </font></li>\n    <li><font size=\"3\">Clear acrylic engraving plate is thick </font></li>\n    <li><font size=\"3\">The acrylic plate is offset from the sculptured&nbsp;rock back with chrome dowels </font></li>\n    <li><font size=\"3\">Two chrome metal posts are&nbsp;included&nbsp;allowing this plaque to be displayed on a desk or in a keepstake cabinet </font></li>\n    <li><font size=\"3\">For wall display, this award has a recessed keyhole hanger </font></li>\n    <li><font size=\"3\">Engraving of this award is on the back side of the acrylic accentuating the floating look of the acrylic </font></li>\n    <li><font size=\"3\">Laser engraving of the award text and logo is included </font></li>\n    <li><font size=\"3\">Sizes: </font>\n    <ul>\n        <li><font size=\"3\">8&quot; x 10&quot; </font></li>\n        <li><font size=\"3\">9&quot; x 12&quot; </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Set up for text is included </font></li>\n    <li><font size=\"3\">Set up for logo $14.75 </font></li>\n    <li><font size=\"2\"><font size=\"3\">Production time is 3 to 5&nbsp;days&nbsp;</font></font><font size=\"2\">&nbsp;</font> </li>\n</ul>', null, null, null, 'AM10144', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'RVN_9429_Z2.jpg', 'RVN_9429_250.jpg', 'RVN_9429_A2.jpg', 'N');
