INSERT INTO `tpt_products` VALUES ('470', 'Walnut 12', null, '<p><font size=\"3\">Perpetual plaques invite achievement.&nbsp; This plaque hangs often without fanfare - waiting for an individual to pass by.&nbsp; The plaque reaches out to the passerby who is thinking &quot;my name is next on that plaque!&quot;&nbsp; that individual now has to do something more than what is average to fulfill his desire to be next on the plaque.&nbsp; The result is added effort or new commitment or perhaps added financial giving.</font></p>\n<p><font size=\"3\">People strive for recognition.&nbsp; People want others to know they are valuable.&nbsp;&nbsp; People want to be known as contributors.&nbsp; People want to be good at what they do.&nbsp; A properly displayed perpetual plaque helps your employees or members achieve self worth and importance.&nbsp; </font></p>\n<ul>\n    <li><font size=\"3\">This 9&quot; x 12&quot; plaque is constructed from a wooden plaque panel that is wrapped in walnut finished vinyl. </font></li>\n    <li><font size=\"3\">A 12-plate perpetual plaque is typically utilized to recognize one individual monthly&nbsp; </font></li>\n    <li><font size=\"3\">Professional laser engraving of your text copy and logo on the heading / title plate is included </font></li>\n    <li><font size=\"3\">The engraved text / logo color is gold </font></li>\n    <li><font size=\"3\">Set up and layout of text&nbsp;is included&nbsp; </font></li>\n    <li><font size=\"3\">Set up and preparation of logo $14.75 </font></li>\n    <li><font size=\"3\">Production time is 4-7 days </font></li>\n    <li><font size=\"3\">Monthly name engraving on individual award plaque plates: </font>\n    <ul>\n        <li><font size=\"3\">$9.25 monthly </font></li>\n        <li><font size=\"3\">$89.00 annual prepaid </font>\n        <ul>\n            <li><font size=\"3\">Postage, handling and mailing included</font> </li>\n        </ul>\n        </li>\n    </ul>\n    </li>\n</ul>', null, null, null, 'R1062', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'R1062zoom.JPG', 'r1062 det.JPG', 'R1062thumb.JPG', 'N');
INSERT INTO `tpt_products` VALUES ('471', 'Smooth Walnut 12', null, '<ul>\n    <li><font size=\"3\">This 9&quot; x 12&quot; plaque is created from genuine walnut with a natural finish and radius border </font></li>\n    <li><font size=\"3\">This is a premium award plaque </font></li>\n    <li><font size=\"3\">A 12-plate perpetual plaque is typically utilized to recognize one individual monthly </font></li>\n    <li><font size=\"3\">Professional laser engraving of your text copy and logo on the heading / title plate is included </font></li>\n    <li><font size=\"3\">The engraved text / logo color is gold </font></li>\n    <li><font size=\"3\">Set up and layout of text is included </font></li>\n    <li><font size=\"3\">Set up and preparation of logo $14.75 </font></li>\n    <li><font size=\"3\">Name engraving on the individual award plaque plates: </font>\n    <ul>\n        <li><font size=\"3\">$9.25 monthly per plate</font> </li>\n        <li><font size=\"3\">$89.00&nbsp;annual prepaid for all&nbsp;12 plates</font> </li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Production time is 4 to 7 days</font>&nbsp; </li>\n</ul>', null, null, null, 'R1064', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'R1064zoom.JPG', 'R1064detail.JPG', 'R1064thum.JPG', 'N');
INSERT INTO `tpt_products` VALUES ('472', 'Smooth Walnut Edge 24', null, '<ul style=\"MARGIN-RIGHT: 0px\" dir=\"ltr\">\n    <li><font size=\"3\">This plaque is crated from genuine walnut with a natural finish and a radius border - a truly premium award plaque </font></li>\n    <li><font size=\"3\">A 24-plate perpetual plaque is often utlized to recognize two individuals monthly or it is randomly updated as achievement or gift give occurs </font></li>\n    <li><font size=\"3\">Professional laser engraving of your text copy and logo on the heading / title plate is included </font></li>\n    <li><font size=\"3\">The engraved text / logo color is gold </font></li>\n    <li><font size=\"3\">Set up and layout of text is included </font></li>\n    <li><font size=\"3\">Setup and preparation of logo is&nbsp;$14.75</font></li>\n    <li><font size=\"3\">Name engraving on award plaque plates: </font>\n    <ul>\n        <li><font size=\"3\">$9.25 each plate engraved or </font></li>\n        <li><font size=\"3\">$89.00 annual prepaid for 12 plates or </font></li>\n        <li><font size=\"3\">$169.00 prepaid for 24 plates </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Production time is 4 to 7 days</font> </li>\n</ul>', null, null, null, 'R1065', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'R1065zoom.JPG', 'R1065detail.JPG', 'R1065thum.JPG', 'N');
INSERT INTO `tpt_products` VALUES ('473', 'Solace', null, '<ul>\n    <li><font size=\"3\">Multi slate and charcoal slate </font></li>\n    <li><font size=\"3\">A natural stone which produces variations and uniqueness in color with each design </font></li>\n    <li><font size=\"3\">Text / logo and recognition are laser engraved </font></li>\n    <li><font size=\"3\">Sizes: </font>\n    <ul>\n        <li><font size=\"3\">3 3/4&quot; wide x 10&quot; tall x 1 3/4&quot; deep </font></li>\n        <li><font size=\"3\">4 1/8&quot; wide x 11 1/4&quot; tall x 2&quot; deep </font></li>\n        <li><font size=\"3\">4&nbsp; 1/2&quot; wode x 12 1/2&quot; tall x 2 3/8&quot; deep </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Text setup is included </font></li>\n    <li><font size=\"3\">Optional&nbsp;Logo set up $14.75 </font></li>\n    <li><font size=\"3\">Production time is 4 to 6 days </font></li>\n</ul>\n<p>&nbsp;</p>', null, null, null, 'AM04100', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'solace zoom.JPG', 'solace detail.JPG', 'solace thum.JPG', 'N');
INSERT INTO `tpt_products` VALUES ('474', 'Brass Gavel Wood and Glass Display', null, '<ul>\n    <li><font size=\"3\">Rap this brass 8&quot; gavel and restore the room to order </font></li>\n    <li><font size=\"3\">When not in service, the gavel rests inside a mahogany finished display case </font></li>\n    <li><font size=\"3\">The display case is lined with sapphire blue satin cloth </font></li>\n    <li><font size=\"3\">The gavel is displayed through a glass window when not in service </font></li>\n    <li><font size=\"3\">The top of the mahogany and glass display case is hinged for access to the gavel </font></li>\n    <li><font size=\"3\">The matching brass gavel band will be professionally engraved with up to 3 lines of text </font></li>\n    <li><font size=\"3\">Engraving of text on the gavel band and assembly of the engraved band to the gavel is included </font></li>\n    <li><font size=\"3\">A logo, organization or fim name can be engraved onto the glass window - $30 fee </font></li>\n    <li><font size=\"3\">Size of the mahogany finished display case is 11&quot; long x 5 1/2&quot; x 2 1/4&quot; tall </font></li>\n    <li><font size=\"3\">Normal production time is 5 days following text copy approval </font></li>\n    <li><font size=\"3\">For quantities of 3 or more of this product, please call for special pricing</font> </li>\n</ul>', null, null, null, 'R1074', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'R1074b.JPG', 'R1074 details.JPG', 'R1074th.JPG', 'N');
INSERT INTO `tpt_products` VALUES ('475', 'Hardwood Sound Block', null, '<ul>\n    <li><font size=\"3\">Thump a wood gavel on this hardwood sound block and bring the meeting to order.&nbsp;The reverberations from a quality sound block get the attention desired </font></li>\n    <li><font size=\"3\">This round hardwood sound block is walnut finished, double beveled and 4 1/2&quot; in diameter </font></li>\n    <li><font size=\"3\">The sound block surface can be embellished, by laser engraving, with an organization or governmental logo.&nbsp; This is an additional cost of $25</font></li>\n    <li><font size=\"3\">Production is 3 days following text copy approval</font> </li>\n</ul>', null, null, null, 'R1076', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'R1076 block.JPG', 'R1076 details.JPG', 'R1076_details.jpg', 'N');
