INSERT INTO `tpt_products` VALUES ('489', 'Rosewood Star', null, '<ul>\n    <li><font size=\"3\">Stunning rosewood shaped star </font></li>\n    <li><font size=\"3\">Size:&nbsp; 5 3/8&quot; diameter x 3/4&quot; thick </font></li>\n    <li><font size=\"3\">Felt protective bottom </font></li>\n    <li><font size=\"3\">Gift box packaging </font></li>\n    <li><font size=\"3\">Professional laser engraving of your logo or award text is positioned into the 2 1/2&quot; center area of the star </font></li>\n    <li><font size=\"3\">The engraved area is finished with your choice of matte metallic gold or matte metallic silver </font></li>\n    <li><font size=\"3\">Set up and layout of text $14.75 </font></li>\n    <li><font size=\"3\">Set up and preparation of logo $14.75</font></li>\n    <li><font size=\"3\">Production time is 4 to 8 days for this paperweight </font></li>\n</ul>\n<p><font size=\"3\">Minimum order quantity:&nbsp; 6</font></p>\n<p><font size=\"3\">For quantities of 12 or more, ask for special pricing</font></p>\n<p>&nbsp;</p>', null, null, null, 'R2525', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'R2525b.JPG', 'R2525a.JPG', 'R2525.JPG', 'N');
