INSERT INTO `tpt_products` VALUES ('492', 'Bamboo Keepsake box', null, '<ul>\n    <li><font size=\"3\">This keepsake box is quality manufacturered in the USA </font>\n    <ul>\n        <li><font size=\"3\">Natural finish bamboo </font></li>\n        <li><font size=\"3\">The exterior is 100% bamboo </font></li>\n        <li><font size=\"3\">Gold hinges </font></li>\n        <li><font size=\"3\">Navy blue felt lined box </font></li>\n        <li><font size=\"3\">Box overall size:&nbsp; 7&quot;&nbsp; wide x 5&quot; deep x 3 7/8&quot; tall </font></li>\n        <li><font size=\"3\">Inside depth of box:&nbsp; 1 7/16&quot; </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Professional engraving by laser of the exterior keepsake box lid is included </font></li>\n    <li><font size=\"3\">The engravable area is 6&quot; wide x 4&quot; deep </font></li>\n    <li><font size=\"3\">Setup for text is included </font></li>\n    <li><font size=\"3\">Optional logo engraving $14.75 set up </font></li>\n    <li><font size=\"3\">Minimum order quantity:&nbsp; 6 sets</font> </li>\n    <li><font size=\"3\">Production time 6 to 10 days</font>&nbsp; </li>\n</ul>', null, null, null, 'R2705', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'R2705 eco c.JPG', 'R2705 eco b.JPG', 'R2705 eco a.JPG', 'N');
