INSERT INTO `tpt_products` VALUES ('495', 'Clear Domed pins', null, '<ul>\n    <li><font size=\"3\">Quick delivery, gold metal, color print pins </font></li>\n    <li><font size=\"3\">12 day speedy quick delivery or </font></li>\n    <li><font size=\"3\">6 day rocket speed delivery (add $.80/$.60/$.50 per item) </font></li>\n    <li><font size=\"3\">Each pin is printed in full color </font></li>\n    <li><font size=\"3\">Gold, White, or silver print background </font></li>\n    <li><font size=\"3\">Protective crystal clear poly dome on the front </font></li>\n    <li><font size=\"3\">Gold finished military clutch attachment on back </font></li>\n    <li><font size=\"3\">Select from 7 shapes and 30 sizes (see enlargement) </font></li>\n    <li><font size=\"3\">Packaged in individual poly bags </font></li>\n    <li><font size=\"3\">Custom print preparation, set up services,&nbsp;and shipping $65</font> </li>\n</ul>\n<p>&nbsp;</p>', null, null, null, 'R3000', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'IN HOUSE c.JPG', 'IN HOUSE b.JPG', 'IN HOUSE a.JPG', 'N');
