INSERT INTO `tpt_products` VALUES ('499', 'Die Struck Detail', null, '<p><font size=\"3\">The details of your design are achieved by die striking ridges into the metal in which to inject enamel colors.&nbsp; Gloss pigmented colors are applied to each pin which is then kiln fired creating brilliant colors.</font></p>\n<p><font size=\"3\">The iron metal pin is finished by plating with gold, silver, bronze, or black nicke.</font></p>\n<ul>\n    <li><font size=\"3\">Up to 4 enamel colors are included </font></li>\n    <li><font size=\"3\">Colors beyond 4: 8&cent; per color </font></li>\n    <li><font size=\"3\">Crystal clear epoxy dome:&nbsp; 10&cent; each pin </font></li>\n    <li><font size=\"3\">Die tooling service $125 when the quantity to be made is less than 300 pieces </font></li>\n    <li><font size=\"3\">die tooling service included when the quantity is 300 or more </font></li>\n    <li><font size=\"3\">Piercing (inner hole cut) $30 set up </font></li>\n    <li><font size=\"3\">Custom shapes are welcomed </font></li>\n    <li><font size=\"3\">attachments available:&nbsp; military clutch or safety pin </font></li>\n    <li><font size=\"3\">Packaged in inidividual poly bags </font></li>\n    <li><font size=\"3\">Custom die tooling preparation, set up services and shipping $35 </font></li>\n    <li><font size=\"3\">Production time 4 to 5 weeks</font> </li>\n</ul>', null, null, null, 'R3004', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'die struck c.JPG', 'die struck b.JPG', 'die struck a.JPG', 'N');
INSERT INTO `tpt_products` VALUES ('501', 'Eco Friendly Certificate Plaque', null, '<ul>\n    <li><font size=\"3\">This certificate display is the best looking recycled materials constructed product of its type we have found </font></li>\n    <li><font size=\"3\">Certificate award display is deep emerald green </font></li>\n    <li><font size=\"3\">The plaque board, clear lens and packaging components are recycled materials </font></li>\n    <li><font size=\"3\">The certificate slides into place </font></li>\n    <li><font size=\"3\">Certificate size:&nbsp; 8 1/2&quot; x 11&quot; (certificate not included) </font></li>\n    <li><font size=\"3\">Size of plaque:&nbsp; 13&quot; wide x 10 1/2&quot; tall </font></li>\n    <li><font size=\"3\">Hangs horizontal or vertical </font></li>\n    <li><font size=\"3\">Concealed keyhole hanger </font></li>\n</ul>\n<p><font size=\"3\">Minimum order quantity:&nbsp; 10</font></p>', null, null, null, 'R2703', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'R2703 eco.JPG', 'R2703 ec detail.JPG', 'R2703 ecthum.JPG', 'N');
INSERT INTO `tpt_products` VALUES ('503', 'Mahogany Gold Base Arch Clock', null, '<ul>\n    <li><font size=\"3\">Arched top clock </font></li>\n    <li><font size=\"3\">Rosewood housing with exposed black beveled acrylic border </font></li>\n    <li><font size=\"3\">Gold bezel clock; gold and silver dial </font></li>\n    <li><font size=\"3\">Matte gold clock base </font></li>\n    <li><font size=\"3\">Includes a gold engraving plate; accentuates black lettering award text </font></li>\n    <li><font size=\"3\">Size:&nbsp;&nbsp;6 1/2&quot; tall x 6&quot; wide x 2&quot; deep </font></li>\n    <li><font size=\"3\">Text set up included </font>\n    <ul>\n        <li><font size=\"3\">Logo set up $14.75</font> </li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Production time is 3 to 5&nbsp;days </font></li>\n</ul>', null, null, null, 'AM22112', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'Sq arch clock_z.jpg', 'Sq arch clock_d.jpg', 'Sq arch clock_a.jpg', 'N');
