INSERT INTO `tpt_products` VALUES ('506', 'Pirouette Acrylic Award', null, '<ul>\n    <li><font size=\"3\">A stylish combination of beveled acrylic and a form-fit silver metal base </font></li>\n    <li><font size=\"3\">Angled and beveled thick acrylic </font></li>\n    <li><font size=\"3\">Polish front, satin back silver metal base </font></li>\n    <li><font size=\"3\">Available sizes: </font>\n    <ul>\n        <li><font size=\"3\">10&quot; tall x 5&quot; wide </font></li>\n        <li><font size=\"3\">12&quot; tall x 5&quot; wide </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Each award is engraved with text / logo </font></li>\n    <li><font size=\"3\">Professional engraving service is included </font></li>\n    <li><font size=\"3\">A logo of your own design can be added for a first time set-up fee of $14.75</font></li>\n    <li><font size=\"2\"><font size=\"3\">Production time for this award is 9 to 13 days</font> </font></li>\n</ul>', null, null, null, 'AM09104', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'pIROUETTE c.JPG', 'pIROUETTE b.JPG', 'pIROUETTE a.JPG', 'N');
INSERT INTO `tpt_products` VALUES ('507', 'Michaelangelo Clock', null, '<ul>\n    <li><font size=\"3\">Rosewood piano finished housing </font></li>\n    <li><font size=\"3\">Brass dial and visible movements </font></li>\n    <li><font size=\"3\">Engraving plate is black face brass </font></li>\n    <li><font size=\"3\">Size:&nbsp; 7 1/4&quot; tall x 8&quot; wide x 1 3/4&quot; deep </font></li>\n    <li><font size=\"3\">Professional laser engraving of your award text is positioned onto the black brass engraving plate </font></li>\n    <li><font size=\"3\">Each award is professionally engraved with up to 10 lines of text </font></li>\n    <li><font size=\"3\">Text engraving is gold </font></li>\n    <li><font size=\"3\">Engraving services are included </font></li>\n    <li><font size=\"3\">Setup and layout of text is included </font></li>\n    <li><font size=\"3\">Production time is 9 to 13 days </font></li>\n</ul>', null, null, null, 'AM09108', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'clock c411c.JPG', 'clock c411b.JPG', 'clock c411thumb.JPG', 'N');
INSERT INTO `tpt_products` VALUES ('509', 'Trellis Acrylic Award', null, '<ul>\n    <li><font size=\"3\">Satin pewter finish base extends and wraps to hold acrylic </font></li>\n    <li><font size=\"3\">Unique and reflective shape </font></li>\n    <li><font size=\"3\">Smooth beveled edge clear acrylic&nbsp; </font></li>\n    <li><font size=\"3\">Engraving is white </font></li>\n    <li><font size=\"3\">Size:&nbsp; </font>\n    <ul>\n        <li><font size=\"3\">5 1/2&quot; x 9&quot; with an engraving area of 2 3/4&quot; x 4&quot; </font></li>\n        <li><font size=\"3\">7&quot; x 10 1/2&quot; with an engraving area of 4&quot; x 6&quot; </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Each award is engraved with text / logo </font></li>\n    <li><font size=\"3\">Professional laser engraving service is included </font></li>\n    <li><font size=\"3\">A logo of your own design; $14.75&nbsp;set-up</font> </li>\n    <li><font size=\"2\"><font size=\"3\">Production time is 9 to 13 days </font></font></li>\n</ul>', null, null, null, 'AM09105', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'Y1010c.JPG', 'Y1010det.JPG', 'Y1010athumb.JPG', 'N');
