INSERT INTO `tpt_products` VALUES ('524', 'Revere Bowl', null, '<ul>\n    <li><font size=\"3\">Traditional revere bowl shape </font></li>\n    <li><font size=\"3\">Nickel plate bowl finish (appears as silver plate) </font></li>\n    <li><font size=\"3\">Nickel plate has a greater resistance to tarnish </font></li>\n    <li><font size=\"3\">The revere bowl is attached to the pedestal </font></li>\n    <li><font size=\"3\">The pedestal is wood with a walnut wrap finish </font></li>\n    <li><font size=\"3\">The pedestal is&nbsp;2 1/8&quot; tall </font></li>\n    <li><font size=\"3\">4&nbsp;sizes are available: </font>\n    <ul>\n        <li><font size=\"3\">4&quot; diameter bowl + 4&quot; x 4&quot; pedestal </font></li>\n        <li><font size=\"3\">6&quot; diameter bowl + 4 1/2&quot; x 4 1/2&quot; pedestal </font></li>\n        <li><font size=\"3\">8&quot; diameter bowl + 5 1/2&quot; x&nbsp; 5 1/2&quot; pedestal </font></li>\n        <li><font size=\"3\">10&quot; diameter bowl + 6 1/2&quot; x 6 1/2&quot; pedestal </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">A silver metal engraving plate is included </font></li>\n    <li><font size=\"3\">The plate is 1 1/4&quot; tall and attached to the pedestal </font></li>\n    <li><font size=\"3\">The silver plate will be professionally engraved including up to 4 lines of text </font></li>\n    <li><font size=\"3\">The engraving plate length is proportionate to the pedestal size </font></li>\n    <li><font size=\"3\">Engraving service is included </font></li>\n    <li><font size=\"3\">This is a quality nickel plated revere bowl that has received expressions of appreciation from the receipients and presenters. </font></li>\n    <li><font size=\"3\">Production is 7-10 days </font></li>\n</ul>\n<p><font size=\"3\">For quantities of 10 or more, call for special pricing</font></p>', null, null, null, 'AM10184', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'revere bowl c.JPG', 'revere bowl b.JPG', 'revere bowl thum.JPG', 'N');
