INSERT INTO `tpt_products` VALUES ('546', '4 Sided Frame', null, '<ul>\n    <li><font size=\"3\">4 sizes of decorative bars create bold metallic borders for your sign </font></li>\n    <li><font size=\"3\">Colors available: </font>\n    <ul>\n        <li><font size=\"3\">Polished rose gold </font></li>\n        <li><font size=\"3\">Polished yellow gold </font></li>\n        <li><font size=\"3\">Polished silver </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Lenses are available in semi flexible non-glare acrylic </font></li>\n</ul>\n<p><font size=\"3\">Call for sizes and pricing.</font> </p>', null, null, null, 'R2301F', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'WALL SIGNAGE_5c.JPG', 'WALL SIGNAGE_5b.JPG', 'WALL SIGNAGE_5athum.JPG', 'N');
INSERT INTO `tpt_products` VALUES ('547', 'Belt Buckles', null, '<ul>\n    <li><font size=\"3\">These buckles are custom made using lead free cast metal </font></li>\n    <li><font size=\"3\">Buckles are made to order </font></li>\n    <li><font size=\"3\">Your design can be extremely detailed, multi-leveled or 2 dimensional </font></li>\n    <li><font size=\"3\">Standard metal finishes: </font>\n    <ul>\n        <li><font size=\"3\">Antique Brass </font></li>\n        <li><font size=\"3\">Brush silver </font></li>\n        <li><font size=\"3\">Copper </font></li>\n        <li><font size=\"3\">Custom 24K gold plate finish available at extra cost </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Enamel colors can be applied to meet your design requirement </font></li>\n    <li><font size=\"3\">Small quantities are available </font>\n    <ul>\n        <li><font size=\"3\">Other sizes and quantities are available; please call </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Tooling cost for 2-dimension design: no charge </font></li>\n    <li><font size=\"3\">Tooling each added raised level in the design: $45 </font></li>\n    <li><font size=\"3\">Enamel colors:&nbsp; $.85 each color </font></li>\n</ul>\n<p><font size=\"3\">Minimum order quantity:&nbsp; 25</font></p>\n<p>&nbsp;</p>', null, null, null, 'R2801', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'BELT BUCKLES c.JPG', 'BELT BUCKLES b.JPG', 'BELT BUCKLES a.JPG', 'N');
INSERT INTO `tpt_products` VALUES ('552', 'Coins', null, '<ul>\n    <li><font size=\"3\">Coins are custom made using lead free cast metal </font></li>\n    <li><font size=\"3\">Coins are made to order </font></li>\n    <li><font size=\"3\">Coins can be single or double sided </font></li>\n    <li><font size=\"3\">Your design can be extremely detailed, multi-leveled or 2 dimension. </font></li>\n    <li><font size=\"3\">Standard metal finishes: </font>\n    <ul>\n        <li><font size=\"3\">Antique brass </font></li>\n        <li><font size=\"3\">Brush Silver </font></li>\n        <li><font size=\"3\">Copper </font></li>\n        <li><font size=\"3\">Custom 24K gold plate finish available at extra cost </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Enamel colors can be applied to meet your design requirement </font></li>\n    <li><font size=\"3\">Small quantities are available </font></li>\n    <li><font size=\"3\">Additional sizes and quantities are available, please call </font></li>\n    <li><font size=\"3\">Some coin designs must be die struck rather than cast; pricing of die struck coins must be custom quoted </font></li>\n    <li><font size=\"3\">Additional cost: </font>\n    <ul>\n        <li><font size=\"3\">tooling for 2 dimensional design on 1 side - no charge </font></li>\n        <li><font size=\"3\">tooling each added raised level in the design:&nbsp; $45 </font></li>\n        <li><font size=\"3\">tooling for 2nd side:&nbsp; $45 plus applicable raised levels cost </font></li>\n        <li><font size=\"3\">enamel colors:&nbsp; $.85 each color/each side </font></li>\n        <li><font size=\"3\">24K gold finish:&nbsp; please inquire about current price </font></li>\n    </ul>\n    </li>\n</ul>\n<p><font size=\"3\">Minimum order quantity:&nbsp; 25</font></p>\n<p>&nbsp;</p>', null, null, null, 'R2803', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'COINS z.JPG', 'COINS b.JPG', '1CO.JPG', 'N');
INSERT INTO `tpt_products` VALUES ('555', 'Key Chains - Zipper Pulls', null, '<ul>\n    <li><font size=\"3\">Key fobs are custom made using lead-free cast metal </font></li>\n    <li><font size=\"3\">Key fobs can be single or double sided </font></li>\n    <li><font size=\"3\">Your design can be extremely detailed, multi-leveled or 2 dimensional. </font></li>\n    <li><font size=\"3\">Standard metal finishes: </font>\n    <ul>\n        <li><font size=\"3\">Antique Brass </font></li>\n        <li><font size=\"3\">Brush Silver </font></li>\n        <li><font size=\"3\">Copper </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Enamel colors can be applied to meet your design requirement </font></li>\n    <li><font size=\"3\">Small quantities are available </font></li>\n    <li><font size=\"3\">For larger quantities or sizes not listed, please call </font></li>\n    <li><font size=\"3\">Tooling cost for 2-dimensional design on one side - included </font></li>\n    <li><font size=\"3\">tooling each added raised level in the design $45 </font></li>\n    <li><font size=\"3\">Tooling for 2nd side $45 + applicable raised levels cost </font></li>\n    <li><font size=\"3\">Enamel colors $.85 each color/each side </font></li>\n</ul>\n<p><font size=\"3\">Minimum order quantity:&nbsp; 25</font></p>', null, null, null, 'R2804', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'KEY CHAINSc.JPG', 'KEY CHAINSb.JPG', 'KEY CHAINSa.JPG', 'N');
INSERT INTO `tpt_products` VALUES ('556', 'Custom Medallions', null, '<ul>\n    <li><font size=\"3\">Medallions are custom made using lead-free cast metal </font></li>\n    <li><font size=\"3\">Medallions are made to order </font></li>\n    <li><font size=\"3\">Medallions can be single or double sided </font></li>\n    <li><font size=\"3\">Your design can be extremely detailed, multi-leveled or 2 dimensional. </font></li>\n    <li><font size=\"3\">Standard metal finishes: </font>\n    <ul>\n        <li><font size=\"3\">Antique brass </font></li>\n        <li><font size=\"3\">Antique silver </font></li>\n        <li><font size=\"3\">Antique copper </font></li>\n        <li><font size=\"3\">Custom 24K gold plate finish available at extra cost </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Enamel colors can be applied to meet your design requirement </font></li>\n    <li><font size=\"3\">For larger quantities or sizes not listed, please call </font></li>\n    <li><font size=\"3\">Tooling cost for 2 dimensional design on one side - included </font></li>\n    <li><font size=\"3\">Tooling each added raised level in the design $45 </font></li>\n    <li><font size=\"3\">Tooling for 2nd side $45 + applicable raised levels cost </font></li>\n    <li><font size=\"3\">Enamel colors $.85 each color/each side </font></li>\n    <li><font size=\"3\">Neck ribbons are available in many colors and combinations of colors </font>\n    <ul>\n        <li><font size=\"3\">Neck ribbons - inquire about current price </font></li>\n    </ul>\n    </li>\n</ul>\n<p><font size=\"3\">Minimum order quantity:&nbsp; 50</font></p>', null, null, null, 'R2802', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'MEDALLIONS z.JPG', 'MEDALLIONS detail.JPG', 'MEDALLIONS thum.JPG', 'N');
INSERT INTO `tpt_products` VALUES ('557', 'Microphone', null, '<p><em><font size=\"3\">We have received accolades about this award from several presenters!</font></em></p>\n<ul>\n    <li><font size=\"3\">The microphone is realistically detailed </font></li>\n    <li><font size=\"3\">It is matte silver with gold highlights </font></li>\n    <li><font size=\"3\">The pedestal is dark rosewood finished </font></li>\n    <li><font size=\"3\">It is oval shaped to compliment the microphone </font></li>\n    <li><font size=\"3\">Size:&nbsp; 6&quot; wide x 6.5&quot; tall </font></li>\n    <li><font size=\"3\">A silver metal engraved plate is included </font></li>\n    <li><font size=\"3\">Your message will be laser engraved by an AwardsMart engraving professional </font></li>\n    <li><font size=\"3\">Text setup and layout services are included </font></li>\n    <li><font size=\"3\">Production is 3 to 6 days </font></li>\n</ul>\n<p><font size=\"3\">For quantities of 12 or more, call for special pricing</font></p>\n<p>&nbsp;</p>', null, null, null, 'AM10190', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'RF3311SG_Z.jpg', 'RF3311SG_D.jpg', 'RF3311SG_A.jpg', 'N');
INSERT INTO `tpt_products` VALUES ('559', 'Texas Plaque', null, '<ul>\n    <li><font size=\"3\">Walnut veneer on the front and back </font></li>\n    <li><font size=\"3\">Black edge Texas plaque border </font></li>\n    <li><font size=\"3\">Sizes: </font>\n    <ul>\n        <li><font size=\"3\">11 1/2&quot; wide x 12 3/4&quot; tall </font></li>\n        <li><font size=\"3\">13 3/4&quot; wide x 15 1/4&quot; tall </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Gold finish holder for 2&quot; circles </font></li>\n    <li><font size=\"3\">Your color logo onto the 2&quot; diameter circle </font></li>\n    <li><font size=\"3\">Gold metal embossed star </font></li>\n    <li><font size=\"3\">Award text laser directly into the wood </font></li>\n    <li><font size=\"3\">Professional laser engraving of your award text is positioned onto the walnut veneer plaque </font></li>\n    <li><font size=\"3\">Each plaque is professionally engraved with up to 12 lines of text </font></li>\n    <li><font size=\"3\">Engraving is black </font></li>\n    <li><font size=\"3\">Engraving services are included </font></li>\n    <li><font size=\"3\">Set up and layout of text is included </font></li>\n    <li><font size=\"3\">A logo of your own design can be added for a first time set up fee of $14.75 </font></li>\n    <li><font size=\"3\">Production time is 5-7 days for this award </font></li>\n</ul>\n<p><font size=\"3\">For quantities of 12 or more, call for special pricing</font> </p>', null, null, null, 'AH40122', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'tx plaque c.jpg', 'tx plaque b.jpg', 'tx plaque a.jpg', 'N');
INSERT INTO `tpt_products` VALUES ('560', 'Single Ribbon Stock Rosette', null, '<ul>\n    <li><font size=\"3\">Stock rosette ribbon comes with string back with gold printed award or place designation </font></li>\n    <li><font size=\"3\">Overall size is 11.5&quot; x 3.5&quot; </font>\n    <ul>\n        <li><font size=\"3\">Head diameter 3.5&quot; </font></li>\n        <li><font size=\"3\">Single streamer colored ribbon is 8&quot; in length </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Single Ribbon designating place or level is printed in gold </font></li>\n    <li><font size=\"3\">Award or Place Designation - Color of Ribbon </font></li>\n    <ul>\n        <li><font size=\"3\">1st Place - Blue </font></li>\n        <li><font size=\"3\">2nd Place - Red </font></li>\n        <li><font size=\"3\">3rd Place - White </font></li>\n        <li><font size=\"3\">4th Place - Pink </font></li>\n        <li><font size=\"3\">5th Place - Yellow </font></li>\n        <li><font size=\"3\">6th Place - Green </font></li>\n        <li><font size=\"3\">Achievement - Teal </font></li>\n        <li><font size=\"3\">Best of Show - Purple </font></li>\n        <li><font size=\"3\">Excellence - Blue </font></li>\n        <li><font size=\"3\">Grand Champion - Purple </font></li>\n        <li><font size=\"3\">Honorable Mention - Green </font></li>\n        <li><font size=\"3\">Judge - Red </font></li>\n        <li><font size=\"3\">Participant - Maroon </font></li>\n        <li><font size=\"3\">Reserve Champion - Lavender </font></li>\n        <li><font size=\"3\">Special Award - Purple </font></li>\n        <li><font size=\"3\">Special Teacher - Red</font></li>\n    </ul>\n    <li><font size=\"3\">Custom award designation and ribbon color combinations are available </font></li>\n    <ul>\n        <li><font size=\"3\">Visit our Rosette-Custom 1-Streamer group for pricing </font></li>\n    </ul>\n    <li><font size=\"3\">Production time:&nbsp;in stock&nbsp; </font></li>\n    <li><font size=\"3\">Normal time is 3 to 4 business days if out of stock</font> </li>\n</ul>', null, null, null, 'AH5800', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'first rosette z.JPG', 'first rosette b.JPG', 'first rosette a.JPG', 'N');
