INSERT INTO `tpt_products` VALUES ('563', 'In Stock Identification Ribbons', null, '<ul>\n    <li><font size=\"3\">Satin ribbon with sewn top </font>\n    <ul>\n        <li><font size=\"3\">Safety pin&nbsp;attachment is included&nbsp; </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Bottom of ribbon is pinked </font></li>\n    <li><font size=\"3\">Gold imprinting of titles </font></li>\n    <li><font size=\"3\">Size is 2&quot; wide x 8&quot; long </font></li>\n    <li><font size=\"3\">Titles and ribbon colors </font></li>\n    <ul>\n        <li><font size=\"3\">Board Member - Blue </font></li>\n        <li><font size=\"3\">Chairman - Yellow </font></li>\n        <li><font size=\"3\">Chairperson -&nbsp;Yellow </font></li>\n        <li><font size=\"3\">Committee - Blue </font></li>\n        <li><font size=\"3\">Delegate - Light Blue </font></li>\n        <li><font size=\"3\">Exhibitor - Grey </font></li>\n        <li><font size=\"3\">Facilitator - Green </font></li>\n        <li><font size=\"3\">Finalist - Yellow </font></li>\n        <li><font size=\"3\">Guest - White </font></li>\n        <li><font size=\"3\">Host - Green </font></li>\n        <li><font size=\"3\">Hostess - White </font></li>\n        <li><font size=\"3\">Judge - Red </font></li>\n        <li><font size=\"3\">Member - Purple </font></li>\n        <li><font size=\"3\">President - Blue </font></li>\n        <li><font size=\"3\">Speaker - White </font></li>\n        <li><font size=\"3\">Sponsor - Red </font></li>\n        <li><font size=\"3\">Staff - Red </font></li>\n        <li><font size=\"3\">Treasurer - Purple </font></li>\n        <li><font size=\"3\">VIP - Blue </font></li>\n        <li><font size=\"3\">Visitor - White </font></li>\n        <li><font size=\"3\">Volunteer - Red </font></li>\n    </ul>\n    <li><font size=\"3\">Other titles, sizes, ribbon color and imprint colors are available by special order.&nbsp; Please call for prices and manufacturing time. </font></li>\n    <li><font size=\"3\">Out of stock titles, allow 3 to 4 days for production</font> </li>\n</ul>', null, null, null, 'AH5803', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'large-ident-ribbons stockc.jpg', 'large-ident-ribbons stockb.jpg', 'large-ident-ribbons stocka.jpg', 'N');
INSERT INTO `tpt_products` VALUES ('564', '45 Plate Perpetual', null, '<ul>\n    <li><font size=\"3\">Genuine walnut wood plaque </font></li>\n    <li><font size=\"3\">Roman cove decorative plaque edge </font></li>\n    <li><font size=\"3\">Black metal text plate adorned with notched corners, screws and rosettes </font></li>\n    <li><font size=\"3\">Gold back plate accentuates black metal text plate </font></li>\n    <li><font size=\"3\">engraved text is gold </font></li>\n    <li><font size=\"3\">Header plate text engraving included </font></li>\n    <li><font size=\"3\">Text set up is included </font></li>\n    <li><font size=\"3\">Logo preparation $14.75 </font></li>\n    <li><font size=\"3\">Plaque size 16&quot; x 20&quot; </font></li>\n    <li><font size=\"3\">Individual plates are attached with screws </font></li>\n    <li><font size=\"3\">Engraving of individual name plates: </font>\n    <ul>\n        <li><font size=\"3\">1-9 plates at one time; $9.25 each </font></li>\n        <li><font size=\"3\">10-49 plates at one time; $6.25 each</font> </li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Production time is 3 to&nbsp;5 days&nbsp;</font> </li>\n</ul>\n<p>&nbsp;</p>', null, null, null, 'AM22125', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', '45 PLATE_Z.jpg', '45 PLATE_D.jpg', '45 PLATE_A.jpg', 'N');
INSERT INTO `tpt_products` VALUES ('565', '60 Plate Perpetual', null, '<ul>\n    <li><font size=\"3\">Genuine walnut wood plaque </font></li>\n    <li><font size=\"3\">Roman cove decorative plaque edge </font></li>\n    <li><font size=\"3\">Black metal text plate adorned with notched corners, screws and rosettes </font></li>\n    <li><font size=\"3\">Gold back plate accentuates black metal text plate </font></li>\n    <li><font size=\"3\">Engraved text is gold </font></li>\n    <li><font size=\"3\">Header plate text engraving included </font></li>\n    <li><font size=\"3\">Text setup is included </font></li>\n    <li><font size=\"3\">Logo preparation $14.75 </font></li>\n    <li><font size=\"3\">Plaque size:&nbsp; 16&quot; x 20&quot; </font></li>\n    <li><font size=\"3\">Individual plates are attached with screws </font></li>\n    <li><font size=\"3\">Engraving of individual name plates: </font>\n    <ul>\n        <li><font size=\"3\">1 - 9 plates at one time; $9.25 each </font></li>\n        <li><font size=\"3\">10 - 49 plates at one time; $6.25 each </font></li>\n        <li><font size=\"3\">50 or more plates at one time; $5.75 each </font></li>\n    </ul>\n    </li>\n</ul>\n<p>&nbsp;</p>', null, null, null, 'AM22126', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', '60 PLATE_Z.jpg', '60 PLATE_D.jpg', '60 PLATE_A.jpg', 'N');
INSERT INTO `tpt_products` VALUES ('566', 'Prestigious Star Award', null, '<ul>\n    <li><font size=\"3\"><em>This award bespeaks quality</em> </font></li>\n    <li><font size=\"3\">It stands 14 1/2&quot; tall </font></li>\n    <li><font size=\"3\">Star is gold plated, polished metal; 11 1/2&quot; tall </font></li>\n    <li><font size=\"3\">Pedestal is high gloss piano finished rosewood </font></li>\n    <li><font size=\"3\">The engraving plate is thick gold flexible material, 2&quot; tall x 4 1/4&quot; wide </font></li>\n    <li><font size=\"3\">Professional engraving service is included </font></li>\n    <li><font size=\"3\">Logo preparation $14.75</font></li>\n    <li><font size=\"3\">Production time is 8 to 12 days</font> </li>\n</ul>', null, null, null, 'AH40127', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'Gold star zoom.bmp', 'Gold star b.jpg', 'Gold star thum.bmp', 'N');
INSERT INTO `tpt_products` VALUES ('567', 'Contemporary Star Achievement', null, '<ul>\n    <li><font size=\"3\">10 1/2&quot; tall bright gold plated star figure </font></li>\n    <li><font size=\"3\">Round black marble pedestal </font></li>\n    <li><font size=\"3\">The engraving plate is gold flexible engravers material </font></li>\n    <li><font size=\"3\">Engraved plate size 4 5/8&quot; x 7/8&quot; tall </font></li>\n    <li><font size=\"3\">This is an impressive award - its weight exceeds 1 lb </font></li>\n    <li><font size=\"3\">Professional laser engraving of your award text is included </font></li>\n    <li><font size=\"3\">Each award is engraved with up to 4 lines of text or text and logo </font></li>\n    <li><font size=\"3\">Engraving is black </font></li>\n    <li><font size=\"3\">Set up and layout of text is included </font></li>\n    <li><font size=\"3\">A&nbsp;logo, if wanted, has a&nbsp;preparation fee&nbsp;of&nbsp;$14.75</font></li>\n    <li><font size=\"3\">Production time is 4 to 5 days for this award </font></li>\n</ul>\n<p><font size=\"3\">For quantities of 10 or more, call for special pricing</font></p>', null, null, null, 'AH40126', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'Female starz.JPG', 'Female starb.JPG', 'female stara.gif', 'N');
INSERT INTO `tpt_products` VALUES ('568', 'Black Marble Star', null, '<ul>\n    <li><font size=\"3\">Jet black marble star on pedestal and base </font></li>\n    <li><font size=\"3\">Engraved text is color filled and is included </font></li>\n    <li><font size=\"3\">Felted bottom </font></li>\n    <li><font size=\"3\">Sizes: </font>\n    <ul>\n        <li><font size=\"3\">6&quot; wide x 5.5&quot; tall x 3.5&quot; deep </font></li>\n        <li><font size=\"3\">7&quot; wide x 6.5&quot; tall x 3.5&quot; deep </font></li>\n        <li><font size=\"3\">8&quot; wide x 7.5&quot; tall x 3.5&quot; deep </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Presentation box packaging </font></li>\n    <li><font size=\"3\">Logo preparation&nbsp;fee is&nbsp;$14.75 </font></li>\n    <li><font size=\"3\">Professional engraving is included</font> </li>\n    <li><font size=\"3\">Production time is 4 to 6 days&nbsp;</font> </li>\n</ul>\n<p><font size=\"3\">For quantities of 4 or more call, for special pricing</font></p>', null, null, null, 'R0305', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'marblestarzoom.png', 'R0305a.JPG', 'R0305.JPG', 'N');
INSERT INTO `tpt_products` VALUES ('569', 'Diamond Spun Dial', null, '<ul>\n    <li><font size=\"3\">This is a beautiful piano finish wood, quartz clock </font></li>\n    <li><font size=\"3\">The clock dial bezel is gold finish which accentuates the gold and silver finished dial </font></li>\n    <li><font size=\"3\">The black and rosewood piano finished wood is separated by gold vertical dividers </font></li>\n    <li><font size=\"3\">The gold dividers match the gold finished metal base </font></li>\n    <li><font size=\"3\">Size:&nbsp; 4.5&quot; wide x 5&quot; tall x 1.25&quot; deep </font></li>\n    <li><font size=\"3\">A gold engraving plate is included and will be professionally engraved.&nbsp; The engraved text is black </font></li>\n    <li><font size=\"3\">Engraving, up to 4 lines of text, is included </font></li>\n    <li><font size=\"3\">Engrave text set up is included </font></li>\n    <li><font size=\"3\">Logo preparation service $14.75 </font>\n    <ul>\n        <li><font size=\"3\">Text or Text and logo can be engraved directly into the rosewood for an additional cost of $10.00 </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Production time is 3 to 5 days </font></li>\n</ul>', null, null, null, 'AM10192', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'Q238[1]c.jpg', 'Q238[1]b.jpg', 'Q238[1]thum.jpg', 'N');
INSERT INTO `tpt_products` VALUES ('570', 'Rosewood and Chrome', null, '<ul>\n    <li><font size=\"3\">A sleek appearing gloss piano finish wood, quartz clock </font></li>\n    <li><font size=\"3\">The clock dial bezel is silver finish which accentuates the four hour markers and brushed silver dial </font></li>\n    <li><font size=\"3\">The rosewood piano finished wood is partitioned by wide polished silver vertical dividers </font></li>\n    <li><font size=\"3\">The dividers match the polished silver finished feet </font></li>\n    <li><font size=\"3\">Size:&nbsp; 7&quot; wide x 6.75&quot; tall x 1.5&quot; deep </font></li>\n    <li><font size=\"3\">A silver engravingi plate is included and will be professionally engraved.&nbsp; The engraved text is black </font></li>\n    <li><font size=\"3\">Engraving, up to 4 lines of text, is included </font></li>\n    <li><font size=\"3\">Engrave text set up is included </font></li>\n    <li><font size=\"3\">Logo preparation service $14.75</font></li>\n    <li><font size=\"3\">Production time is 3 to 5 days</font> </li>\n</ul>', null, null, null, 'AM10193', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'am10193 z.jpg', 'Desk_Accessories_-_Page_102[1]b.jpg', 'Rosewood chrome a.jpg', 'N');
INSERT INTO `tpt_products` VALUES ('571', 'Rosewood and Brass', null, '<p><font size=\"3\">This is a beautiful high polish piano finish wood, quartz clock</font></p>\n<ul>\n    <li><font size=\"3\">The clock dial bezel is gold finish which accentuates the gold and white dial and Roman numeral markers </font></li>\n    <li><font size=\"3\">The rosewood piano finished wood is accented with polished gold vertical dividers </font></li>\n    <li><font size=\"3\">The rosewood base border is unique with eight sides </font></li>\n    <li><font size=\"3\">Size:&nbsp; 6.25&quot; wide x 8&quot; tall x 1.25&quot; deep </font></li>\n    <li><font size=\"3\">A gold engraving plate is included and will be professionally engraved.&nbsp; The engraved text is black </font></li>\n    <li><font size=\"3\">Engraving, up to 4 lines of text, is included </font></li>\n    <li><font size=\"3\">Engrave text setup is included </font></li>\n    <li><font size=\"3\">Logo preparation service $14.75</font>\n    <ul>\n        <li><font size=\"3\">Text or Text and Logo can be engraved directly into the rosewood for a nominal&nbsp;cost of $10.00 </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Production time is 3 to 5 days</font> </li>\n</ul>', null, null, null, 'AM10194', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'Rosewood_&_Burl_-_Page_111[1]c.jpg', 'Rosewood_&_Burl_-_Page_111[1]b.jpg', 'Rosewood_&_brass thum.jpg', 'N');
INSERT INTO `tpt_products` VALUES ('572', 'Time In A Box', null, '<p><font size=\"3\">This is a beautiful piano finish wood housed, quartz clock</font></p>\n<ul>\n    <li><font size=\"3\">The clock dial bezel is gold finish which accentuates the white dial and Roman numeralmarkers </font></li>\n    <li><font size=\"3\">The concealed clock rises on gold finished hinges from within the rosewood case when the lid is opened </font></li>\n    <li><font size=\"3\">The rosewood case is constructed with gold finished corner accents to complete the prestigious appearance </font></li>\n    <li><font size=\"3\">Size:&nbsp; 6&quot; wide x 3.5&quot; tall x 6&quot; deep </font></li>\n    <li><font size=\"3\">A gold engraving plate is included and will professionally engraved.&nbsp; The engraved text is black </font></li>\n    <li><font size=\"3\">Engraving, up to 4 lines of text, is included </font></li>\n    <li><font size=\"3\">Engraved text set up is included </font></li>\n    <li><font size=\"3\">Logo preparation service $14.75</font>\n    <ul>\n        <li><font size=\"3\">Text or Text and Logo can be engraved directly into the rosewood for a nominal cost of $10.00 </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Production time is 3 to 5 days</font> </li>\n</ul>', null, null, null, 'AM10195', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'Desk_Accessories_-_Page_103[1]c.jpg', 'Desk_Accessories_-_Page_103[1]b.jpg', 'Desk_Accessories_-_Page_103[1]a.jpg', 'N');
INSERT INTO `tpt_products` VALUES ('573', 'Precision Quartz', null, '<p><font size=\"3\">This is a beautiful piano finish wood housed, quartz clock</font></p>\n<ul dir=\"ltr\">\n    <li>\n    <div><font size=\"3\">The clock dial bezel is gold finish which accentuates the white dial and Arabic numeral markers</font></div>\n    </li>\n    <li>\n    <div><font size=\"3\">The concealed clock turns on gold finished hinges from within the rosewood case</font></div>\n    </li>\n    <li>\n    <div><font size=\"3\">The rosewood case is constructed with gold finished accents and closure, and offers a rich dark green felted interior to complete the appearance of luxury</font></div>\n    </li>\n    <li>\n    <div><font size=\"3\">Size:&nbsp; 5&quot; wide x 4&quot; tall x 5&quot; deep</font></div>\n    </li>\n    <li>\n    <div><font size=\"3\">A gold engraving plate is included and will be professionally engraved.&nbsp; The engraved text is black</font></div>\n    </li>\n    <li>\n    <div><font size=\"3\">Engraving, up to 4 lines of text, is included</font></div>\n    </li>\n    <li>\n    <div><font size=\"3\">Engraved text set up is included</font></div>\n    </li>\n    <li>\n    <div><font size=\"3\">Logo preparation service $14.75</font></div>\n    <ul>\n        <li>\n        <div><font size=\"3\">Text or Text and Logo can be engraved directly into the rosewood for a nominal charge of $10.00</font></div>\n        </li>\n    </ul>\n    </li>\n    <li>\n    <div><font size=\"3\">Production time is 3 to 5 days</font></div>\n    </li>\n</ul>', null, null, null, 'AM10196', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'Q196_z.jpg', 'Q196_d.jpg', 'Q196_A.jpg', 'N');
INSERT INTO `tpt_products` VALUES ('574', 'Brass Accented Desk Clock', null, '<p><font size=\"3\">This is a beautiful piano finish wood housed, quartz clock</font></p>\n<ul>\n    <li><font size=\"3\">The clock dial bezel is gold finish which accentuates the white dial and Arabic numeral markers </font></li>\n    <li><font size=\"3\">The concealed clock turns on gold finished hinges from within the 8 sided rosewood case </font></li>\n    <li><font size=\"3\">The rosewood case is constructed with gold finished accents and closure and offers a rick dark green felted interior to complete the appearance of luxury </font></li>\n    <li><font size=\"3\">Size:&nbsp; 5&quot; wide x 4&quot; tall x 5&quot; deep </font></li>\n    <li><font size=\"3\">A gold engraving plate is included and will be professionally engraved; the engraved text is black </font></li>\n    <li><font size=\"3\">Engraving, up to 4 lines of text, is included </font></li>\n    <li><font size=\"3\">Engrave text set up is included </font></li>\n    <li><font size=\"3\">Logo preparation service $14.75</font>\n    <ul>\n        <li><font size=\"3\">Text or Text and Logo can be engraved directly into the rosewood for a nominal charge of $10.00 </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Production time is 3 to 5 days </font></li>\n</ul>', null, null, null, 'AM10197', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'Q230_z.jpg', 'Q230_d.jpg', 'Q230_a.jpg', 'N');
