INSERT INTO `tpt_products` VALUES ('624', 'Hard Hat And Shovel', null, '<ul>\n    <li><font size=\"3\">Metallic gold finished hard hat and shovel </font></li>\n    <li><font size=\"3\">Realistic and contrasting rock pile </font></li>\n    <li><font size=\"3\">Black matte finished pedestal base </font></li>\n    <li><font size=\"3\">Overall size:&nbsp; 6&quot; wide x 6&quot; tall x 3&quot; deep </font></li>\n    <li><font size=\"3\">Gold finished metal engraving plate </font></li>\n    <li><font size=\"3\">5 1/4&quot; x 1&quot; plate is engraved with up to 4 text lines </font></li>\n    <li><font size=\"3\">Engraving is included </font></li>\n    <li><font size=\"3\">Text set up is included </font></li>\n    <li><font size=\"3\">A logo of your own design can be added for a first time set up fee of $14.75 </font></li>\n    <li><font size=\"3\">Minimimum quantity:&nbsp; 3</font> </li>\n</ul>', null, null, null, 'AH51104', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'groundbrkg shovel hard hatz.JPG', 'groundbrkg shovel hard hatb.JPG', 'groundbrkg shovel hard hata.JPG', 'N');
INSERT INTO `tpt_products` VALUES ('625', 'Groundbreaking Shovel Plate', null, '<p><font size=\"3\">Award Plate:</font></p>\n<ul>\n    <li><font size=\"3\">Gold or Silver finished aluminum plate </font></li>\n    <li><font size=\"3\">6 1/4&quot; wide x 2 1/8&quot; tall center and 1&quot; tall ends </font></li>\n    <li><font size=\"3\">Laser engraved to buyer specifications </font></li>\n    <li><font size=\"3\">Engraving is included </font></li>\n    <li><font size=\"3\">Punched holes and mounting hardware included </font></li>\n    <li><font size=\"3\">Minimum quantity:&nbsp; 3 </font></li>\n    <li><font size=\"3\">Text set up is included </font></li>\n    <li><font size=\"3\">A logo of your own design can be added for a first time set up fee of $14.75 </font></li>\n    <li><font size=\"3\">Engraved plate and hardware </font></li>\n    <li><font size=\"3\">Mounting to shovel service $7.75 each </font></li>\n</ul>\n<p><font size=\"3\">Optional Shovel:</font></p>\n<ul>\n    <li><font size=\"3\">Your choice of available brands </font></li>\n    <li><font size=\"3\">Your choice of straight or &quot;D&quot; end handle </font></li>\n    <li><font size=\"3\">Price quoted upon request</font> </li>\n</ul>\n<p>&nbsp;</p>', null, null, null, 'AH40128', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'group groundbreak shovels with plate upright.JPG', 'Groundbreaking shovel with plateb.JPG', 'Groundbreaking shovel with platea.JPG', 'N');
INSERT INTO `tpt_products` VALUES ('627', 'Groundbreaking Acrylic Award', null, '<ul>\n    <li><font size=\"3\">10 3/4&quot; tall acrylic award </font></li>\n    <li><font size=\"3\">Pyramidic shape acrylic is clear </font></li>\n    <li><font size=\"3\">Black rectangular base is gold mirror topped to reflect gold&nbsp;through the acrylic </font></li>\n    <li><font size=\"3\">The&nbsp;shovel is brass plated metal and is permanently affixed to the pyramid </font></li>\n    <li><font size=\"3\">Engraving of text or text and art logo is included </font></li>\n    <li><font size=\"3\">A logo of your own design can be created/added for a first time set up fee of $14.75</font></li>\n    <li><font size=\"3\">Engraved text and art logo is frosted white </font></li>\n    <li><font size=\"3\">Complimentary proof of text and art logo layout </font></li>\n    <li><font size=\"3\">This is a custom and uniquely designed award </font></li>\n    <li><font size=\"3\">Production time is&nbsp;7 to 10 days</font> </li>\n</ul>', null, null, null, 'AM22226', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'GB ACRYLIC_Z.jpg', 'GB ACRYLIC_D.jpg', 'GB ACRYLIC_A.jpg', 'N');
