INSERT INTO `tpt_products` VALUES ('629', 'Reminisce', null, '<ul>\n    <li><font size=\"3\">Refined brass-finished arch </font></li>\n    <li><font size=\"3\">Polished brass-finished edges and base </font></li>\n    <li><font size=\"3\">Cream colored dial is set within a clear acrylic crystal </font></li>\n    <li><font size=\"3\">Quartz movement includes battery </font></li>\n    <li><font size=\"3\">Movement cover encloses battery </font></li>\n    <li><font size=\"3\">Size:&nbsp; 7 1/4&quot; h x 5 3/4&quot; w x 2&quot; deep </font></li>\n    <li><font size=\"3\">Award recognition can be either laser directly onto acrylic or on a gold&nbsp;engraved plate </font></li>\n    <li><font size=\"3\">Plate size is 1&quot; x 3&quot; </font></li>\n    <li><font size=\"3\">Engraving is included </font></li>\n    <li><font size=\"3\">Text or Logo set up and preparation is $14.75 </font></li>\n    <li><font size=\"3\">Production time is 5 to&nbsp;7 days</font> </li>\n</ul>', null, null, null, 'AM31107', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'Reminisce_z.jpg', 'Reminisce_D.jpg', 'Reminisce_A.jpg', 'N');
INSERT INTO `tpt_products` VALUES ('630', 'Exton', null, '<ul>\n    <li><font size=\"3\">Finished in brushed and polished brass </font></li>\n    <li><font size=\"3\">Metal carriage-style clock boasts classic good looks </font></li>\n    <li><font size=\"3\">The brushed brass-tone dial is accented by a circular spun numeral ring with diamond cut edges </font></li>\n    <li><font size=\"3\">Black Roman numerals </font></li>\n    <li><font size=\"3\">Quartz movement includes battery </font></li>\n    <li><font size=\"3\">Size: 8 3/4&quot; tall &nbsp;x 7 1/4&quot; wide x 3&quot; deep </font></li>\n    <li><font size=\"3\">Imprint areas: </font>\n    <ul>\n        <li><font size=\"3\">1 1/2&quot; x 5 3/4&quot; area on front of clock </font></li>\n        <li><font size=\"3\">1 3/4&quot; x 3&quot; area on top of clock </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Text set up&nbsp;and engraving is included&nbsp;</font> </li>\n    <li><font size=\"3\">Logo set up $14.75 </font></li>\n    <li><font size=\"3\">Production time is 5 to 7&nbsp;business days</font> </li>\n</ul>', null, null, null, 'AM31108', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'Exton_z.jpg', 'Exton_D.jpg', 'Exton_A.jpg', 'N');
INSERT INTO `tpt_products` VALUES ('631', 'Solomon', null, '<ul>\n    <li><font size=\"3\">Pivoting round brushed brass-finished case </font></li>\n    <li><font size=\"3\">Case set in a polished brass-finished cradle </font></li>\n    <li><font size=\"3\">Rectangular satin rosewood-finished base with chamfered corners </font></li>\n    <li><font size=\"3\">Dial features a circular-brushed brass finished numeral ring that encircles a skeleton movement and seconds track </font></li>\n    <li><font size=\"3\">Quartz movement includes battery </font></li>\n    <li><font size=\"3\">Size:&nbsp; 7&quot; tall x&nbsp; 5 1/4&quot; wide x 5 1/4&quot; deep </font></li>\n    <li><font size=\"3\">1&quot; x 3&quot; engraving plate included </font></li>\n    <li><font size=\"3\">Engraving plate is gold, engraving is black </font></li>\n    <li><font size=\"3\">Text set up is included </font></li>\n    <li><font size=\"3\">Production time is 5 to&nbsp;8&nbsp;business days</font> </li>\n</ul>', null, null, null, 'AM31109', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'soloman_.jpg', 'soloman__D.jpg', 'soloman_A.jpg', 'N');
INSERT INTO `tpt_products` VALUES ('632', 'Roland', null, '<ul>\n    <li><font size=\"3\">High gloss Rosewood hall finished clock </font></li>\n    <li><font size=\"3\">Solid brass pen </font></li>\n    <li><font size=\"3\">Felt bottom protects your desktop </font></li>\n    <li><font size=\"3\">Quartz movement includes battery </font></li>\n    <li><font size=\"3\">Brass engraving plate 3/4&quot; x 2 1/2&quot;</font></li>\n    <li><font size=\"3\">Size: 3 3/4&quot; tall x 6 3/4&quot; wide x 3 1/4&quot; deep<font size=\"2\"> </font></font></li>\n    <li><font size=\"3\">Text set up is included </font></li>\n    <li><font size=\"3\">Production time is 5&nbsp;to 10&nbsp;days </font></li>\n</ul>\n<p>&nbsp;</p>', null, null, null, 'AM31110', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'Roland_z.jpg', 'Roland_D.jpg', 'Roland_A.jpg', 'N');
INSERT INTO `tpt_products` VALUES ('633', 'Hampton Mantle Clock', null, '<ul>\n    <li><font size=\"3\">Windsor casual finish on select hardwoods and veneers </font></li>\n    <li><font size=\"3\">Beaded molding accents </font></li>\n    <li><font size=\"3\">&quot;Aged dial&quot; </font></li>\n    <li><font size=\"3\">Quartz, dual chime movement plays Westminster or Ave Maria chimes </font></li>\n    <li><font size=\"3\">Volume control </font></li>\n    <li><font size=\"3\">Automatic nighttime shut-off option </font></li>\n    <li><font size=\"3\">3/4&quot; x 3&quot; engraved plate </font></li>\n    <li><font size=\"3\">Engraved plate is gold, text is black </font></li>\n    <li><font size=\"3\">Engraving is included </font></li>\n    <li><font size=\"2\"><font size=\"3\">Size:&nbsp; 11 1/4&quot; tall x 19&quot; wide x 6 3/4&quot; deep</font></font></li>\n    <li><font size=\"2\"><font size=\"3\">Production time is 6 to 12&nbsp;days</font>&nbsp;</font></li>\n</ul>', null, null, null, 'AM31111', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'Hampton z.gif', 'hampton b.gif', 'Hampton a.gif', 'N');
