INSERT INTO `tpt_products` VALUES ('637', 'Blind Justice', null, '<ul>\n    <li><font size=\"3\">Lawyers prefer awards with substance </font></li>\n    <li><font size=\"3\">Substance is built into this award </font>\n    <ul>\n        <li><font size=\"3\">The blind justice figure is cast metal </font></li>\n        <li><font size=\"3\">The pedestal is black marble </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">The engraved award text is included </font></li>\n    <li><font size=\"3\">The text area is 3/4&quot; x 2 3/16&quot; </font>\n    <ul>\n        <li><font size=\"3\">Up to 3 text lines are included </font></li>\n        <li><font size=\"3\">Additional text lines $2 each </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">This award is 8&quot; tall </font></li>\n    <li><font size=\"3\">Production is 3 to 4 days </font></li>\n</ul>\n<p><font size=\"3\">For quantities of 6 or more, call for special pricing.</font> </p>', null, null, null, 'AH40130', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'Law Figure Base_Z.jpg', 'Law Figure Base_D.jpg', 'Law Figure Base_A.jpg', 'N');
