INSERT INTO `tpt_products` VALUES ('648', 'Reach', null, '<ul>\n    <li><font size=\"3\">100% cast bronze construction </font></li>\n    <li><font size=\"3\">13.5&quot; tall </font></li>\n    <li><font size=\"3\">Hand finished satin bronze </font></li>\n    <li><font size=\"3\">Double bevel walnut pedestal </font></li>\n    <li><font size=\"3\">American Made </font></li>\n    <li><font size=\"3\">A Brass engraved plate included with up to 4 lines of engraving </font></li>\n    <li><font size=\"3\">Production time is 3 weeks </font></li>\n</ul>\n<p><font size=\"3\">This award is for all who have wished upon a star and who have gone beyond themselves and touched one.&nbsp; This is a beautiful tribute to any individual who has been an inspiration to others.</font></p>', null, null, null, 'AH63106', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'Reach_z.jpg', 'Reach_d.jpg', 'Reach_t.jpg', 'N');
INSERT INTO `tpt_products` VALUES ('649', 'Eternal Flame', null, '<ul>\n    <li><font size=\"3\">100% cast bronze construction </font></li>\n    <li><font size=\"3\">14&quot; tall </font></li>\n    <li><font size=\"3\">Oxidized bronze finish </font></li>\n    <li><font size=\"3\">Double bevel walnut pedestal </font></li>\n    <li><font size=\"3\">American made </font></li>\n    <li><font size=\"3\">A brass engraved plate is included with up to 3 lines of engraving </font></li>\n    <li><font size=\"3\">Production time is 3 weeks </font></li>\n</ul>\n<p><font size=\"3\">Eternal flames burn throughout the world in honor of memory, remembrance, work well done and life well lived.</font></p>', null, null, null, 'AH63107', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'Celebrate_z.jpg', 'Celebrate_d.jpg', 'Celebrate_t.jpg', 'N');
INSERT INTO `tpt_products` VALUES ('650', 'Bronze Atlas Award', null, '<ul>\n    <li><font size=\"3\">100% cast bronze construction </font></li>\n    <li><font size=\"3\">7&quot; tall </font></li>\n    <li><font size=\"3\">Smooth antique bronze finish </font></li>\n    <li><font size=\"3\">Clear, round glass ball </font></li>\n    <li><font size=\"3\">Double bevel walnut pedestal </font></li>\n    <li><font size=\"3\">American made </font></li>\n    <li><font size=\"3\">A brass engraved plate included with up to 3 lines of engraving </font></li>\n    <li><font size=\"3\">Production time is 3 weeks </font></li>\n</ul>\n<p><font size=\"3\">In Greek legend, Atlas was the son of a powerful Titan.&nbsp; Atlas was condemmed to uphold the planet earth upon his shoulders forever after a failed campaign against the Olympian Gods.</font>&nbsp; </p>', null, null, null, 'AH63110', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'Atals_z.jpg', 'Atals_d.jpg', 'Atals_t.jpg', 'N');
INSERT INTO `tpt_products` VALUES ('651', 'Mercury', null, '<ul>\n    <li><font size=\"3\">100% cast bronze construction </font></li>\n    <li><font size=\"3\">12&quot; tall </font></li>\n    <li><font size=\"3\">Hand finished satin bronze </font></li>\n    <li><font size=\"3\">Double bevel walnut pedestal </font></li>\n    <li><font size=\"3\">American made </font></li>\n    <li><font size=\"3\">A brass engraved plate is included with up to 3 lines of engraving </font></li>\n    <li><font size=\"3\">Production time is 3 weeks </font></li>\n</ul>\n<p><font size=\"3\">With winged sandals and staff entwined with snakes, Mercury delivered his messages swiftly to the gods.</font></p>', null, null, null, 'AH63111', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'Merc_z.jpg', 'Merc_d.jpg', 'Merc_t.jpg', 'N');
INSERT INTO `tpt_products` VALUES ('652', 'The Thinker', null, '<ul>\n    <li><font size=\"3\">100% cast bronze construction </font></li>\n    <li><font size=\"3\">3 Sizes available: </font>\n    <ul>\n        <li><font size=\"3\">6&quot; tall </font></li>\n        <li><font size=\"3\">9.5&quot; tall </font></li>\n        <li><font size=\"3\">11.75&quot; tall </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Oxidized bronze finish </font></li>\n    <li><font size=\"3\">Double bevel walnut pedestal </font></li>\n    <li><font size=\"3\">American made </font></li>\n    <li><font size=\"3\">A brass engraved plate included with up to 3 lines of engraving </font></li>\n    <li><font size=\"3\">A replica of the sculpture by Auguste Rodin </font></li>\n    <li><font size=\"3\">Production time is 3 weeks</font> </li>\n</ul>', null, null, null, 'AH63112', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'Thinker_z.jpg', 'Thinker_d2.jpg', 'Thinker_t2.jpg', 'N');
INSERT INTO `tpt_products` VALUES ('653', 'Viking Warrior', null, '<ul>\n    <li><font size=\"3\">100% cast bronze construction </font></li>\n    <li><font size=\"3\">9.5&quot; tall </font></li>\n    <li><font size=\"3\">Antiqued bronze finish </font></li>\n    <li><font size=\"3\">Double bevel walnut pedestal </font></li>\n    <li><font size=\"3\">American made </font></li>\n    <li><font size=\"3\">A brass engraved plate is included with up to 3 lines of engraving </font></li>\n    <li><font size=\"3\">Production time is 3 weeks </font></li>\n</ul>\n<p><font size=\"3\">The Vikings were courageous explores of the new world, resourceful and fierce.&nbsp; They successfully confronted and overcame the unknown. This American made cast bronze Viking warrior symbolizes resourcefulness, courage, and determination.&nbsp; </font></p>', null, null, null, 'AH63113', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'Viking_z.jpg', 'Viking_d.jpg', 'Viking_t.jpg', 'N');
INSERT INTO `tpt_products` VALUES ('654', 'Prospector', null, '<ul>\n    <li><font size=\"3\">100% cast bronze construction </font></li>\n    <li><font size=\"3\">7 1/2&quot; tall </font></li>\n    <li><font size=\"3\">Hand finished satin bronze </font></li>\n    <li><font size=\"3\">Double bevel walnut pedestal </font></li>\n    <li><font size=\"3\">American made </font></li>\n    <li><font size=\"3\">A brass engraved plate is included with up to 3 lines of engraving </font></li>\n    <li><font size=\"3\">Production time is 3 weeks </font></li>\n</ul>\n<p><font size=\"3\">Diligence, patience, a plan of action&nbsp;and concentration were of extreme importance if the gold prospector was to find gold in the bottom of his pan.</font>&nbsp; </p>', null, null, null, 'AH63114', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'Pro_z.jpg', 'Pro_d.jpg', 'Pro_t.jpg', 'N');
INSERT INTO `tpt_products` VALUES ('655', 'Loaded for Bear', null, '<ul>\n    <li><font size=\"3\">Mountain Man hunting for bear sculpture </font></li>\n    <li><font size=\"3\">100% cast bronze construction </font></li>\n    <li><font size=\"3\">8.5&quot; tall </font></li>\n    <li><font size=\"3\">Oxidized bronze finish </font></li>\n    <li><font size=\"3\">Double bevel walnut pedestal </font></li>\n    <li><font size=\"3\">American made </font></li>\n    <li><font size=\"3\">A brass engraved plate is included withup to 3 lines of engraving </font></li>\n    <li><font size=\"3\">Production time is 3 weeks </font></li>\n</ul>\n<p><font size=\"3\">Old West stories abound with the legendary mountain men.&nbsp; These men led lives based upon self-reliance, determination and personal strength in their struggle for success.</font></p>', null, null, null, 'AH63115', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'Loaded_z.jpg', 'Loaded_d.jpg', 'Loaded_t.jpg', 'N');
INSERT INTO `tpt_products` VALUES ('656', 'Wizard', null, '<ul>\n    <li><font size=\"3\">100% cast bronze construction </font></li>\n    <li><font size=\"3\">10&quot; tall </font></li>\n    <li><font size=\"3\">Antiqued bronze, smooth finish </font></li>\n    <li><font size=\"3\">Double bevel walnut pedestal </font></li>\n    <li><font size=\"3\">American made </font></li>\n    <li><font size=\"3\">A brass engraved plate is included with up to 3 lines of engraving </font></li>\n    <li><font size=\"3\">Production time is 3 weeks </font></li>\n</ul>\n<p><font size=\"3\">The much sought Wizards were wily, imaginative, creative and canny as they impressed and inspired individuals to see their surroundings in a different light.</font></p>', null, null, null, 'AH63116', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'Wiz_z.jpg', 'Wiz_d.jpg', 'Wiz_t.jpg', 'N');
