INSERT INTO `tpt_products` VALUES ('659', 'Texas Standing Acrylic', null, '<ul>\n    <li><font size=\"3\">Crystal clear acrylic </font></li>\n    <li><font size=\"3\">Bevelled edges onTexas and the pedestal </font></li>\n    <li><font size=\"3\">Logo and text are laser engraved </font></li>\n    <li><font size=\"3\">Laser engraving is included </font></li>\n    <li><font size=\"3\">Color can be added - custom quoted </font></li>\n    <li><font size=\"3\">Sizes available in 3/4&quot; thick acrylic </font>\n    <ul>\n        <li><font size=\"3\">6&quot; tall </font></li>\n        <li><font size=\"3\">8&quot; tall </font></li>\n        <li><font size=\"3\">10&quot; tall </font></li>\n        <li><font size=\"3\">12&quot; tall </font></li>\n        <li><font size=\"3\">14&quot; tall </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Production time is 4-7 days </font></li>\n    <li><font size=\"3\">A logo of your own design can be added for a first time set up fee of $14.75 </font></li>\n</ul>', null, null, null, 'AH40129', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'tx acrylic z.jpg', 'tx acrylic b.jpg', 'tx acrylic a.jpg', 'N');
INSERT INTO `tpt_products` VALUES ('660', 'Beautiful Silver Cup', null, '<ul>\n    <li><font size=\"3\">Beautiful silver plated cup </font>\n    <ul>\n        <li><font size=\"3\">Wide body styling </font></li>\n        <li><font size=\"3\">Golden brass decorative trim </font></li>\n        <li><font size=\"3\">Choose gold or silver acorn finial (2&quot; tall) </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Round Rosewood base </font>\n    <ul>\n        <li><font size=\"3\">Matte finished wood </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Engraving is included </font>\n    <ul>\n        <li><font size=\"3\">Silver finished stars engraving plate </font></li>\n        <li><font size=\"3\">Up to 4 lines of engraving is included </font></li>\n        <li><font size=\"3\">2 1/2&quot; tall engraving plate secured to the wood base with screws </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Sizes available </font>\n    <ul>\n        <li><font size=\"3\">21&quot; tall </font></li>\n        <li><font size=\"3\">23&quot; tall </font></li>\n        <li><font size=\"3\">25&quot; tall </font></li>\n    </ul>\n    </li>\n    <li><font size=\"2\"><font size=\"3\">Production time is 3 to 5 days</font> </font></li>\n</ul>', null, null, null, 'AM10204', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', '110 z.jpg', '110 b.jpg', '110 a.jpg', 'N');
INSERT INTO `tpt_products` VALUES ('661', 'Traditional Gold Award Cup', null, '<ul>\n    <li><font size=\"3\">This cup design has stood the test of time to become the icon of award cups within the USA </font></li>\n    <li><font size=\"3\">we have awakened the look of this traditional award cup with a stunning new, angled, wood pedestal </font></li>\n    <li><font size=\"3\">The cup is metal.&nbsp; It is plated to a lustrous gold finish.&nbsp; </font></li>\n    <li><font size=\"3\">The pedestal is&nbsp;rosewood finished wood </font></li>\n    <li><font size=\"3\">The engraving plate is gold finished and mounted onto the pedestal base.&nbsp; </font></li>\n    <li><font size=\"3\">The engraved award test is black </font></li>\n    <li><font size=\"3\">Professional engraving service is included with each award cup - no additional cost </font></li>\n    <li><font size=\"3\">The cup and pedestal are available in 5 sizes </font>\n    <ul>\n        <li><font size=\"3\">7 3/4&quot; total height </font></li>\n        <li><font size=\"3\">9&quot; total height </font></li>\n        <li><font size=\"3\">10 1/2&quot; total height </font></li>\n        <li><font size=\"3\">13&quot; total height </font></li>\n        <li><font size=\"3\">16&quot; total height </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Text set up service is included with this cup </font></li>\n    <li><font size=\"3\">A logo of your own design can be added for a first time set up fee of $14.75 </font></li>\n    <li><font size=\"2\"><font size=\"3\">Production time 4 to 6 days</font> </font></li>\n</ul>', null, null, null, 'AM10202', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'Cup zoom.jpg', 'Cupb.jpg', 'Cupsmall.jpg', 'N');
INSERT INTO `tpt_products` VALUES ('662', 'Walnut Gavel Presentation Box', null, '<ul>\n    <li><font size=\"3\">10&quot; gavel - walnut finished hardwood </font></li>\n    <li><font size=\"3\">Square sound block - walnut finished hardwood </font></li>\n    <li><font size=\"3\">Satin lined presentation case </font></li>\n    <li><font size=\"3\">Presentation case - walnut finished hardwood </font></li>\n    <li><font size=\"3\">Brass Gavel Band </font></li>\n    <li><font size=\"3\">Up to 3 lines engraved on the band is included </font></li>\n    <li><font size=\"3\">Engraved band set up service - included </font></li>\n    <li><font size=\"3\">Options: </font>\n    <ul>\n        <li><font size=\"3\">Engrave on the sound block - $18.50 </font></li>\n        <li><font size=\"3\">Engrave on the presentation case lid </font>\n        <ul>\n            <li><font size=\"3\">small area $18.50 </font></li>\n            <li><font size=\"3\">large area $29.50 </font></li>\n        </ul>\n        </li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Presentation case size is 12&quot; long x 5 1/4&quot; deep x 3 1/4&quot; tall </font></li>\n    <li><font size=\"2\"><font size=\"3\">Production time is 3-5 days</font> </font></li>\n</ul>', null, null, null, 'AM10207', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'GV140 z.jpg', 'GV140 b.jpg', 'GV140 a.jpg', 'N');
