INSERT INTO `tpt_products` VALUES ('665', 'Star Topped Spire', null, '<ul>\n    <li><font size=\"3\">Impressive polished and beveled crystal star </font></li>\n    <li><font size=\"3\">Tapered crystal spire rising to star </font></li>\n    <li><font size=\"3\">Trapezoid shaped crystal pedestal </font></li>\n    <li><font size=\"3\">Laser engraved text applied to the face side of the pedestal is included </font></li>\n    <li><font size=\"3\">The spire can also be laser engraved with logo or text for an additional cost </font></li>\n    <li><font size=\"3\">Size is 4&quot; wide x 10 1/2&quot; tall </font></li>\n    <li><font size=\"3\">The set up fee for a logo&nbsp;is $14.75 </font></li>\n    <li><font size=\"3\">Free text layout proof is included </font></li>\n    <li><font size=\"2\"><font size=\"3\">Production is 4 to 5 days following proof approval</font> </font></li>\n</ul>', null, null, null, 'AM10213', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'CRY167 z.jpg', 'CRY167 b.jpg', 'CRY167 a.jpg', 'N');
