INSERT INTO `tpt_products` VALUES ('974', '3 Column Tall Round Wooden Trophy', null, '<ul>\n    <li><font size=\"3\">The Top Figure shown is a Male Trap Shooter<em> </em></font>\n    <ul>\n        <li><font size=\"3\"><em>Select your sport figure</em> </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">The 8 1/2&quot; tall Cup is Bright Gold finished </font></li>\n    <li><font size=\"3\">The 8&quot; diameter lid is walnut finish / black edge </font></li>\n    <li><font size=\"3\">The 3 columns shown are Silver with Gold accents </font></li>\n    <li><font size=\"3\">The Pedestal base is 8&quot; and 10&quot; round </font></li>\n    <li><font size=\"3\">Polished Gold Alum separates the 8&quot; and 10&quot; rounds </font></li>\n    <li><font size=\"3\">The 5 1/2&quot; Victory figure shown is Male </font>\n    <ul>\n        <li><font size=\"3\"><em>Female Victory can be specified</em> </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">The Victory figure riser recieves 2&quot; diameter sport specific design or your custom logo.&nbsp; AwardsMart will supply a colorful design in keeping with your sport - at no charge.&nbsp; AwardsMart can supply your custom design, from your supplied digital artwork.&nbsp; The applicable art set-up cost is $14.75 </font></li>\n    <li><font size=\"2\"><font size=\"3\">A satin gold 2 3/4&quot; tall x 5 1/2&quot; wide engraving plate and up to 5 lines of engraving is included.</font> </font></li>\n</ul>\n<p><a target=\"_blank\" href=\"http://www.awards-mart.com/IMG_II/col_colors_d2.jpg\"><font size=\"2\"><img border=\"0\" alt=\"\" src=\"http://www.awards-mart.com/IMG_II/col_colors_d2.jpg\" /></font></a><font size=\"2\">&nbsp;</font></p>\n<blockquote style=\"MARGIN-RIGHT: 0px\" dir=\"ltr\">\n<p align=\"left\"><font size=\"2\"><strong>Note:</strong>&nbsp; This trophy can be built up to 60&quot; tall.&nbsp; Inquire for prices beyond 42&quot; tall. This trophy is shipped fully assembled.&nbsp;&nbsp;Protective packaging and shipping (UPS ground), is $20 each trophy when shipped to a non-rural addresses.&nbsp;&nbsp;Rural address customers&nbsp;add $10. </font></p>\n</blockquote>', null, null, null, 'AH40150', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'BT5B_z.jpg', 'BT5B_d.jpg', 'BT5B_d2_2014.jpg', 'N');
INSERT INTO `tpt_products` VALUES ('975', 'Champions Tall Trophy', null, '<ul>\n    <li><font size=\"3\">The Top Figure is a Male Soccer Hitch Kicker </font>\n    <ul>\n        <li><font size=\"3\"><em>Select your sport figure</em> </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">The Cup is Bright Gold and 8 1/2&quot; tall </font></li>\n    <li><font size=\"3\">The Cherry finished wooden lid is 10 1/2&quot; square </font></li>\n    <li><font size=\"3\">The 4 Columns are Green-Gold </font>\n    <ul>\n        <li><font size=\"3\">Select your column color </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">The Cherry finish wooden pedestal base is 12&quot; square </font></li>\n    <li><font size=\"3\">The 5 1/2&quot; Victory figure shown is Female </font>\n    <ul>\n        <li><font size=\"3\">Male Victory figure can be specified </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">The Victory figure riser receives 2&quot; diameter sport specific design or your custom logo.&nbsp; AwardsMart will supply a colorful design in keeping with your sport - at no charge.&nbsp; AwardsMart can supply your custom design, from your supplied digital artwork.&nbsp; The applicable art set-up cost is $14.75 </font></li>\n    <li><font size=\"2\"><font size=\"3\">A satin gold engraving plate 8&quot; x 1&quot; is included.&nbsp; Engraving up to 3 lines of text is included</font></font> </li>\n    <li><font size=\"2\"><font size=\"3\">Production time is 5 to&nbsp;7&nbsp;days</font>&nbsp;</font> </li>\n</ul>\n<p><font size=\"2\"><a target=\"_blank\" href=\"http://www.awards-mart.com/IMG_II/col_colors_d2.jpg\"><img border=\"0\" alt=\"\" src=\"http://www.awards-mart.com/IMG_II/col_colors_d2.jpg\" /></a>&nbsp;</font></p>\n<blockquote style=\"MARGIN-RIGHT: 0px\" dir=\"ltr\">\n<p><strong>Note:</strong>&nbsp; This trophy can be built up to 72&quot; tall.&nbsp; Inquire for prices beyond 42&quot; tall.&nbsp; This trophy is shipped fully assembled.&nbsp;&nbsp;&nbsp;Protective packaging and shipping (UPS ground), is $20 each trophy when shipped to a non-rural addresses.&nbsp;&nbsp;Rural address customers&nbsp;add $10. </p>\n</blockquote>', null, null, null, 'AH40151', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'BT6B z.jpg', 'BT6B_d.jpg', 'BT6B_d2.jpg', 'Y');
