INSERT INTO `tpt_products` VALUES ('978', 'Brass Cup Perpetual Trophy', null, '<p><font size=\"3\">This is big, heavy, massive award.&nbsp; It is hand made by AwardsMart using 100% American made components.</font></p>\n<ul>\n    <li><font size=\"3\">The Cup is heavy gauge spun brass. </font></li>\n    <li><font size=\"3\">The Cup base is cast metal and brass plated. </font></li>\n    <li><font size=\"3\">The Pedestal base is Walnut and hardwoods. </font></li>\n    <li><font size=\"3\">The Plates for individual name engraving are brass. </font></li>\n    <li><font size=\"3\">The title plate on the face side of the trophy is Brass plated, etched magnesium. </font></li>\n</ul>\n<p><font size=\"3\">Extra cost options:</font></p>\n<ul>\n    <li><font size=\"3\">This trophy base can be built taller to allow for 15, 18 or 21 engraving plates on the face side.&nbsp; Plates can be added to the other side of the base. </font></li>\n    <li><font size=\"3\">This trophy can be built using silver plated and&nbsp; nickel silver materials.<br /></font></li>\n</ul>\n<p><font size=\"3\">Production time:&nbsp; 14 days</font></p>', null, null, null, 'AH40154', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'BT7A_z.jpg', 'BT7A_b.jpg', 'BT7A_a2.jpg', 'N');
