INSERT INTO `tpt_products` VALUES ('1266', 'Free Sample Program', null, '<p><font size=\"3\" face=\"Verdana\">A sampling program for award buyers who want to touch, feel, hold and examine before purchasing.&nbsp; AwardsMart will ship or mail to you a sample(s) of the award(s) that is being considered for purchase.</font></p>\n<p><font size=\"3\" face=\"Verdana\">The samples will be provided at no cost to you when the samples are returned within <strong>21</strong> days. Samples and associated freight cost will be charged to your credit card at the time of shipment.&nbsp; <u>The samples price is the lowest on-line price we offer, then discounted an</u> <u>additional 5%</u>.&nbsp; Return the samples within <strong>21</strong> days, using the return UPS shipment lable provided, and the award products charged to your credit card will be refunded.</font></p>\n<p><font face=\"Verdana\"><font size=\"3\"><strong><em>Bonus</em></strong>:&nbsp; When you purchase your AwardsMart awards and the purchase price exceeds $750, the cost of freight for the samples will be refunded too.</font></font></p>\n<p><font face=\"Verdana\"><font size=\"3\"><strong><em>Samples returned after 21 days</em></strong>, but returned before the 45th day, will be refunded at 50% of the cost of the samples.&nbsp; Shipping costs are non-refundable.</font></font></p>\n<p><font face=\"Verdana\"><font size=\"3\"><strong><em>After 45 days</em></strong>, award samples cannot be returned for a refund.</font></font></p>\n<p>&nbsp;</p>\n<h4>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Try us!&nbsp; AwardsMart - &quot;always quality awards&quot;..&nbsp;at the lowest price&nbsp; </h4>\n<p>&nbsp;</p>', null, null, null, 'SAMP_0001', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'NotAvailable.gif', 'Sample_PRG_D.jpg', 'Sample_PRG_A.gif', 'N');
