INSERT INTO `tpt_products` VALUES ('1359', 'Two Deck Cards and Dice Set', null, '<ul>\n    <li><font size=\"3\">Rosewood, low gloss finish presentation case </font></li>\n    <li><font size=\"3\">Gold hardware/hinges </font></li>\n    <li><font size=\"3\">Four large dice and 2 deck of cards </font></li>\n    <li><font size=\"3\">Fitted foam keeps cards and dice in place </font></li>\n    <li><font size=\"3\">Engraving area:&nbsp; 7 1/2&quot; x 4 1/2&quot; x 1 3/4&quot; </font></li>\n    <li><font size=\"3\">Rosewood case lid can be engraved </font>\n    <ul>\n        <li><font size=\"3\">individual name is included </font></li>\n        <li><font size=\"3\">text or copy lines = $4.00 each line </font></li>\n        <li><font size=\"3\">Logo = $12.50 </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Production time is 2-5 days <br /></font></li>\n</ul>', null, null, null, 'AM22200', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', '5C4401_z.jpg', '5C4401_D.jpg', '5C4401_A.jpg', 'N');
INSERT INTO `tpt_products` VALUES ('1360', 'Flask', null, '<ul>\n    <li><font size=\"3\">Rosewood, log gloss finish, presentation case </font></li>\n    <li><font size=\"3\">Gold hardware/hinges </font></li>\n    <li><font size=\"3\">Stainless flask, shot and funnel </font></li>\n    <li><font size=\"3\">Fitted foam keep accessories in place </font></li>\n    <li><font size=\"3\">Case size:&nbsp; 8 1/4&quot; x 8 1/4&quot; x 2 3/8&quot; </font></li>\n    <li><font size=\"3\">Rosewood case lid can be engraved: </font>\n    <ul>\n        <li><font size=\"3\">Individual name is included </font></li>\n        <li><font size=\"3\">Text or copy lines; $4.00 each line </font></li>\n        <li><font size=\"3\">Logo&nbsp;of your own; $14.75 set-up</font> </li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Flask can be engraved; please inquire</font> </li>\n    <li><font size=\"3\">Production time is 2 to 5 days</font> </li>\n</ul>\n<font size=\"3\">Makes a great gift for best man or groomsmen!</font>', null, null, null, 'Deck and Dice Set', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', 'N', '5C4604_D.jpg', '5C4604_A.jpg', 'AM22199', '1');
INSERT INTO `tpt_products` VALUES ('1361', 'Music Ribbon and Stars Trophy', null, '<ul>\n    <li><font size=\"3\">4 1/2&quot; tall star trophy </font></li>\n    <li><font size=\"3\">Golden bronze finished resin </font></li>\n    <li><font size=\"3\">Golden bronze star holds&nbsp;defined music notes and bars </font></li>\n    <li><font size=\"3\">Ribbon depicting the words &quot;Music&quot; under notes and bar </font></li>\n    <li><font size=\"3\">Three golden shooting stars rise from the base </font></li>\n    <li><font size=\"3\">Rectangle base holds engraving plate </font></li>\n    <li><font size=\"3\">Engraving of up to 3 lines of text is included </font></li>\n    <li><font size=\"3\">Production time is 3 to 5 days</font> </li>\n</ul>', null, null, null, 'AM20178', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'RVN_4435_Z.jpg', 'RVN_4435_D.jpg', 'RVN_4435_A.jpg', 'N');
INSERT INTO `tpt_products` VALUES ('1362', 'Golden Note Place Trophy', null, '<ul>\n    <li><font size=\"3\">Music placement trophies</font></li>\n    <li><font size=\"3\">Available in three sizes</font></li>\n    <ul>\n        <li><font size=\"3\">5 1/2&quot; tall</font></li>\n        <li><font size=\"3\">6 3/4&quot; tall</font></li>\n        <li><font size=\"3\">8 1/2&quot; tall </font></li>\n    </ul>\n    <li><font size=\"3\">Gold music note figure - always a favorite </font></li>\n    <li><font size=\"3\">Select your column color </font></li>\n    <li><font size=\"3\">Genuine white marble trophy base </font></li>\n    <li><font size=\"3\">Felted bottom marble base </font></li>\n    <li><font size=\"3\">Engraving plate is included </font></li>\n    <li><font size=\"3\">Engraving of up to 3 lines of text is included </font></li>\n    <li><font size=\"3\">Production time is 3 to 5 days</font> </li>\n</ul>\n<p><a target=\"_blank\" href=\"http://www.awards-mart.com/IMG_II/col_colors_d2.jpg\"><img border=\"0\" alt=\"\" src=\"http://www.awards-mart.com/IMG_II/col_colors_d2.jpg\" /></a></p>', null, null, null, 'AH40224', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'RVN_5478_Zoom.jpg', 'RVN_5478_D.jpg', 'RVN_5478_A.jpg', 'N');
