INSERT INTO `tpt_products` VALUES ('1448', 'Tri-Color Music Medallion', null, '<ul>\n    <li><font size=\"3\">2&quot; antique gold music medallion </font></li>\n    <li><font size=\"3\">Raised sculpted details included bright gold cup, silver harp, and old gold musical notes and treble clef symbol </font></li>\n    <li><font size=\"3\">Neck ribbon is included and attached to the medallion; choose your choice of colors </font></li>\n    <li><font size=\"3\">Engraved mylar with text on back; $1.10 extra per medal</font></li>\n    <li><font size=\"3\">Production time is 3 to 5 days</font> </li>\n</ul>\n<p><a target=\"_blank\" href=\"http://www.awards-mart.com/IMG_II/neckribbonsstock.jpg\"><img alt=\"\" src=\"http://www.awards-mart.com/img_ii/neckribbonsstock_d.jpg\" /></a></p>', null, null, null, 'AM20183', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'tr-230_Z.jpg', 'tr-230_D.jpg', 'tr-230_A.jpg', 'N');
