INSERT INTO `tpt_products` VALUES ('2137', 'Rising Silver Stars', null, '<ul>\n    <li><font size=\"3\">This award speaks achievement </font></li>\n    <li><font size=\"3\">Each of the 3 shooting stars are silver</font></li>\n    <li><font size=\"3\">Stars are highlighted in hand applied metallic gold paint </font></li>\n    <li><font size=\"3\">The sculpted oval pedestal is rosewood finished </font></li>\n    <li><font size=\"3\">The engraving plate is included; choose from:&nbsp;</font></li>\n    <ul>\n        <li><font size=\"3\">Gold </font></li>\n        <li><font size=\"3\">Silver </font></li>\n    </ul>\n    <li><font size=\"3\">Available in 2 heights: </font></li>\n    <ul>\n        <li><font size=\"3\">6 1/4&quot; tall </font></li>\n        <li><font size=\"3\">7 1/4&quot; tall </font></li>\n    </ul>\n    <li><font size=\"3\">Engraving of up to 4 lines of text is included </font></li>\n    <li><font size=\"3\">Production time </font><font size=\"3\">is 4 to 5 days</font> </li>\n</ul>', null, null, null, 'AM20244', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'rfc-996_Z2.jpg', 'rfc-996_D.jpg', 'rfc-996_A.jpg', 'N');
INSERT INTO `tpt_products` VALUES ('2138', 'Basketball Star Trophy', null, '<ul>\n    <li><font size=\"3\">6 1/2&quot; tall star shape basketall trophy </font></li>\n    <li><font size=\"3\">Hand painted ball details </font></li>\n    <li><font size=\"3\">Small gold star accent </font></li>\n    <li><font size=\"3\">Black pedestal with themed end details </font></li>\n    <li><font size=\"3\">Engraving plate is included </font></li>\n    <li><font size=\"3\">Engraving of up to 3 lines of text is included </font></li>\n    <li><font size=\"3\">Production time is 4 to 5 days</font> </li>\n</ul>', null, null, null, 'AH5098', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'AWM_0971_Z.jpg', 'AWM_0971_D.jpg', 'AWM_0971_A.jpg', 'N');
INSERT INTO `tpt_products` VALUES ('2139', 'Wooden Golf Award Plaque', null, '<ul>\n    <li><font size=\"3\">Embossed metal golf theme circle in a gold wreath holder </font></li>\n    <li><font size=\"3\">Plaque engraving plate matches the metal golf theme </font></li>\n    <li><font size=\"3\">Available in three colors: </font>\n    <ul>\n        <li><font size=\"3\">Gold </font></li>\n        <li><font size=\"3\">Silver </font></li>\n        <li><font size=\"3\">Bronze </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Plaque available in 2 sizes: </font>\n    <ul>\n        <li><font size=\"3\">7&quot; x 9&quot; </font></li>\n        <li><font size=\"3\">8&quot; x 10&quot; </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Engraving of up to 5 lines of text is included </font></li>\n    <li><font size=\"3\">Production time in as few as 4 days; normal production time is 5-7 days</font> </li>\n</ul>', null, null, null, 'AH40334', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'AWM_5487_Z.jpg', 'AWM_5487_D.jpg', 'AWM_5487_A.jpg', 'N');
INSERT INTO `tpt_products` VALUES ('2140', 'Auto Awards Trophy', null, '<ul>\n    <li><font size=\"3\">Tall three column trophy </font></li>\n    <li><font size=\"3\">Gold stars accent trim </font></li>\n    <li><font size=\"3\">Gold female victory figure </font></li>\n    <li><font size=\"3\">Available in 3 heights: </font>\n    <ul>\n        <li><font size=\"3\">23&quot; tall </font></li>\n        <li><font size=\"3\">25&quot; tall </font></li>\n        <li><font size=\"3\">27&quot; tall</font> </li>\n    </ul>\n    <font size=\"2\"><br /></font></li>\n</ul>\n<div style=\"MARGIN-LEFT: 40px\"><font size=\"2\"><font size=\"2\"><a target=\"_blank\" href=\"http://www.awards-mart.com/AM_web/Car_top\"><img border=\"2\" alt=\"\" width=\"200\" height=\"82\" src=\"http://www.awards-mart.com/IMG_II/Top_Fig_but.jpg\" /></a></font></font></div>\n<ul>\n    <li><font size=\"3\">U.S. Flag center is included </font></li>\n    <li><font size=\"3\">2&quot; x 4&quot; custom logo or photo print is included </font>\n    <ul>\n        <li><font size=\"3\">Initial set up for logo or photo printing $15 </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Genuine white marble foundation </font></li>\n    <li><font size=\"3\">Engraving plate is included </font></li>\n    <li><font size=\"3\">Engraving of up to 3 lines of text is included </font></li>\n    <li><font size=\"3\">Production time</font><font size=\"3\"> is 5 to 6 days </font></li>\n</ul>\n<p><em><font size=\"3\">Price is based on an <span style=\"FONT-WEIGHT: bold; COLOR: rgb(255,0,0)\">Included </span><span style=\"COLOR: rgb(255,0,0)\">top figure</span></font></em> </p>\n<font size=\"2\"><em><span style=\"COLOR: rgb(255,0,0)\"><br /></span></em></font>\n<p><font size=\"2\"><a target=\"_blank\" href=\"http://www.awards-mart.com/AM_web/Car_top\"></a></font></p>', null, null, null, 'AH40336', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'AWM_5476_Z.jpg', 'AWM_5476