INSERT INTO `tpt_products` VALUES ('2141', 'Three Column Auto Trophy', null, '<ul>\n    <li><font size=\"3\">Tall three column trophy </font></li>\n    <li><font size=\"3\">Gold eagles accent trim </font></li>\n    <li><font size=\"3\">Gold female and star victory figure </font></li>\n    <li><font size=\"3\">Available in 3 heights: </font></li>\n    <ul>\n        <li><font size=\"3\">27&quot; tall </font></li>\n        <li><font size=\"3\">29&quot; tall </font></li>\n        <li><font size=\"3\">31&quot; tall</font> </li>\n    </ul>\n</ul>\n<font size=\"2\"><a target=\"_blank\" href=\"http://www.awards-mart.com/AM_web/Car_top\"><img border=\"2\" alt=\"\" width=\"179\" height=\"77\" src=\"http://www.awards-mart.com/IMG_II/Top_Fig_but.jpg\" /></a></font>\n<ul>\n    <li><font size=\"3\">U.S. Flag center is included </font></li>\n    <li><font size=\"3\">2&quot; x 4&quot; custom logo or photo print is included </font>\n    <ul>\n        <li><font size=\"3\">Initial set up for logo or photo print is $15 </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Wooden walnut finish foundation and lid </font></li>\n    <li><font size=\"3\">Engraving plate is included </font></li>\n    <li><font size=\"3\">Engraving of up to 3 lines of text is included </font></li>\n    <li><font size=\"3\">Production time in as few as 3 days </font>\n    <ul>\n        <li><font size=\"3\">normal production time is 5-6 days</font> </li>\n    </ul>\n    </li>\n    <li><font size=\"3\"><span style=\"FONT-STYLE: italic\">Price is based on </span><span style=\"FONT-WEIGHT: bold; COLOR: rgb(255,0,0); FONT-STYLE: italic\">Included</span><span style=\"FONT-STYLE: italic\"> top figure</span></font> </li>\n</ul>', null, null, null, 'AH40338', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'AWM_5489_Z.jpg', 'AWM_5489_D.jpg', 'AWM_5489_A.jpg', 'N');
INSERT INTO `tpt_products` VALUES ('2142', 'Photography Services', null, '<div style=\"MARGIN: 0in 0in 10pt\"><font size=\"3\">Photography is an important element of memorable award presentations.&nbsp;&nbsp; The award captures, embodies and memorializes the nature of the achievement.&nbsp;The photographer captures the thrill of the presentation, the emotion of the magic moment for the award recipient and the sincerity of the presenter.</font></div>\n<div style=\"MARGIN: 0in 0in 10pt\"><font size=\"3\">People love to receive and display quality AwardsMart awards and trophies.&nbsp;An AwardsMart professional photographer will enhance the experience of you event for the attendees and capture the thrill and emotions of the people receiving awards.</font></div>', null, null, null, 'TOG_0001', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'NotAvailable.gif', 'CAM_D.gif', 'CAM_A.gif', 'N');
