INSERT INTO `tpt_products` VALUES ('2289', 'Optic Crystal Rhombus Award', null, '<ul>\n    <li><font size=\"3\">Four distinct, coordinating optic crystal rhombus spires&nbsp; </font></li>\n    <li><font size=\"3\">The well designed base continues the diamond theme </font></li>\n    <li><font size=\"3\">Available in 2 sizes: </font>\n    <ul>\n        <li><font size=\"3\">13 1/2&quot; tall x 4 3/4&quot; wide and deep </font></li>\n        <li><font size=\"3\">14 3/4&quot; tall x 4 3/4&quot; wide and deep </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Etched text and logo on the side of the diamond base is included </font>\n    <ul>\n        <li><font size=\"3\">Art logo preparation $14.75 </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Complimentary proof of text and art logo layout </font></li>\n    <li><font size=\"3\">Blue gift box presentation packaging is included </font></li>\n    <li><font size=\"2\"><font size=\"3\">Delivery time is 7 to 10 days</font><br /></font></li>\n</ul>\n<br />', null, null, null, 'AH74109', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', '8275 Rhombus_Z.jpg', '8275 Rhombus_D.jpg', '8275 Rhombus_A.jpg', 'N');
