INSERT INTO `tpt_products` VALUES ('2291', 'Torchier Crystal Trophy', null, '<ul>\n    <li><font size=\"3\">Individually crafted mouth-blown art glass in red, blue, and yellow colors </font></li>\n    <li><font size=\"3\">Available in 2 free flowing forms: </font>\n    <ul>\n        <li><font size=\"3\">14&quot; tall x 5 1/4&quot; wide </font></li>\n        <li><font size=\"3\">16&quot; tall x 5 1/4&quot; wide </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Each one of a kind art glass is elevated perfectly on its optic crystal base </font></li>\n    <li><font size=\"3\">Etching of your unique and custom award text on one side of the optic crystal cube base is included </font></li>\n    <li><font size=\"3\">Art logo preparation $14.75 </font></li>\n    <li><font size=\"3\">Complimentary proof of text and art logo layout </font></li>\n    <li><font size=\"3\">Complimentary shipping via UPS to any business address </font>\n    <ul>\n        <li><font size=\"3\">shipping to a rural business; + $5 </font></li>\n        <li><font size=\"3\">shipping to a rural or home address; +$6.75 </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Blue gift box presentation packaging is included </font></li>\n    <li><font size=\"3\">Delivery time is 7-10 days</font> </li>\n</ul>', null, null, null, 'AH74113', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', '222 Torchier_Z.jpg', '222 Torchier_D.jpg', '222 Torchier_A.jpg', 'N');
INSERT INTO `tpt_products` VALUES ('2292', 'Composition Crystal Trophy', null, '<ul>\n    <li><font size=\"3\">Inspired works of art and a masterful display of craftsmanship in one beautiful design </font></li>\n    <li><font size=\"3\">Swirls, patterns, and colors of red and gold in mouth-blown glass </font></li>\n    <li><font size=\"3\">Each fascinating piece is one of a kind elevated on an optic crystal base </font></li>\n    <li><font size=\"3\">Variances and slight imperfections may occur on this individually crafted magical free flowing form </font></li>\n    <li><font size=\"3\">Available in 2 sizes: </font>\n    <ul>\n        <li><font size=\"3\">11&quot; tall x 3 1/2&quot; wide x 2 1/2&quot; deep </font></li>\n        <li><font size=\"3\">13&quot; tall x 3 1/2&quot; wide x 2 1/2&quot; deep </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Etching of your custom award text on one side of the glass cube pedestal is included </font>\n    <ul>\n        <li><font size=\"3\">Logo art work; $14.75 preparation </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Complimentary text and art logo layout </font></li>\n    <li><font size=\"3\">Blue gift box presentation packaging is included </font></li>\n    <li><font size=\"3\">Production&nbsp;time is 7 to 10 days</font> </li>\n</ul>', null, null, null, 'AH74114', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', '225 Composition_Z.jpg', '225 Composition_D.jpg', '225 Composition_A.jpg', 'N');
INSERT INTO `tpt_products` VALUES ('2293', 'Helix Glass Globe Award', null, '<ul>\n    <li><font size=\"3\">A stunning mouth blown work of art with swirls and patterns of turquoise blue colors </font></li>\n    <li><font size=\"3\">Each glass globe piece is individually hand crafted </font></li>\n    <li><font size=\"3\">No two pieces are identical; each will vary in design and color </font></li>\n    <li><font size=\"3\">Elevated and perfectly balanced on its own optic crystal base</font> </li>\n    <li><font size=\"3\">Available in 2 sizes: </font>\n    <ul>\n        <li><font size=\"3\">6 1/2&quot; tall x 3 1/2&quot; wide </font></li>\n        <li><font size=\"3\">7 1/2&quot; tall x 4 1/2&quot; wide </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Complimentary etching of your custom text on one side of the glass cube base </font></li>\n    <li><font size=\"3\">Art logo preparation $14.75</font><font size=\"3\">&nbsp;</font> </li>\n    <li><font size=\"3\">Production&nbsp;time is 7 to 10 days</font> </li>\n</ul>', null, null, null, 'AH74115', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', '238 Helix_Z.jpg', '238 Helix_D.jpg', '238 Helix_A.jpg', 'N');
INSERT INTO `tpt_products` VALUES ('2294', 'Optic Omni Globe Award', null, '<ul>\n    <li><font size=\"3\">Premium optic crystal globe and pedestal combines quality and stylish setting </font></li>\n    <li><font size=\"3\">Cast metal, antique gold finish metal circles </font></li>\n    <li><font size=\"3\">12 3/4&quot; tall x 7&quot; wide </font></li>\n    <li><font size=\"3\">Pyramid shape pedestal is etched with your custom text and or logo </font>\n    <ul>\n        <li><font size=\"3\">Logo art preparation $14.75 </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Complimentary proof of text and logo art layout </font></li>\n    <li>\n    <div style=\"TEXT-ALIGN: left; MARGIN: 0in 0in 0pt\"><font size=\"3\">Blue gift box packaging </font></div>\n    </li>\n    <li><font size=\"2\"><font size=\"3\">Production&nbsp;time is 7 to 10 days</font><br /></font></li>\n</ul>', null, null, null, 'AH74106', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', '400 Optic Omni Globe_Z.jpg', '400 Optic Omni Globe_D.jpg', '400 Optic Omni Globe_A.jpg', 'N');
