INSERT INTO `tpt_products` VALUES ('2297', 'Whirlwind Art Glass', null, '<ul>\n    <li><font size=\"3\">Discriminating art glass created from inspired works of art displays master craftsmanship </font></li>\n    <li><font size=\"3\">Magical swirls and patterns are suspended in a free flowing form </font></li>\n    <li><font size=\"3\">Each is one of a kind; individually crafted and will vary in color, design - no two are identical </font></li>\n    <li><font size=\"3\">This fascinating mouth blown design of blue swirls in a sphere is elevated perfectly on its optic crystal base </font></li>\n    <li><font size=\"3\">Available in 2 sizes: </font>\n    <ul>\n        <li><font size=\"3\">7 1/2&quot; tall x 3&quot; wide </font></li>\n        <li><font size=\"3\">8 3/4&quot; tall x 4&quot; wide </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Etching of custom award text and art logo on one side of the optic crystal cube is included </font>\n    <ul>\n        <li><font size=\"3\">Logo art preparation $14.75 </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Complimentary proof of text and art logo layout </font></li>\n    <li><font size=\"3\">Complimentary shipping to non-rural business address </font>\n    <ul>\n        <li><font size=\"3\">Rural business address + $5 </font></li>\n        <li><font size=\"3\">Rural home address + $6.75 </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Blue gift box presentation packaging is included </font></li>\n    <li><font size=\"3\">Delivery time is 7 to 10 days<br /></font></li>\n</ul>', null, null, null, 'AH74119', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', '0601 Whirlwind_Z.jpg', '0601 Whirlwind_D.jpg', '0601 Whirlwind_A.jpg', 'N');
