INSERT INTO `tpt_products` VALUES ('2493', 'Bowling Large Medallion Plaque', null, '<ul>\n    <li><font size=\"3\">6&quot; wide x 8&quot; tall plaque </font></li>\n    <li><font size=\"3\">4-1/8&quot; tall multi-color, multi-level medallion </font></li>\n    <li><font size=\"3\">A gold &amp; silver finish borders this medallion </font></li>\n    <li><font size=\"3\">The medallion background is simulated hardwood finish </font></li>\n    <li><font size=\"3\">The flying pins are the focal point </font></li>\n    <li><font size=\"3\">A black engraving plate bordered with gold is included </font></li>\n    <li><font size=\"3\">Engraving up to 4 text lines is included </font></li>\n    <li><font size=\"3\">Production time is 4 to&nbsp;6 days</font> </li>\n</ul>', null, null, null, 'AH40530', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'Bowling Coach Relief Plaque_Cherry_II_Z.jpg', 'Bowling Coach Relief Plaque_Cherry_II_D.jpg', 'Bowling Coach Relief Plaque_Cherry_II_A.jpg', 'N');
INSERT INTO `tpt_products` VALUES ('2494', 'Bronze Bowling Clock', null, '<ul>\n    <li><font size=\"3\">5&quot; tall award </font></li>\n    <li><font size=\"3\">Sculpted bowling pins and ball in bronzed finish </font></li>\n    <li><font size=\"3\">Bowling pin rings and clock bezel are gold </font></li>\n    <li><font size=\"3\">Engraving plate is gold </font></li>\n    <li><font size=\"3\">Deep colored rosewood is oval </font></li>\n    <li><font size=\"3\">Engraving of up to 3 lines of text is included </font></li>\n    <li><font size=\"3\">Production time is 3 to 5 days </font></li>\n</ul>\n<p><font size=\"3\">A great gift for your coach or sponsor!</font></p>', null, null, null, 'AM10988', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'RTC1041B_Z.jpg', 'RTC1041B_D.jpg', 'RTC1041B_A.jpg', 'N');
INSERT INTO `tpt_products` VALUES ('2495', 'Toilet Bowl Bowling Award', null, '<ul>\n    <li><font size=\"3\">5&quot; tall trophy </font></li>\n    <li><font size=\"3\">A perfect award for lousy bowlers with a sense of humor </font></li>\n    <li><font size=\"3\">This is a big award with a 4&quot; x 3&quot; footprint. </font></li>\n    <li><font size=\"3\">The ball is 2&quot; diameter </font></li>\n    <li><font size=\"3\">Rosewood finish pedestal base </font></li>\n    <li><font size=\"3\">The gold engraving plate is included </font></li>\n    <li><font size=\"3\">Engraving of up to 3 lines of text is included </font></li>\n    <li><font size=\"3\">Production time is 3-5 days</font> </li>\n</ul>', null, null, null, 'AH40476', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', '51R0RhYf3IL._SS500_Z.jpg', '51R0RhYf3IL._SS500_D.jpg', '51R0RhYf3IL._SS500_A.jpg', 'N');
INSERT INTO `tpt_products` VALUES ('2496', 'Double Octagon Marble Award', null, '<ul>\n    <li><font size=\"3\">Beautiful, massive and unique </font></li>\n    <li><font size=\"3\">Chocolate marble and verona marble combined into a unique, distinctive award </font></li>\n    <li><font size=\"3\">Ample area for your recognition text and logo engraved directly into the marble </font></li>\n    <li><font size=\"3\">Available in 3 impressive sizes: </font>\n    <ul>\n        <li><font size=\"3\">6&quot; wide x 5&quot; tall x 2 1/2&quot; deep </font></li>\n        <li><font size=\"3\">7&quot; wide x 6&quot; tall x 2 1/2&quot; deep </font></li>\n        <li><font size=\"3\">8&quot; wide x 7&quot; tall x 2 1/2&quot; deep </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Text set up is included up to 6 lines of text; </font>\n    <ul>\n        <li><font size=\"3\">Logo preparation $14.75 </font></li>\n        <li><font size=\"3\">Metallic silver or gold engraving; +$6 </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Complimentary proof of text and art logo included </font></li>\n    <li><font size=\"3\">Production time is 5 to 7 days</font> </li>\n</ul>', null, null, null, 'AM03102', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'TA-213_Z.jpg', 'TA-213_D.jpg', 'TA-213_A.jpg', 'N');
