INSERT INTO `tpt_products` VALUES ('2505', 'Photo And Engraving Plaque', null, '<ul>\n    <li><font size=\"3\">Piano finished rosewood plaque </font></li>\n    <li><font size=\"3\">Available in 3 sizes: </font>\n    <ul>\n        <li><font size=\"3\">8&quot; x 10&quot;</font> </li>\n        <li><font size=\"3\">9&quot; x 12&quot; </font></li>\n        <li><font size=\"3\">10 1/2&quot; x 13&quot;</font> </li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Black metal plate engraves to gold </font></li>\n    <li><font size=\"3\">Golf Florentine border on engraving plate </font></li>\n    <li><font size=\"3\">Engraving of text and logo is included </font></li>\n    <li><font size=\"3\">New logo preparation $14.75 set-up</font> </li>\n    <li><font size=\"3\">Photo image is printed onto metal </font></li>\n    <li><font size=\"2\"><font size=\"3\">Production time is 4 to 6 days</font><br /></font></li>\n</ul>', null, null, null, 'AH40477', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'AWM_2408_Z.jpg', 'AWM_2408_D.jpg', 'AWM_2408_A.jpg', 'N');
