INSERT INTO `tpt_products` VALUES ('2511', 'The Big One Fishing Trophy', null, '<ul>\n    <li><font size=\"3\">7 1/2&quot; tall fisherman with a big catch </font></li>\n    <li><font size=\"3\">Dimensional details of the big catch and fisherman are in Spanish gold finish </font></li>\n    <li><font size=\"3\">Hand painted bright gold border wreath on oval resin symbolizes victory and champion </font></li>\n    <li><font size=\"3\">A smooth bronze finish on&nbsp;an oval pedestal </font></li>\n    <li><font size=\"3\">A gold finished engraving plate is included </font></li>\n    <li><font size=\"3\">Engraving of up to 3 lines of text is included </font></li>\n    <li><font size=\"3\">Production time is 3-5 days </font></li>\n</ul>\n<p><font size=\"3\">Commemorate the &quot;Big One&quot; with this award and relive the memories!</font></p>', null, null, null, 'AM10948', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'RFH509_Z.jpg', 'RFH509_D.jpg', 'RFH509_A.jpg', 'N');
INSERT INTO `tpt_products` VALUES ('2512', 'Fishing Stars Trophy', null, '<ul>\n    <li><font size=\"3\">6&quot; tall resin trophy with a colorful fishing insert </font></li>\n    <li><font size=\"3\">The finish is brushed gold and Spanish gold </font></li>\n    <li><font size=\"3\">Brush gold stars swoosh to accentuate the 2&quot; fishing insert </font></li>\n    <li><font size=\"3\">A bronze color oval pedestal holds the engraving plate </font></li>\n    <li><font size=\"3\">A gold finished engraving plate is included </font></li>\n    <li><font size=\"3\">Engraving of up to 4 lines of text is included </font></li>\n    <li><font size=\"3\">Production time is 3 to 5 days </font></li>\n</ul>', null, null, null, 'AM10949', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'Fish_RFN19_Z.jpg', 'Fish_RFN19_D.jpg', 'Fish_RFN19_A.jpg', 'N');
INSERT INTO `tpt_products` VALUES ('2513', 'Bass Master 3D Oval Trophy', null, '<ul>\n    <li><font size=\"3\">3-D Bass &quot;Burst-Thru&quot; </font></li>\n    <li><font size=\"3\">7 &frac14;&quot; wide x 5 &frac34;&quot; tall </font></li>\n    <li><font size=\"3\">Self-standing with included peg </font></li>\n    <li><font size=\"3\">The engraving plate is included </font></li>\n    <li><font size=\"3\">Text engraving up to 4 copy lines is included </font></li>\n    <li><font size=\"3\">Production time is 3 to 6 days</font> </li>\n</ul>', null, null, null, 'AH55127', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', '359_Z.jpg', '359_D.jpg', '359_A.jpg', 'N');
INSERT INTO `tpt_products` VALUES ('2514', 'Rosewood Picture Clock', null, '<ul>\n    <li><font size=\"3\">A great combination for any desk; clock and picture of your &quot;big catch&quot; </font></li>\n    <li><font size=\"3\">Overall size is 7 3/4&quot; wide x 1 1/2&quot; thick x 5 1/4&quot; tall </font></li>\n    <li><font size=\"3\">Piano rosewood and oval gold finished metal base </font></li>\n    <li><font size=\"3\">Quartz clock with gold bezel; battery is included </font></li>\n    <li><font size=\"3\">The gold engraving plate is included </font></li>\n    <li><font size=\"3\">Engraving of up to 4 lines of text is included </font></li>\n    <li><font size=\"3\">Production time is 3 to 5 days </font></li>\n</ul>', null, null, null, 'AM10950', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'GL35_FSH_Z.jpg', 'GL35_FSH_D.jpg', 'GL35_FSH_A.jpg', 'N');
INSERT INTO `tpt_products` VALUES ('2515', 'Engravable Fishing Desk Frame', null, '<ul>\n    <li><font size=\"3\">1/4&quot; thick green tint crescent shape glass </font></li>\n    <li><font size=\"3\">The glass is beveled on all sides and is self standing </font></li>\n    <li><font size=\"3\">The photo mounting frame is gold </font></li>\n    <li><font size=\"3\">Available in 2 sizes: </font>\n    <ul>\n        <li><font size=\"3\">3 1/2&quot; x 5&quot; photo holder/ frame is 7&quot; tall x 9&quot; wide </font></li>\n        <li><font size=\"3\">4&quot; x&nbsp; 6&quot; photo holder/frame is 8&quot; tall x 10&quot; wide </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Text engraving into the glass is included </font>\n    <ul>\n        <li><font size=\"3\">the engraved text is milky white </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Logo engraving is available, $14.75 logo preparation </font></li>\n    <li><font size=\"3\">Production time is 4 to 6 days </font></li>\n</ul>\n<p><font size=\"2\"><font size=\"3\">Show off the &quot;Big Catch&quot; or other memorable event in this beautiful jade green crescent shape photo frame.</font> </font></p>', null, null, null, 'AM10951', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'GL315_FSH_Z.jpg', 'GL315_FSH_D.jpg', 'GL315_FSH_A.jpg', 'N');
INSERT INTO `tpt_products` VALUES ('2516', 'Bass Master Award', null, '<ul>\n    <li><font size=\"3\">Gold hand painted action bass taking the bait </font></li>\n    <li><font size=\"3\">Beautifully blue and green fishing scene accentuates gold dimensional bass </font></li>\n    <li><font size=\"3\">Hand painted gold border and shooting stars </font></li>\n    <li><font size=\"3\">Award can hang or displayed with accompanied peg </font></li>\n    <li><font size=\"3\">Size is 6&quot; tall x 7 1/2&quot; wide </font></li>\n    <li><font size=\"3\">A gold engraving plate is included </font></li>\n    <li><font size=\"3\">Engraving of up to 3 lines of text is included </font></li>\n    <li><font size=\"3\">Production time is 2 to 4 days</font> </li>\n</ul>', null, null, null, 'AM10960', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'MX_2010_oval_Z.jpg', 'MX_2010_oval_D.jpg', 'MX_2010_oval_A.jpg', 'N');
INSERT INTO `tpt_products` VALUES ('2517', 'Bass Master Trophy Plaque', null, '<ul>\n    <li><font size=\"2\">Big colorful, dimensional resin plaque mount</font> </li>\n    <li><font size=\"2\">Gold hand painted bass against blue and green fishing scene</font> </li>\n    <li><font size=\"2\">Plaque is 9&quot; wide x 12&quot; tall</font> </li>\n    <li><font size=\"2\">Plaque is cherry finished </font></li>\n    <li><font size=\"2\">Two areas for engraving recognition text</font> </li>\n    <li><font size=\"2\">Engraving plate for both areas is included</font> </li>\n    <li><font size=\"2\">Engraving of up to 8 lines of text is included</font> </li>\n    <li><font size=\"2\">Production time is 2-4 days</font> </li>\n</ul>', null, null, null, 'AM10961', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'RF-3731_PLQ_Z.jpg', 'RF-3731_PLQ_D.jpg', 'RF-3731_PLQ_A.jpg', 'N');
