INSERT INTO `tpt_products` VALUES ('2519', 'Fishin Oval Resin', null, '<ul>\n    <li><font size=\"3\">&quot;Hooked the Big One&quot; fishing scene </font></li>\n    <li><font size=\"3\">Oval resin in silver with hand painted gold highlights and border </font></li>\n    <li><font size=\"3\">Dimensional bass in foreground is caught by the dedicated fisherman in a boat background </font></li>\n    <li><font size=\"3\">Overall size is 8 1/2&quot; wide x 8&quot; tall </font></li>\n    <li><font size=\"3\">Ribbon pedestal holds a 1&quot; x 3&quot; gold engraving plate, included </font></li>\n    <li><font size=\"3\">Engraving of up to 4 lines of text is included </font></li>\n    <li><font size=\"3\">Production time is 4 to 5 days </font></li>\n</ul>\n<p><font size=\"3\"></font></p>', null, null, null, 'AH50151', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'HR_54624GS_Z.jpg', 'HR_54624GS_D.jpg', 'HR_54624GS_A.jpg', 'N');
INSERT INTO `tpt_products` VALUES ('2520', 'Fishin Oval Plaque', null, '<ul>\n    <li><font size=\"3\">&quot;Hooked the Big One&quot; scene oval resin </font></li>\n    <li><font size=\"3\">Silver finish award with gold border and highlights </font></li>\n    <li><font size=\"3\">Overall oval size is 8 1/2&quot; wide x 8&quot; tall </font></li>\n    <li><font size=\"3\">Ribbon pedestal holds a 1&quot; x 3&quot; gold engraving plate, included </font></li>\n    <li><font size=\"3\">Oval engraving plate includes up to 3 lines of text, included </font></li>\n    <li><font size=\"3\">The plaque is 10 1/2&quot; wide x&nbsp; 13&quot; tall </font></li>\n    <li><font size=\"3\">The plaque is available in 5 wood finish colors (see zoom) </font></li>\n    <li><font size=\"3\">The gold, black border plaque plate is included </font></li>\n    <li><font size=\"3\">Engraving of up to 4 lines of text is included </font></li>\n    <li><font size=\"3\">Production time is 4 to 5 days </font></li>\n</ul>\n<p><font size=\"3\"></font></p>', null, null, null, 'AH50152', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'HR_54624GS_PLQ_Z.jpg', 'HR_54624GS_PLQ_D.jpg', 'HR_54624GS_PLQ_A.jpg', 'N');
INSERT INTO `tpt_products` VALUES ('2521', 'Blue Waves Acrylic Fishing Award', null, '<ul>\n    <li><font size=\"3\">Crystal clear acrylic with a mirrored blue reflective bottom </font></li>\n    <li><font size=\"3\">The design within the acrylic and the blue reflective color gives the appearance of blue waves </font></li>\n    <li><font size=\"3\">The 1&quot; thickness allows this acrylic awrd to be self-standing </font></li>\n    <li><font size=\"3\">The award is available in 3 sizes </font>\n    <ul>\n        <li><font size=\"3\">3 1/2&quot; wide x 5&quot; tall x 1&quot; thick </font></li>\n        <li><font size=\"3\">4 1/4&quot; wide x 6&quot; tall x&nbsp; 1&quot; thick </font></li>\n        <li><font size=\"3\">5&quot; wide x 7&quot; tall x&nbsp; 1&quot; thick </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Engraving of text and logo is included </font></li>\n    <li><font size=\"3\">Engraving is bright white </font></li>\n    <li><font size=\"3\">Logo or artwork preparation $14.75 set up </font></li>\n    <li><font size=\"3\">Production time is 3 to 5 days</font> </li>\n</ul>\n<p>&nbsp;</p>', null, null, null, 'AM10953', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'DT9C_FSH_Z.jpg', 'DT9C_FSH_D.jpg', 'DT9C_FSH_A.jpg', 'N');
INSERT INTO `tpt_products` VALUES ('2522', 'Engravable LED Flashlight', null, '<ul>\n    <li><font size=\"3\">LED flashlight </font></li>\n    <li><font size=\"3\">9 bulb </font></li>\n    <li><font size=\"3\">Super bright white light </font></li>\n    <li><font size=\"3\">Mini sized 3 1/2&quot; long x 1&quot; diameter </font>\n    <ul>\n        <li><font size=\"3\">perfect for purse or pocket </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">The housing is aluminum </font></li>\n    <li><font size=\"3\">The flashlight is available in 3 colors </font>\n    <ul>\n        <li><font size=\"3\">Black </font></li>\n        <li><font size=\"3\">Blue </font></li>\n        <li><font size=\"3\">Red </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">3 AAA batteries required, are included </font></li>\n    <li><font size=\"3\">Engraving on the barrel is included </font></li>\n    <li><font size=\"3\">Maximum area for engraving is 1&quot; x 7/16&quot; tall </font></li>\n    <li><font size=\"3\">Production time is 4 to 6 days</font> </li>\n</ul>\n<p>&nbsp;</p>', null, null, null, 'AM22313', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'GFT075_FSH_Z.jpg', 'GFT077_FSH_D.jpg', 'GFT077_FSH_A.jpg', 'N');
INSERT INTO `tpt_products` VALUES ('2523', 'Color Fishing Tournament Plaque', null, '<ul>\n    <li><font size=\"3\">Custom printed metal plate plaque </font></li>\n    <li><font size=\"3\">Metal plate is available in 3 color choices to compliment your artwork </font>\n    <ul>\n        <li><font size=\"3\">Gold </font></li>\n        <li><font size=\"3\">Silver </font></li>\n        <li><font size=\"3\">White </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Print includes logo, text, variable award title and individual winner name </font></li>\n    <li><font size=\"3\">The print image can be full color (no metallic ink) </font></li>\n    <li><font size=\"3\">The plaque is available in 5 sizes in landscape or portrait orientation </font>\n    <ul>\n        <li><font size=\"3\">5&quot; x 7&quot; </font></li>\n        <li><font size=\"3\">6&quot;&nbsp;x&nbsp;8&quot; </font></li>\n        <li><font size=\"3\">7&quot; x 9&quot; </font></li>\n        <li><font size=\"3\">8&quot; x 10&quot; </font></li>\n        <li><font size=\"3\">9&quot; x 12&quot; </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">The plaque is available in 5 finishes (see zoom) </font></li>\n    <li><font size=\"3\">Design artwork set up $38.00 </font></li>\n    <li><font size=\"2\"><font size=\"3\">Production time is 4 to 6 days</font> </font></li>\n</ul>', null, null, null, 'AH40571', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'Fishing_Tournament_Plaque_Z.jpg', 'Fishing_Tournament_Plaque_D.jpg', 'Fishing_Tournament_Plaque_A.jpg', 'N');
