INSERT INTO `tpt_products` VALUES ('2525', 'Engravable Multi-Tool', null, '<ul>\n    <li><font size=\"3\">14 Function multi-tool with pouch carrying case </font></li>\n    <li><font size=\"3\">Tool measures 4&quot; in length when closed </font></li>\n    <li><font size=\"3\">Tempered steel tools include: </font>\n    <ul>\n        <li><font size=\"3\">Phillips screwdriver </font></li>\n        <li><font size=\"3\">Awl </font></li>\n        <li><font size=\"3\">Saw </font></li>\n        <li><font size=\"3\">Scissors </font></li>\n        <li><font size=\"3\">Knife </font></li>\n        <li><font size=\"3\">Serrated knife </font></li>\n        <li><font size=\"3\">File </font></li>\n        <li><font size=\"3\">Corkscrew with assist </font></li>\n        <li><font size=\"3\">Bottle opener </font></li>\n        <li><font size=\"3\">Small, medium &amp; large&nbsp;flathead screwdrivers </font></li>\n        <li><font size=\"3\">Needle nose pliers </font></li>\n        <li><font size=\"3\">Wire cutters </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Engraving of up to 2 lines of text is included </font>\n    <ul>\n        <li><font size=\"3\">One logo on a handle surface is included (instead of text) </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">Available handle colors </font>\n    <ul>\n        <li><font size=\"3\">Black </font></li>\n        <li><font size=\"3\">Blue </font></li>\n        <li><font size=\"3\">Red </font></li>\n    </ul>\n    </li>\n    <li><font size=\"2\"><font size=\"3\">Production time is 4 to 6 days</font> </font></li>\n</ul>', null, null, null, 'AM22314', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'GFT041_open2_Z.jpg', 'GFT041_open2_D.jpg', 'GFT041_open2_A.jpg', 'N');
