INSERT INTO `tpt_products` VALUES ('2645', 'Pageant Single Bling Medallion', null, '<ul>\n    <li><font size=\"3\">2 &frac14;&quot; diameter &quot;bling&quot; medallion </font></li>\n    <li><font size=\"3\">Available glitter&nbsp;colors: </font>\n    <ul>\n        <li><font size=\"3\">Blue bling </font></li>\n        <li><font size=\"3\">Red bling </font></li>\n        <li><font size=\"3\">White&nbsp;bling </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">The inner area is 2&quot; diameter and holds the design of your choice </font>\n    <ul>\n        <li><font size=\"3\">Choose any designs shown or make it custom (see zoom) </font></li>\n        <li><font size=\"3\">Custom designs:&nbsp; $14.75 art and set up services </font></li>\n    </ul>\n    </li>\n    <li><font size=\"3\">A 30\' neck ribbon is included; select your color </font></li>\n    <li><font size=\"3\">Engraved mylar with text on back; $1.25 extra per medal</font><font size=\"3\"> </font></li>\n    <li><font size=\"3\">Production time&nbsp;is</font><font size=\"3\"> 6 to 7 days</font> </li>\n</ul>\n<font size=\"2\"><img alt=\"\" src=\"http://www.awards-mart.com/img_ii/neckribbonsstock_d.jpg\" /><br /></font>', null, null, null, 'AM30125', null, '00000000000', '00000000000', 'http://placehold.it/300x300', 'http://placehold.it/300x300', '1', 'PAG_Bling_Z.jpg', 'S_BLING_PAG_D.gif', 'S_BLING_PAG_A.gif', 'N');
